('Not... with the Light. But I know first aid.','',254134,0,0,1022,68,0,4,249035,0,0,0,0,0,0,0,56110),
('Thank you, $n. Please help as many others as you can find.','',254135,0,0,1005,68,0,4,0,0,0,0,0,0,0,0,56110),
('','I\'m more fighter than healer! Anduin, can you--',254181,0,0,0,68,0,4,0,249034,0,0,0,0,0,0,56110),
('','That will do. We\'ll send the injured your way.',254189,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','Aelric thinks the shadows will save him. He should see what true power looks like...',254198,0,0,1,68,0,4,0,249116,0,0,0,0,0,0,56110),
('You seem familiar with the past.','You seem familiar with the past.',254308,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Did I hear that right, earlier? You\'re a... Lothar?','',254313,0,0,6,68,0,4,243921,0,0,0,0,0,0,0,56110),
('','You know the name?',254315,0,0,273,68,0,4,0,243922,0,0,0,0,0,0,56110),
('Know it? I was named for Anduin Lothar, one of Stormwind\'s greatest heroes. He was close friends with my grandfather, King Llane Wrynn.','',254316,0,0,1005,68,0,4,243923,0,0,0,0,0,0,0,56110),
('','Wait, if your grandfather was king of this... Stormwind, then--',254320,0,0,669,68,0,4,0,243927,0,0,0,0,0,0,56110),
('','Anduin, my new friend... are you a king?',254322,0,0,6,68,0,4,0,243928,0,0,0,0,0,0,56110),
('Not anymore.','',254323,0,0,0,68,0,4,243929,0,0,0,0,0,0,0,56110),
('...So don\'t you start using formalities on me, either.','',254324,0,0,669,68,0,4,243930,0,0,0,0,0,0,0,56110),
('','We have much to learn from the past.',254486,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Hey, pal.','Hey, pal.',254491,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('How\'s it goin\', buddy?','How\'s it goin\', buddy?',254492,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('You got more work for me?','You got more work for me?',254493,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('I\'m workin\' here.','I\'m workin\' here.',254494,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Foreman\'s always watchin\'.','Foreman\'s always watchin\'.',254495,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Always more work to do.','Always more work to do.',254496,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Yeah?','Yeah?',254497,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Make it quick','Make it quick',254498,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Keep busy.','Keep busy.',254499,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Get it done.','Get it done.',254500,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Back to work.','Back to work.',254501,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Tell me about it.','Tell me about it.',254502,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Less talking. More working.','Less talking. More working.',254503,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Just do your part.','Just do your part.',254505,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Praise the Machine.','Praise the Machine.',254506,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('If you\'ve got nothing better to do, I can make you do something. Or I could just... fix you.','If you\'ve got nothing better to do, I can make you do something. Or I could just... fix you.',254507,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('We\'ve got tools. We\'ve got hammers. We\'ve got weapons. Which one should I use on you first?','We\'ve got tools. We\'ve got hammers. We\'ve got weapons. Which one should I use on you first?',254508,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('','When Nozdormu showed me that my sister\'s death was her choice--her sacrifice--it made me question the rest of the \"true timeline.\" What other moments of sorrow or anger had life-saving consequences?\n\nWhen the mists of Pandaria parted, the Horde and Alliance brought their conflict to these shores and awoke a slumbering evil. But... perhaps it was all necessary to bring about a brighter future.\n\nIt is time to reflect on the past with a new perspective. That is why I am here, along with those of the infinite dragonflight whom I could convince to join me.',254742,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','I remain skeptical of Nozdormu\'s faith in it, but I am willing to give his wisdom the benefit of the doubt.\n\nHelp us or leave us to our work.',254743,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Relive this timeline so that we may observe its events from a new perspective.\n\nWe will be watching you.',254744,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Lady Proudmoore! Over here! I found $n!','Lady Proudmoore! Over here! I found $n!',254918,0,0,0,68,0,4,248902,0,0,0,0,0,0,0,56110),
('I\'ll get these rocks off you. Just let me--Ahh!','',254919,0,0,0,68,0,4,248904,0,0,0,0,0,0,0,56110),
('<Zee-Zee emits a happy beep.>','',255068,0,0,0,64,0,4,247377,0,0,0,0,0,0,0,56110),
('<ZZ-01-47 emits a wary beep.>','',255069,0,0,0,64,0,4,247374,0,0,0,0,0,0,0,56110),
('<ZZ-01-47 emits a confused beep.>','',255070,0,0,0,64,0,4,247375,0,0,0,0,0,0,0,56110),
('','Curse them all! Where did they take him? Do you see Anduin?',255505,0,0,22,68,0,4,0,249190,0,0,0,0,0,0,56110),
('','They dragged him down! I lost track of him!',255506,0,0,22,68,0,4,0,249191,0,0,0,0,0,0,56110),
('','Ash! We can\'t let them reach Mereldar! Blast them apart!',255507,0,0,22,68,0,4,0,249192,0,0,0,0,0,0,56110),
('','Incoming! I\'ll show them the Sacred Flame\'s blaze!',255508,0,0,15,68,0,4,0,0,0,0,0,0,0,0,56110),
('','We\'ve beaten them back! Let\'s get Anduin!',255509,0,0,22,68,0,4,0,249195,0,0,0,0,0,0,56110),
('','Hold on! We don\'t know what\'s down there! Reinforcements are on the way, we could wait--',255510,0,0,669,68,0,4,0,249196,0,0,0,0,0,0,56110),
('','We\'ll lose his trail!',255511,0,0,6,68,0,4,0,249197,0,0,0,0,0,0,56110),
('','You\'re right. Let\'s make those monsters pay for everything they\'ve done!',255512,0,0,669,68,0,4,0,249198,0,0,0,0,0,0,56110),
('','Oh no, don\'t you start using formalities on me! My family is noble, but it\'s been long since we\'ve seen great fortune.',255659,0,0,669,68,0,4,0,243925,0,0,0,0,0,0,56110),
('The Sacred Flame glows bright with Holy energy. Perhaps the energy can be harnessed by someone in tune with Holy magic.','The Sacred Flame glows bright with Holy energy. Perhaps the energy can be harnessed by someone in tune with Holy magic.',255730,0,118314,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('The Sacred Flame glows bright with Holy energy.','The Sacred Flame glows bright with Holy energy.',255731,0,118315,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Harness the power of the Sacred Flame.','Harness the power of the Sacred Flame.',255732,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Everything has its time.','',255760,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('We forge our own futures.\n\nWith enough bronze, I can forge yours. I will be able to upgrade your equipment... momentarily.','',255768,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','When studying the timelines, we infinite dragons usually seek to change things for the better. But Nozdormu has told us to leave these events as they were.\n\nLuckily, he didn\'t say anything about changing your part in them!\n\n<Moratari winks.>\n\nWe will always find a way to conduct proper research.',255800,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','With this cloak\'s temporal magic, you can see and collect the scattered threads of time. Such threads can be found anywhere within this timeline, from enemies you defeat to treasures you collect.\n\nYour cloak will absorb the threads on its own, permanently increasing its power.\n\nThere is no limit to how many threads you can collect. The possibilities are infinite!',255821,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('We will have everything in time.','',256068,0,0,396,0,0,4,0,0,396,0,0,0,0,0,56110),
('Whatever you\'re making, Momentus can forge it for you.','Whatever you\'re making, Momentus can forge it for you.',256069,0,0,396,0,0,4,0,0,0,0,0,0,0,0,56110),
('Can I? Hah! This will take only a moment.','',256071,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('There. Go in good time. May you forge your own future.','',256073,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Anything you don\'t need, we can scrap! Bwaahahaha!','',256156,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('You warp the fabric of time itself!','',256160,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('You think yourselves clever, refusing to change the original timeline but finding loopholes in your mortal champions.','You think yourselves clever, refusing to change the original timeline but finding loopholes in your mortal champions.',256161,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('You know not what echoes from your prying!','You know not what echoes from your prying!',256162,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','People are experiencing visions of a \"Radiant Song\" all across Azeroth. We have reason to believe it\'s a warning of some kind.',256267,0,0,1,0,0,13,0,244517,0,0,0,0,0,0,56110),
('','Meet me in Silithus. Perhaps Azeroth\'s Speaker can shed some light on what this warning might mean.',256268,0,0,0,0,0,13,0,244518,0,0,0,0,0,0,56110),
('There is a vision being seen across Azeroth. A \"Radiant Song.\" We believe it\'s a warning, but we are unsure of its meaning.','',256269,0,0,0,0,0,13,244519,0,0,0,0,0,0,0,56110),
('Meet me in Silithus. We must ask Azeroth\'s Speaker what this vision means.','',256270,0,0,0,0,0,13,244520,0,0,0,0,0,0,0,56110),
('','Another vision. You saw it too.',256271,0,0,6,0,0,7,0,244521,0,0,0,0,0,0,56110),
('They\'re growing stronger.','',256272,0,0,1,0,0,7,244522,0,0,0,0,0,0,0,56110),
('It seems destiny has brought us all here. \n\nThey call it the Radiant Song, yet it fills me with dread. What could it be warning us of?','',256275,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('<Anduin smiles wearily.>\n\nMissing. You put it so nicely.\n\nI ran. From my kingdom. From the Alliance. From myself.\n\nBut I was sent this vision for a reason. I can\'t run. Not from this.','',256277,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('It has been too long, my friend. It seems destiny has brought us both here.\n\nThey\'re calling it the Radiant Song. Yet... it fills me with dread.','',256278,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('<Anduin smiles wearily.>\n\nNowhere in particular. No need for a destination when I was only trying... to run.\n\nFrom my Kingdom. From the Alliance. From myself.\n\nBut I was sent this vision for a reason. I can\'t keep running. Not from this.','',256280,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('Never before has Azeroth called out so strongly to us. And despite the radiance of these visions, I fear that there\'s a dark reason for them.','',256281,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('','Locus-Walker told us that the people of his homeworld once received a vision not unlike the Radiant Song. And then K\'aresh fell to shadow. \n\nBy the time the ethereals realized their world was warning them of the coming danger, it was already too late.\n\nWe cannot allow the same thing to happen on Azeroth.',256282,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('','A stowaway? Whoever you are, I need all hands on deck!',256294,0,0,603,0,0,4,0,0,0,0,0,0,0,0,56110),
('','A contentious moment in time. One that echoes into the present.\n\nMoratari and the others will be waiting at a nearby village with supplies.\n\nI expect to learn much from watching your progress.',256357,0,0,1,0,0,4,0,0,1,0,0,0,0,0,56110),
('This will be a struggle. I\'m a bit rusty with the whole \"speaking with the soul of our world\" thing. But the ritual is prepared and that\'s that, I suppose.\n\nI\'ll try speaking with her. Though I warn ye, champion. It might be for the last time.\n\nAre ye ready?','',256535,0,0,0,0,0,4,0,0,6,0,0,0,0,0,56110),
('Azeroth!','',256537,0,0,5,102,0,6,244050,0,0,0,0,0,0,0,56110),
('I can... hear her voice!','',256538,0,0,5,102,0,6,244051,0,0,0,0,0,0,0,56110),
('<pained scream>','',256543,0,0,1,102,0,6,244054,0,0,0,0,0,0,0,56110),
('Magni!','',256545,0,0,5,102,0,6,244536,0,0,0,0,0,0,0,56110),
('He\'s alive. But barely.','',256548,0,0,1,102,0,6,244537,0,0,0,0,0,0,0,56110),
('','We need to get him to Dalaran.',256550,0,0,0,102,0,6,0,0,0,0,0,0,0,0,56110),
('','Da... What have you done to yourself this time?',256552,0,0,1,0,0,7,0,244541,0,0,0,0,0,0,56110),
('He tried to commune directly with Azeroth. It seems the strain was... too much.','',256553,0,0,1,0,0,7,244540,0,0,0,0,0,0,0,56110),
('Oh! Well, my ma is Moira Thaurissan and my da was Emperor Dagran Thaurissan. I\'m named after him, see. That\'s why I\'m the second.\n\nWhich I suppose makes me a prince, but I fancy myself more of a scholar. That\'s why I\'m in Dalaran! I\'m trying tae learn all I can about the world.','',256555,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('','Moira Thurissan, Queen-Regent of the Dark Irons. I represent my clan in the Council of Three Hammers. I also happen tae be Magni\'s daughter.\n\nSome will say I betrayed Ironforge by marrying the emperor of their greatest enemies. However, the current circumstance speaks for itself. The dwarf clans now live in peace as equals, and I can assure you that it was my efforts that made that possible.',256572,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('I hear no one\'s seen him for a few years...','',256574,0,0,0,0,0,7,244524,0,0,0,0,0,0,0,56110),
('','The fewer who know about our mission, the better.',256621,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','We will equip you with an artifact of the infinite. A cloak that adapts and changes as you do.\n\nNozdormu is opposed to altering the past. But we are not doing so, are we? The events that transpire here will remain the same.\n\nIt is you who will be different.',256658,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Just a moment. You need a drake first!\n\nWhich drake companion would you like?\n\n|cnRED_FONT_COLOR:<This decision is permanent, but you will eventually be able to collect them all.>|r','',256779,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('An excellent choice.\n\nOnce you have learned how to summon the drake, it can be found with your other mounts in your collection.','',256784,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Vigor is spent on dragonriding abilities, such as using |TInterface\\ICONS\\Ability_DragonRiding_ForwardFlap01.BLP:20|t |cFFFF0000|Hspell:372608|h[Surge Forward]|h|r for forward momentum and |TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[Skyward Ascent]|h|r for upward momentum.\n\nYou regain vigor while on the ground or while flying at high speeds, indicated by |TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[Thrill of the Skies]|h|r.\n\nDuring races, you may also find green orbs of vigor that can be collected by flying through them.','',256822,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('What have you learned this time?','What have you learned this time?',256843,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
