('Good to see you, champion! How fare your hunts?','',257520,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Patience wins wars. But if Aeonicus asks another question she will swallow my shield.',257556,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
