('Let $Ghim:her; think, Lida. We offer quite a selection.','Let $Ghim:her; think, Lida. We offer quite a selection.',257618,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('Offers? My wares are full price!','Offers? My wares are full price!',257619,0,0,396,0,0,4,0,0,0,0,0,0,0,0,56110),
('You speak the truth? Your artifact will repair the Awakening Machine?','',257629,0,0,0,68,0,4,246205,0,0,0,0,0,0,0,56110),
('','It will perfect the Machine. Your struggle, your suffering will be at an end. All will awaken... because of you.',257632,0,0,0,68,0,4,0,249489,0,0,0,0,0,0,56110),
('Because of me...','',257633,0,0,0,68,0,4,246206,0,0,0,0,0,0,0,56110),
('','[CUT, DO NOT RECORD] Is there a price you wouldn\'t pay?',257636,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','Your people will be restored. Reborn. Improved. And they will laud you as their savior.',257638,0,0,0,68,0,4,0,249490,0,0,0,0,0,0,56110),
('Yes... yes! All earthen will awaken!','',257641,0,0,0,68,0,4,246207,0,0,0,0,0,0,0,56110),
