('','The Rostrum of Transformation is where you may select a different appearance for your drake based on what you have seen and discovered.\n\nRostrums of Transformation can be found in several locations if you wish to choose a new look. Look for the dragon head symbol on your map.',257911,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
