('Magni\'s wounds are beyond my knowledge. We need to consult the mages of Dalaran.','',258001,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('Magni is stable for now, but I don\'t know how long it will take for him to recover. \n\nAt least he\'s with family.','',258002,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('Troubling times lie ahead. But don\'t they always?\n\nAt least we can face them together.','',258003,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Perhaps we took Magni\'s powers for granted all this time. Communing with the elements is dangerous enough. But to commune with an entire world?\n\nI only hope he recovers quickly.','',258004,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('I don\'t believe we should blame Azeroth for this outcome. Magni knew the risks of connecting with her with such reluctance in his heart.\n\nNow we can only hope that he was able to hear her message in the end.','',258006,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('','Magni will recover. He must. And not just because he is a dear friend.\n\nWe need to learn what Azeroth told him. Before it\'s too late.',258008,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
