('','A lot of folks think of modern day earthen as dwarven ancestors, but that\'s not quite right. More like... cousins?\n\nStill, we\'re all family. And I\'m as excited as a whelp with a duckie for a possible reunion.',264130,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('Everyone seems on edge, don\'t you think? Can\'t possibly think why.\n\nOh, right. The horrible visions of destruction. The entire reason Dalaran is teleporting to Khaz Algar. I remember now.','',264131,0,0,0,0,0,4,0,0,1,0,0,0,0,0,56110),
('Do you wish to return?','',264159,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','The expedition built the Priory as a place to contemplate the mysteries of Beledar.',264197,0,0,0,64,0,8,0,251154,0,0,0,0,0,0,56110),
('','Dailcry was an Arathi hero. How could the Priory force him to turn against Hallowfall?',264206,0,0,0,64,0,8,0,251163,0,0,0,0,0,0,56110),
('With the resurgence of ancient Azerothian threats, we must look to the past to better understand our future.\n\nDo not dismiss your history so hastily. There is still much power within these once revolutionary relics.','',264275,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Welcome adventurer. Do you have a question about dragonriding?',264582,0,0,0,0,0,4,0,0,0,0,0,0,0,0,55664),
('','Only the finest for you.',264591,0,0,0,64,0,2,0,250667,0,0,0,0,0,0,56110),
('','Interested in the unusual?',264592,0,0,0,64,0,2,0,250669,0,0,0,0,0,0,56110),
('','The weave has delivered a customer!',264594,0,0,0,64,0,2,0,250671,0,0,0,0,0,0,56110),
('','Elix kat\'aj.',264595,0,0,0,64,0,2,0,250661,0,0,0,0,0,0,56110),
('','Do return again.',264596,0,0,0,64,0,2,0,250663,0,0,0,0,0,0,56110),
('','You are appreciated.',264597,0,0,0,64,0,2,0,250665,0,0,0,0,0,0,56110),
('','Look what the weave brought.',264598,0,0,0,64,0,2,0,250655,0,0,0,0,0,0,56110),
('','We meet again.',264599,0,0,0,64,0,2,0,250657,0,0,0,0,0,0,56110),
('','Don\'t panic. It\'s just me.',264600,0,0,0,64,0,2,0,250659,0,0,0,0,0,0,56110),
('','Kahet iz korvan.',264601,0,0,0,64,0,2,0,250649,0,0,0,0,0,0,56110),
('','May your threads hold strong.',264602,0,0,0,64,0,2,0,250651,0,0,0,0,0,0,56110),
('','Weave protect you.',264603,0,0,0,64,0,2,0,250653,0,0,0,0,0,0,56110),
('Alleria. I heard you helped corner Zirix at the Meadery. Thank you.','',264954,0,0,0,68,0,4,252107,0,0,0,0,0,0,0,56110),
('','The nerubians took so much from us. I will not let them do the same to the earthen.',264955,0,0,0,68,0,4,0,252108,0,0,0,0,0,0,56110),
('They\'ve been good allies... and gracious hosts.','',264956,0,0,0,68,0,4,252109,0,0,0,0,0,0,0,56110),
('','A welcome surprise, given that they\'ve been living in isolation for thousands of years.',264957,0,0,0,68,0,4,0,252110,0,0,0,0,0,0,56110),
('That may not be entirely the case.','',264958,0,0,0,68,0,4,252111,0,0,0,0,0,0,0,56110),
('I asked about why they keep calling me \"Arathi\"... and apparently an Arathi armada arrived on Khaz Algar a number of years ago.','',264959,0,0,0,68,0,4,252112,0,0,0,0,0,0,0,56110),
('They\'re said to have formed a settlement in the caverns beneath the island. It sounds impossible...','',264960,0,0,0,68,0,4,252113,0,0,0,0,0,0,0,56110),
('But if it\'s true, I want to see it for myself. They could prove to be allies in our fight against Xal\'atath.','',264962,0,0,0,68,0,4,252114,0,0,0,0,0,0,0,56110),
('','No. We\'ve secured a measure of safety here. Don\'t abandon it to chase shadows in the dark.',264963,0,0,0,68,0,4,0,252115,0,0,0,0,0,0,56110),
('Isn\'t that what you\'re doing?','',264965,0,0,0,68,0,4,252116,0,0,0,0,0,0,0,56110),
('','I\'m doing what I must. Hunting down every last nerubian. Following their trail back to Xal\'atath. And claiming vengeance for our dead.',264966,0,0,0,68,0,4,0,252117,0,0,0,0,0,0,56110),
('I\'m sorry, I didn\'t mean to--','',264968,0,0,0,68,0,4,252118,0,0,0,0,0,0,0,56110),
('','Remain in Dornogal, Anduin. Leave the shadows to me.',264969,0,0,0,68,0,4,0,252119,0,0,0,0,0,0,56110),
('Have you ever felt your path led to something... greater?','',264979,0,0,0,64,0,4,251985,0,0,0,0,0,0,0,56110),
('Pleased to be of service.','',264980,0,0,0,64,0,4,251986,0,0,0,0,0,0,0,56110),
('My directive is to protect the Unbound.','',264981,0,0,0,64,0,4,251987,0,0,0,0,0,0,0,56110),
('Find your path. Whatever it is.','',264982,0,0,0,64,0,4,251988,0,0,0,0,0,0,0,56110),
('Stay vigilant.','',264983,0,0,0,64,0,4,251989,0,0,0,0,0,0,0,56110),
('Resuming directive.','',264984,0,0,0,64,0,4,251990,0,0,0,0,0,0,0,56110),
('Come back later. And bring me a cinderbrew.','',264985,0,0,0,64,0,4,251979,0,0,0,0,0,0,0,56110),
('May your path be forthright.','',264986,0,0,0,64,0,4,251980,0,0,0,0,0,0,0,56110),
('Back to it, then. Whatever \"it\" is.','',264987,0,0,0,64,0,4,251981,0,0,0,0,0,0,0,56110),
('Work cycle enthusiastically paused.','',264988,0,0,0,64,0,4,251982,0,0,0,0,0,0,0,56110),
('Other than enjoying the finer things, I have not found my \"path.\"','',264989,0,0,0,64,0,4,251983,0,0,0,0,0,0,0,56110),
('Really good daydream... interrupted.','',264990,0,0,0,64,0,4,251984,0,0,0,0,0,0,0,56110),
('','Task interrupted.',264991,0,0,0,64,0,4,0,251991,0,0,0,0,0,0,56110),
('','My directive is... mining, I guess.',264992,0,0,0,64,0,4,0,251992,0,0,0,0,0,0,56110),
('','Do you need ore or gems? I can help with that.',264993,0,0,0,64,0,4,0,251993,0,0,0,0,0,0,56110),
('','Work cycle... resuming.',264994,0,0,0,64,0,4,0,251994,0,0,0,0,0,0,56110),
('','May you find your path without difficulty.',264995,0,0,0,64,0,4,0,251995,0,0,0,0,0,0,56110),
('','Oh. Sorry. May your path be unburdened.',264996,0,0,0,64,0,4,0,251996,0,0,0,0,0,0,56110),
('Follow all Edicts.','Follow all Edicts.',265002,0,0,0,64,0,4,253730,253731,0,0,0,0,0,0,56110),
('Grow closer, outlander.','Grow closer, outlander.',265003,0,0,0,64,0,4,253738,253739,0,0,0,0,0,0,56110),
('Tending cycle interrupted.','Tending cycle interrupted.',265004,0,0,0,64,0,4,253740,253741,0,0,0,0,0,0,56110),
('May Freya guide you.','May Freya guide you.',265005,0,0,0,64,0,4,253742,253746,0,0,0,0,0,0,56110),
('Tend your own garden.','Tend your own garden.',265006,0,0,0,64,0,4,253743,253745,0,0,0,0,0,0,56110),
('Resuming tending cycle.','Resuming tending cycle.',265007,0,0,0,64,0,4,253747,253748,0,0,0,0,0,0,56110),
('Greetings adventurer. Marshal Reginald Windsor at your service. I have reason to believe the forces of Onyxia have taken root nearby.\n\nWe have supplies at the ready for those who would aid in our fight.','',265012,0,0,0,0,0,4,0,0,66,0,0,0,0,0,56110),
('I knew you would come, $n. It is good to see you again my friend.\n\nIf you desire any supplies, you need simply ask.','',265013,0,0,0,0,0,4,0,0,66,0,0,0,0,0,56110),
('Haha! What\'s that supposed to...\n\nI...\n\nThank you, $n.','',265023,0,0,0,0,0,4,0,0,1005,0,0,0,0,0,56110),
('Greetings, $n. This land is harsh and cold, but the Light watches over all of us.\n\nThe time to strike is nigh.','',265076,0,0,0,0,0,4,0,0,669,0,0,0,0,0,56110),
('<grunt>','',265353,0,0,1,102,0,6,251319,0,0,0,0,0,0,0,56110),
('What are ye trying to tell us?','',265403,0,0,5,102,0,6,251344,0,0,0,0,0,0,0,56110),
('<Kurdran squats down to examine Squally.>\n\nAye then, what\'s the problem lil\' lass?\n\n<Squally warbles something of an explanation.>\n\nLonely? Ach, the poor thing misses her family! Ye just need tae find her brothers and sisters.','',265572,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('After N\'Zoth was defeated, Azeroth\'s voice began to grow quieter. At first I dinnae think much of it. She was safe and didn\'t need her Speaker to look after her.\n\nBut that silence left me thinking. If she didn\'t need me, then what was my purpose? Why was I still like... this.\n\nAnd that question grew and grew until it turned out that I dinnae want to speak with her. And so I didn\'t.','',265700,0,0,0,0,0,4,0,0,6,0,0,0,0,0,56110),
('Lookin\' for a lift? Best deal right here, pal. actually, it\'s the only deal! I\'m the boss of this sky market, see? So, where\'s it you\'re headed today?','Lookin\' for a lift? Best deal right here, pal. actually, it\'s the only deal! I\'m the boss of this sky market, see? So, where\'s it you\'re headed today?',265701,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('A goblin with a cloudrook?','A goblin with a cloudrook?',265703,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('','You must wait! Pets not done resting.',265822,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Welcome to Stormwind, the heart of the human kingdom.\n\nI have news that may interest you.','',266363,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Welcome to Orgrimmar, the Horde\'s seat of power.\n\nI have news that may interest you.','',266398,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','This might be the most important battle of them all. For our world, worth fighting for!',266403,0,0,3,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Dragons, dragons, dragons! I\'m definitely not biased...',266404,0,0,3,0,0,4,0,0,0,0,0,0,0,0,56110),
('I feel the earthen have come a long way since last we were here in the Archive.','',266845,0,0,0,68,0,4,255702,0,0,0,0,0,0,0,56110),
('','A factual statement. When I first answered your queries, the Archive was lost to us. As were the Stonevault and Awakening Machine.',266846,0,0,0,68,0,4,0,255703,0,0,0,0,0,0,56110),
('','But now we have a future. And slowly we will also have our past. Largely we have you and your \"clan\" to thank for it.',266847,0,0,0,68,0,4,0,255704,0,0,0,0,0,0,56110),
('Ye needn\'t mention it, High Speaker. I\'m just glad ye\'ll be around for... as long as ye were meant to be.','',266848,0,0,0,68,0,4,255705,0,0,0,0,0,0,0,56110),
('','Thank you. I will admit that I approach that prospect with some trepidation.',266849,0,0,0,68,0,4,0,255706,0,0,0,0,0,0,56110),
('','The earthen that are emerging from the Stonevault will take our culture to the ends of Azeroth, but...',266850,0,0,0,68,0,4,0,255707,0,0,0,0,0,0,56110),
('','Who knows what lurks here in our past? What will we uncover about our purpose and the titans?',266851,0,0,0,68,0,4,0,255708,0,0,0,0,0,0,56110),
('I hadna thought o\' that. Well, come what may, I\'ll be here to help ye.','',266852,0,0,0,68,0,4,255709,0,0,0,0,0,0,0,56110),
('','Your continued assistance is appreciated. I feel... you have made me feel as though I am part of your \"clan.\"',266856,0,0,0,68,0,4,0,255710,0,0,0,0,0,0,56110),
('To properly be part o\' my clan ye\'d have to marry my Gran\'da or the like. But that would nae work for many reasons.','',266857,0,0,0,68,0,4,255711,0,0,0,0,0,0,0,56110),
('','Brinthe looks puzzled.',266858,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('That was a joke, Brinthe. Ye\'ll always be part o\' my clan--blood, water, or stone.','',266859,0,0,0,68,0,4,255712,0,0,0,0,0,0,0,56110),
('Show... me... what... you\'ve... got.','',266862,0,0,0,64,0,4,0,0,0,0,0,0,0,0,56110),
('Communication in--Ah. Sorry. Hello!','',266879,0,0,0,64,0,2,254754,0,0,0,0,0,0,0,56110),
('What path brought you here?','',266880,0,0,0,64,0,2,254755,0,0,0,0,0,0,0,56110),
('Speak freely. No directive needed.','',266881,0,0,0,64,0,2,254756,0,0,0,0,0,0,0,56110),
('Let\'s commit our meeting to memory.','',266882,0,0,0,64,0,2,254757,0,0,0,0,0,0,0,56110),
('Follow no directives but your own.','',266883,0,0,0,64,0,2,254758,0,0,0,0,0,0,0,56110),
('Returning to task! Goodbye!','',266884,0,0,0,64,0,2,254759,0,0,0,0,0,0,0,56110),
('Free cinderbrew for everyone--tomorrow!','',266885,0,0,0,64,0,2,254760,0,0,0,0,0,0,0,56110),
('Oh, hello there. Finally got a bit of time to chat now. If you\'re lookin\' fer me da, he\'s over by the Great Anvil.','Oh, hello there. Finally got a bit of time to chat now. If you\'re lookin\' fer me da, he\'s over by the Great Anvil.',267051,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Officially? Not very long. After Grumnus retired, I picked up most of his work orders when I could.\n\nBut after ol\' Ironus suddenly packed up and bolted, Myolor here found himself in need of a bit o\' help.\n\nNo idea where Ironus went off to, by the way. He gifted me his hammer and ran off, muttering something about coming out of retirement. \n\nNow that I think about it, I don\'t think he\'s ever been retired to tell you the truth--he\'s worked in the Great Forge longer than any of us!','Officially? Not very long. After Grumnus retired, I picked up most of his work orders when I could.\n\nBut after ol\' Ironus suddenly packed up and bolted, Myolor here found himself in need of a bit o\' help.\n\nNo idea where Ironus went off to, by the way. He gifted me his hammer and ran off, muttering something about coming out of retirement. \n\nNow that I think about it, I don\'t think he\'s ever been retired to tell you the truth--he\'s worked in the Great Forge longer than any of us!',267151,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Our group was attacked within a delve by a monster named Zekvir.',267279,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','He is the Hand of the Harbinger... Xal\'atath.',267280,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','There\'s something within the delves that she doesn\'t want people to find.',267281,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
