('','I... sleep...',267525,0,0,0,64,0,15,0,256185,0,0,0,0,0,0,56110),
('','Ow...',267527,0,0,0,64,0,15,0,0,0,0,0,0,0,0,56110),
('','Overcrawler!',267528,0,0,0,64,0,15,0,256188,0,0,0,0,0,0,56110),
('','Kill!',267529,0,0,0,64,0,15,0,256189,0,0,0,0,0,0,56110),
('','Smash you!',267530,0,0,0,64,0,15,0,256190,0,0,0,0,0,0,56110),
('','Oh my, that shouldn\'t be happening!',267575,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Let me try reversing the positron array...',267576,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Hurray! And no one exploded even a little!',267577,0,0,603,0,0,4,0,0,0,0,0,0,0,0,56110),
('','We don\'t have to tell anyone about this, right?',267578,0,0,6,0,0,4,0,0,0,0,0,0,0,0,56110),
('Hey! Watch where you\'re portaling!','',267579,0,0,603,0,0,4,0,0,0,0,0,0,0,0,56110),
('I\'m trying to bank here!','',267582,0,0,603,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Turns out the real reward was the friends we made along the way! Well, that and the ability to punch holes in space to check our banks from anywhere. But mostly the friends.',267611,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('','And it turns out that the more people that share a Warband Bank, the faster it recharges. Looks like the magic of friendship is cold hard science! Or something like that, anyway.',267614,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('','That\'s not how either of those work!',267615,0,0,603,0,0,4,0,0,0,0,0,0,0,0,56110),
('','I can\'t wait to dump all my ore into the bank for you, Crags. I couldn\'t blacksmith my way out of a paper bag, but that sword you made Arnott is almost as sharp as Rivet!',267617,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('And I\'ll leave any mail I find in there for you and Kralla, Blue.','',267619,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Dibs on any cloth! And let me know if anyone needs anything enchanted. I can always use the practice.',267620,0,0,1,0,0,4,0,0,0,0,0,0,0,0,56110),
('','Hey, $n! All you have to do is hit the go button!',267778,0,0,3,0,0,4,0,0,0,0,0,0,0,0,56110),
('Ha! I have you cornered now, you pilfering little weave-trash!','',268099,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','Gracious. The little fly thinks he\'s a proper spider, but he cannot even tell when he\'s caught in a web.',268100,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('By the-- who do you think you are? I\'ll have you know I am one of Ansurek\'s most prized--','',268104,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','You seem to be laboring under the assumption that I care a wit for who you claim to be. I do not. But I WILL tell you who I am. And I will tell you what you are.',268105,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','I am the Widow Arak\'nai, the stewardess of Queen Neferess\' legacy and the one who weaves the threads of a free Azj-Kahet. And you, Meesk, are nothing more than a trifling supper.',268108,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','Come now, my little ones. It is dinner time.',268109,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('No... Stay back...! AHHHH!','',268111,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('','How pitiful. Come, my little morsel. Let us return to more pleasant webs. You\'ve done well.',268113,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('Take a step back. This here is a trap.','',268353,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('Brann Bronzebeard and the Explorers\' League! Cease your explorations.','',268360,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('Otherwise you shall face Zekvir, Hand of the Harbinger. We are watching. We are waiting.','',268361,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('Ye better believe we won\'t be stopping! I\'ll continue exploring tae see if I can find out who exactly this \"Zekvir\" is.','',268362,0,0,0,68,0,4,0,0,0,0,0,0,0,0,56110),
('Which profession trainer are you looking for?','Which profession trainer are you looking for?',268537,0,0,0,1,0,4,0,0,0,0,0,0,0,0,56110),
('The life of a smith is not an easy one, but it puts steel in yer bones and fire in yer heart. My da\' was a smith, my grandfather before him in the forges beneath Grim Batol. And now my son follows in our footsteps. \n\nI have no doubt that boy will one day step up to be Keeper of the Great Forge. But until that day comes, I think I\'ll stick around a little while longer. \n\nI\'m startin\' to get use to being addressed as \'Master Blacksmith Rotgath\' to tell ye the truth.','The life of a smith is not an easy one, but it puts steel in yer bones and fire in yer heart. My da\' was a smith, my grandfather before him in the forges beneath Grim Batol. And now my son follows in our footsteps. \n\nI have no doubt that boy will one day step up to be Keeper of the Great Forge. But until that day comes, I think I\'ll stick around a little while longer. \n\nI\'m startin\' to get use to being addressed as \'Master Blacksmith Rotgath\' to tell ye the truth.',269022,7,0,0,1,0,4,0,0,0,0,0,0,0,0,56110),
('Who sent you?','Who sent you?',269143,0,0,0,64,0,15,259458,259459,0,0,0,0,0,0,56110),
('Where were you assigned?','Where were you assigned?',269144,0,0,0,64,0,15,259460,259461,0,0,0,0,0,0,56110),
('What are you doing here?','What are you doing here?',269145,0,0,0,64,0,15,259462,259463,0,0,0,0,0,0,56110),
('I will be watching.','I will be watching.',269146,0,0,0,64,0,15,259452,259453,0,0,0,0,0,0,56110),
('Kahet iz korvan.','Kahet iz korvan.',269147,0,0,0,64,0,15,259454,259455,0,0,0,0,0,0,56110),
('The queen sees all.','The queen sees all.',269148,0,0,0,64,0,15,259456,259457,0,0,0,0,0,0,56110),
('I will be watching.','I will be watching.',269149,0,0,0,64,0,15,259464,259465,0,0,0,0,0,0,56110),
('Kahet iz korvan.','Kahet iz korvan.',269150,0,0,0,64,0,15,259466,259467,0,0,0,0,0,0,56110),
('The queen sees all.','The queen sees all.',269151,0,0,0,64,0,15,259468,259469,0,0,0,0,0,0,56110),
('Who sent you?','Who sent you?',269152,0,0,0,64,0,15,259470,259471,0,0,0,0,0,0,56110),
('Where were you assigned?','Where were you assigned?',269153,0,0,0,64,0,15,259472,259473,0,0,0,0,0,0,56110),
('What are you doing here?','What are you doing here?',269154,0,0,0,64,0,15,259474,259475,0,0,0,0,0,0,56110),
('Some of our earthen allies have conjured a portal leading to Dornogal, their capital city on the Isle of Dorn in Khaz Algar. You can find it on the lower level of our portal room.','Some of our earthen allies have conjured a portal leading to Dornogal, their capital city on the Isle of Dorn in Khaz Algar. You can find it on the lower level of our portal room.',270065,0,0,0,0,0,4,0,0,0,0,0,0,0,0,56110),
('Thrall nods to Lufsela with respect.','',271141,0,0,0,68,0,10,0,0,0,0,0,0,0,0,56110);
INSERT INTO `broadcast_text_locale` VALUES
(197696,'deDE','','Die Verschmähten haben ihre stärksten Krieger in dieser Gegend stationiert. Beweist Eure Tapferkeit und erledigt sie!',55664),
(197697,'deDE','','Heute habt Ihr gezeigt, dass wir dem Zweifel nicht nachgeben. Die Bastion wird niemals aufgeben!',55664),
(197702,'deDE','Die Verräter aus meinem früheren Haus haben hier eine Hochburg. Zerschmettert ihre Mauern!','',55664),
(197703,'deDE','Vergessenheit ist noch zu gütig dafür, dass sie Krexus verraten haben. Habt Dank, dass Ihr Gerechtigkeit walten lassen habt.','',55664),
(210355,'deDE','','Genug! Eure Gegenwehr endet hier!',55664),
(220584,'deDE','Seht Eure Verdammnis!','',55664),
(221430,'deDE','','Die Magie der Djaradin manipuliert die Elemente gegen uns. Unterstützt Erdenruferin Yevaa in ihrem Kampf gegen sie.',55664),
(221431,'deDE','','Hervorragende Arbeit. Die Djaradin sind nicht die Einzigen, die Elemente manipulieren können.',55664),
(221889,'deDE','','Die Tuskarr von Uktulut sind vorzügliche Kämpfer. Es kann uns nur helfen, ihr Vertrauen zu gewinnen.',55664),
(221890,'deDE','','Gute Arbeit. Hoffentlich ebnet uns das den Weg zu einem stärkeren Bündnis.',55664),
(221920,'deDE','','Die üppigen Gärten der Lebensbecken haben Schädlinge angezogen. Wir können nicht zulassen, dass sie die Sicherheit der Welpen bedrohen.',55664),
(221921,'deDE','','Gut gemacht. Die Pfleger können ihrer Arbeit jetzt in Ruhe nachgehen.',55664),
(224315,'deDE','Die Erde kniet!','',55664),
(224316,'deDE','Die Flamme unterwirft sich!','',55664),
(224317,'deDE','Der Himmel verbeugt sich!','',55664),
(224320,'deDE','Der Frost gehorcht!','',55664),
(224866,'deDE','','Meine Wut ist grenzenlos!',55664),
(224957,'deDE','','Blitzeinschlag!',55664),
(224958,'deDE','','Donnerschmettern!',55664),
(228750,'deDE','','Diese Gnolle belästigen uns seit Generationen. So leid es mir tut, ihr Häuptling muss sterben.',55664),
(228751,'deDE','','Es bricht mir das Herz, aber auch unsere Geduld hat ein Ende. Danke, dass Ihr das Nötige getan habt.',55664),
(230669,'deDE','Wusstet Ihr, dass die Geier auf ihre eigenen Füße koten, um sie zu kühlen? Und manche können sogar Magensäure weit ausspucken, um sich zu verteidigen!','',55664),
(236158,'deDE','Das Alteractal hat seit Jahren keine solche Aufregung erlebt!\n\nWas ist so besonders am heutigen Tag, das so hohen Besuch rechtfertigt?','',55664),
(241312,'deDE','','Wir haben mehr als eine dieser \"Schriften\" ausgegraben, die von der Oberfläche kommen... Tinte auf Papier.',55664),
(241313,'deDE','','Papier! Tinte! Pah... Sind für uns Niffen völlig nutzlos! Wir sehen nicht gut. Wir brauchen etwas, das wir fühlen können!',55664),
(241314,'deDE','','Keine Ahnung, was sie sich dabei gedacht haben... aber ich werde etwas dagegen unternehmen!',55664),
(241317,'deDE','','Wenn ich diese machterfüllte Rune mit diesem Glas kombiniere, dann noch das magische Pigment dazugebe...',55664),
(241318,'deDE','','DUFTIFIKATION!',55664),
(241320,'deDE','','Das nenne ich Scridorsas Geruchssicht! Jetzt haben die Worte eigene Gerüche!',55664),
(241321,'deDE','','Und weil ich jetzt endlich all diese Schriftrollen und Folianten erschnüffeln kann, habe ich viel zu tun! Geht jetzt... und danke!',55664),
(241322,'deDE','','Meine Güte, wie skandalös! Oh! Das hat sie nicht gesagt!',55664),
(242707,'deDE','Da seid Ihr ja. Versucht, euch zu vertragen.','',55664),
(242978,'deDE','Wer hat Euch diesen Zauberstab gegeben?','',55664),
(242982,'deDE','','Ich hatte nur etwas Spaß...',55664),
(243765,'deDE','Jaina, du hättest jemanden verletzen können. Magie ist viel zu gefährlich für dich!','',55664),
(243766,'deDE','','Ja, Vater.',55664),
(243861,'deDE','','Diese Verkleidung wird Euch dabei helfen, in Tiragardesund nicht aufzufallen. Sie erlaubt es Euch zudem, Jainas Zauber zu bannen.',55664),
(244054,'deDE','Druiden der Flamme haben die Hügel entzündet! Eilt den Eingeschlossenen zu Hilfe!','',55664),
(244055,'deDE','Die Hügel sind dank Euch wieder sicher.','',55664),
(244064,'deDE','Ihr scheint Euch in letzter Zeit gut mit den Kyrianern zu verstehen.\n\nIch darf annehmen, dass Ihr den Nekrolords immer noch treu seid, $n? Wir haben noch viel zu tun.\n\nEs wäre schade, wenn ein Verrat unser Verhältnis zunichtemachen würde.','Ihr scheint Euch in letzter Zeit gut mit den Kyrianern zu verstehen.\n\nIch darf annehmen, dass Ihr den Nekrolords immer noch treu seid, $n? Wir haben noch viel zu tun.\n\nEs wäre schade, wenn ein Verrat unser Verhältnis zunichtemachen würde.',55664),
(244242,'deDE','','Ich spüre Feinde in der Nähe. Unsere Eulenfreunde können helfen, sie loszuwerden.',55664),
(244358,'deDE','','Der Wald ist jetzt sicherer. Niemand kann sich verbergen.',55664),
(246422,'deDE','Ich weiß, dass Ihr keinen Grund habt, mir zu vertrauen. Immerhin habe ich mich der Allianz angeschlossen.','Ich weiß, dass Ihr keinen Grund habt, mir zu vertrauen. Immerhin habe ich mich der Allianz angeschlossen.',55664),
(246423,'deDE','Ich weiß, dass Ihr keinen Grund habt, mir zu vertrauen. Immerhin habe ich mich der Horde angeschlossen.','Ich weiß, dass Ihr keinen Grund habt, mir zu vertrauen. Immerhin habe ich mich der Horde angeschlossen.',55664),
(246424,'deDE','Aber wir müssen das hinter uns lassen, um uns gemeinsam einer größeren Bedrohung zu stellen.','Aber wir müssen das hinter uns lassen, um uns gemeinsam einer größeren Bedrohung zu stellen.',55664),
(247542,'deDE','','<Die weise Eule mustert Euch von oben bis unten. Unter ihrem Blick fühlt Ihr Euch auf besondere Weise verletzlich.>\n\nDie Wächter des Traums gewähren mir die Fähigkeit, mit Nicht-Eulen wie Euch zu sprechen.\n\nUnser Traum wird angegriffen. Viele der Waldkreaturen sind durch den Verzehr von Glutpollen dazu verdammt, in Flammen aufzugehen, obwohl sie auf den ersten Blick noch unverletzt zu sein scheinen.\n\nMein wilder Gott gewährt mir die Macht, die von Flammen befallenen Kreaturen aufzuspüren. Tötet sie, bevor sie zu einer größeren Bedrohung werden.\n\nWenn Ihr eine Vorführung zur Macht der Klarsicht benötigt, fragt einfach. Ansonsten liegt meine Macht in Euren Händen.',55664),
(247818,'deDE','','Diese Macht hebt unsere Feinde eine Zeit lang deutlich in Rot hervor. Sie können sich nicht hinter Bäumen und Felsen verstecken.',55664),
(247819,'deDE','','Jetzt tötet sie, damit unser Wald sicher ist!',55664),
(248418,'deDE','','Wir müssen für den Wandel kämpfen, auf den wir hoffen, wie wir es immer getan haben.\n\nWir müssen ihn verkörpern!\n\nFür das Leben, für Azeroth!',55664),
(248433,'deDE','','Ich habe auf Euch gehofft, $n.\n\nFeindliche Truppen bedrohen unsere Küste. Ich kann Euch helfen, abzuheben und den Angriff zurückzuschlagen. \n\nGemeinsam können wir es schaffen!',55664),
(250729,'deDE','','Es gibt noch vieles, das wir nicht über diesen Ort wissen. Fangt an, etwas Geschichte auszugraben!',55664),
(250730,'deDE','','Ja! Die Vergangenheit wird mit jedem ausgegrabenen Artefakt etwas klarer.',55664),
(250764,'deDE','','Der Boden hier steckt voller Schätze! Schnappt Euch Euer Totem und bergt sie!',55664),
(250774,'deDE','','Das ist ein historischer Fund! Das wird unsere Forschung ordentlich vorantreiben!',55664),
(251842,'deDE','','Eine Schaufel? Wie süß. Stellt Euch vor, nach Dingen zu graben, anstatt einfach danach zu scannen!',55664),
(251843,'deDE','','Seltsam. Glaubt Ihr, Schuppenkommandanten haben das genommen, um sich zu stärken... oder Visionen zu erhalten?',55664),
(251844,'deDE','','Sogar im Chaos der Schlacht finden Krieger die Zeit, ihre Ausrüstung zu richten.',55664),
(251885,'deDE','Diese kleine Insel steckt voller Geschichte! Begleitet meinen Familiar durch das Gelände, ich will hier jedes letzte Stückchen Wissen offenlegen, das hier begraben liegt.','',55664),
(251886,'deDE','Zufriedenstellende Arbeit. Ich gewähre Euch dieses monetäre Stipendium und eine lobende Erwähnung in den Fußnoten meiner nächsten Publikation.','',55664),
(254308,'deDE','Ihr scheint Euch mit der Vergangenheit auszukennen.','Ihr scheint Euch mit der Vergangenheit auszukennen.',55664),
(254486,'deDE','','Wir haben noch viel von der Vergangenheit zu lernen.',55664),
(254742,'deDE','','Als mir Nozdormu zeigte, dass sich meine Schwester selbst für ihren Tod, ihr Opfer, entschieden hatte, fing ich an, die \"wahre Zeitlinie\" zu hinterfragen. Welche Momente der Trauer oder der Wut gab es noch, die lebensrettende Konsequenzen nach sich zogen?\n\nAls sich die Nebel von Pandaria lichteten, brachten Horde und Allianz ihren Konflikt an diese Ufer und erweckten ein schlummerndes Übel. Aber... vielleicht war das nötig, um eine bessere Zukunft herbeizuführen.\n\nEs wird Zeit, die Vergangenheit aus einer neuen Perspektive zu betrachten. Darum bin ich mit allen Mitgliedern des ewigen Drachenschwarms hergekommen, die ich überzeugen konnte, mich zu begleiten.',55664),
(254743,'deDE','','Ich teile Nozdormus Vertrauen nicht, vertraue dafür aber seiner Weisheit.\n\nHelft uns oder lasst uns arbeiten.',55664),
(254744,'deDE','','Erlebt diese Zeitlinie erneut, damit wir die Ereignisse aus einer anderen Perspektive betrachten können.\n\nWir werden Euch beobachten.',55664),
(255760,'deDE','Alles hat seine Zeit.','',55664),
(255768,'deDE','Wir schmieden unsere eigene Zukunft.\n\nMit ausreichend Bronze kann ich Eure schmieden. Ich werde Eure Ausrüstung verbessern können... vorübergehend.','',55664),
(255800,'deDE','','Wenn wir die Zeitlinien studieren, versuchen wir ewigen Drachen normalerweise, die Dinge zum Besseren zu ändern. Aber Nozdormu hat uns befohlen, diese Ereignisse unverändert zu lassen.\n\nGlücklicherweise sagte er nichts darüber, Eure Rolle in ihnen zu verändern!\n\n<Moratari zwinkert Euch zu.>\n\nWir werden stets einen Weg finden, ordentliche Forschung durchzuführen.',55664),
(255821,'deDE','','Mit der Zeitmagie dieses Umhangs könnt Ihr die verstreuten Fäden der Zeit sehen und einsammeln. Derartige Fäden finden sich überall in dieser Zeitlinie, bei besiegten Gegnern oder in Beute, die Ihr findet.\n\nEuer Umhang wird diese Fäden ganz von allein absorbieren und seine Macht dauerhaft erhöhen.\n\nEs gibt keine Grenze dafür, wie viele Fäden Ihr sammeln könnt. Die Möglichkeiten sind endlos!',55664),
(256068,'deDE','Wir werden alles rechtzeitig zusammenhaben.','',55664),
(256069,'deDE','Was auch immer Ihr herstellen wollt... Momentus kann es für Euch schmieden.','Was auch immer Ihr herstellen wollt... Momentus kann es für Euch schmieden.',55664),
(256071,'deDE','Ob ich das kann? Ha! Das wird nur einen kurzen Moment dauern.','',55664),
(256073,'deDE','So. Geht nun. Möget Ihr Eure eigene Zukunft schmieden.','',55664),
(256156,'deDE','Alles, was Ihr nicht braucht, können wir verschrotten! Haahahaha!','',55664),
(256160,'deDE','Ihr verzerrt das Gewebe der Zeit selbst!','',55664),
(256161,'deDE','Ihr haltet Euch für besonders clever, indem Ihr Euch weigert, die ursprüngliche Zeitlinie zu ändern, dafür aber Schlupflöcher in Gestalt Eurer sterblichen Champions findet.','Ihr haltet Euch für besonders clever, indem Ihr Euch weigert, die ursprüngliche Zeitlinie zu ändern, dafür aber Schlupflöcher in Gestalt Eurer sterblichen Champions findet.',55664),
(256162,'deDE','Euch ist nicht klar, welche Echos Ihr durch Eure Neugierde auslöst!','Euch ist nicht klar, welche Echos Ihr durch Eure Neugierde auslöst!',55664),
(256294,'deDE','','$gEin blinder Passagier:Eine blinde Passagierin;? Wer Ihr auch seid, ich brauche alle an Deck!',55664),
(256357,'deDE','','Ein umstrittener Moment in der Zeit. Einer, der auch in der Gegenwart nachhallt.\n\nMoratori und die anderen werden in einem nahen Dorf warten und Vorräte bei sich haben.\n\nIch erwarte, viel dadurch zu lernen, Euren Fortschritt zu beobachten.',55664),
(256621,'deDE','','Je weniger Leute von unserer Mission wissen, desto besser.',55664),
(256658,'deDE','','Wir werden Euch mit einem Artefakt der Ewigen ausrüsten. Ein Umhang, der sich genau wie Ihr anpasst und verändert.\n\nNozdormu ist dagegen, die Vergangenheit zu verändern. Aber das tun wir nicht, oder? Die Ereignisse, die hier geschehen, werden gleich bleiben.\n\nIhr hingegen werdet Euch verändern.',55664),
(256779,'deDE','Moment noch, Ihr braucht erst einen Drachen!\n\nWelchen Drachenbegleiter möchtet Ihr?\n\n|cnRED_FONT_COLOR:<Eure Entscheidung ist dauerhaft, aber Ihr könnt sie trotzdem alle sammeln.>|r','',55664),
(256784,'deDE','Ausgezeichnete Wahl.\n\nWenn Ihr die Beschwörung des Drachen gelernt habt, findet Ihr ihn zusammen mit Euren anderen Reittieren in Eurer Sammlung.','',55664),
(256822,'deDE','Drachenreitenfähigkeiten, wie zum Beispiel |TInterface\\ICONS\\Ability_DragonRiding_ForwardFlap01.BLP:20|t |cFFFF0000|Hspell:372608|h[Vorwärtsschub]|h|r für Schwung nach vorne und |TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[Aufstieg gen Himmel]|h|r für Schwung nach oben, verbrauchen Elan.\n\nIhr regeneriert Elan, wenn Ihr am Boden seid oder wenn Ihr mit hoher Geschwindigkeit fliegt und dabei |TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[Nervenkitzel der Lüfte]|h|r aktiv ist.\n\nWährend der Rennen findet Ihr zudem grüne Kugeln aus Elan, die Ihr einsammeln könnt, indem Ihr hindurchfliegt.','',55664),
(256843,'deDE','Was habt Ihr diesmal in Erfahrung gebracht?','Was habt Ihr diesmal in Erfahrung gebracht?',55664),
(256929,'deDE','Wer seid Ihr? Wie kommt Ihr hierher? Egal, wir brauchen Euch an den Waffen!','',55664),
(257520,'deDE','Schön, euch zu sehen, Champion! Wie läuft die Jagd?','',55664),
(257556,'deDE','','Geduld gewinnt Kriege. Aber wenn Aeonicus nur eine weitere Frage stellt, gebe ich ihr meinen Schild zu fressen.',55664),
(257557,'deDE','Was braucht Ihr, $gwinziger:winzige:r; $R?','Was braucht Ihr, $gwinziger:winzige:r; $R?',55664),
(257558,'deDE','','Oh, Schätzchen, Ihr braucht ein neues Aussehen.',55664),
(257617,'deDE','Hey, $C, wollt Ihr nun was kaufen oder nicht?','Hey, $C, wollt Ihr nun was kaufen oder nicht?',55664),
(257618,'deDE','Lasst $Gihn:sie; doch erst mal überlegen, Lida. Unsere Auswahl ist doch so groß.','Lasst $Gihn:sie; doch erst mal überlegen, Lida. Unsere Auswahl ist doch so groß.',55664),
(257619,'deDE','Rabatte? Meine Waren gibt es nur zum Vollpreis!','Rabatte? Meine Waren gibt es nur zum Vollpreis!',55664),
(257910,'deDE','','Wenn Ihr Azeroth und andere Orte erkundet, werdet Ihr verschiedene Gegenstände finden, die das Aussehen Eures Drachen beeinflussen.\n\nHabt Ihr diese Gegenstände benutzt, werden die Optionen auf dem Podium der Transformation verfügbar.',55664),
(257911,'deDE','','Auf dem Podium der Transformation könnt Ihr über das Aussehen Eures Drachen entscheiden, je nachdem, was Ihr gesehen und entdeckt habt.\n\nPodien der Transformation findet Ihr an mehreren Orten, solltet Ihr ein neues Aussehen auswählen wollen. Ihr findet sie als Drachenkopfsymbole auf Eurer Karte.',55664),
(257912,'deDE','Ah, wurdet Ihr von einem schrecklichen Schicksal heimgesucht?\n\nWollt Ihr zu Lord Andestrasz zurückkehren?','Ah, wurdet Ihr von einem schrecklichen Schicksal heimgesucht?\n\nWollt Ihr zu Lord Andestrasz zurückkehren?',55664),
(257950,'deDE','','Horos kann Euch mit einem Chronoabzeichen versorgen. Er hat immer etwas Interessantes im Angebot!',55664),
(257951,'deDE','Mit genug Zeit und Bronze kann ich Euch alles besorgen, was Ihr braucht.','',55664),
(258178,'deDE','Und jetzt los! Ab hier übernehmen wir!','Und jetzt los! Ab hier übernehmen wir!',55664),
(258397,'deDE','','Wenn Ihr es aber eilig habt, kann ich Euch einen Edelstein aus einer anderen Zeitlinie herausziehen, den Ihr aber erst noch finden müsst. Dafür braucht es nur ein bisschen Bronze.',55664),
(258748,'deDE','Hallo, Winzling. Wusstet Ihr, das Bern und Bronze unterschiedlich sind? Ich schon... jetzt.','Hallo, Winzling. Wusstet Ihr, das Bern und Bronze unterschiedlich sind? Ich schon... jetzt.',55664),
(258749,'deDE','Vorsichtig!','Vorsichtig!',55664),
(258844,'deDE','Nostwin, kommt her! Wegen Euch werden wir noch erwischt!','Nostwin, kommt her! Wegen Euch werden wir noch erwischt!',55664),
(259574,'deDE','Ah, willkommen, $gjunger:junge:c; $C! Ich erinnere mich an meine $c-Ausbildung, als sei es gestern gewesen.','',55664),
(259576,'deDE','Hallo! Kann ich Euer Interesse an schickem Papier oder diesem Glas Bienen wecken, das ich gefunden habe?','',55664),
(259701,'deDE','Ich habe mit Euch nichts zu schaffen, $c.','',55664),
(259724,'deDE','','Vergesst nicht, den Umhang anzulegen. Er kann Euch nicht ermächtigen, wenn Ihr ihn nicht tragt!',55664),
(260318,'deDE','Seid Ihr bereit, um die Geschichte der geheimen Zutat der Nudelsuppe der Familie Lin zu hören?','',55664),
(260361,'deDE','Sagt einfach das Zauberwort, dann kommen die Nudeln!','',55664),
(264124,'deDE','Sehr erfreut. Meine Geschichten erzählen von den Kräften des Bösen, die Lordaeron bedrohten, und wie die Helden von Azeroth sie überwanden.','',55664),
(264159,'deDE','Möchtet Ihr zurückkehren?','',55664),
(264582,'deDE','','Willkommen, $uAbenteurer:Abenteurerin;. Habt Ihr eine Frage zum Drachenreiten?',55664),
(197696,'esES','','Los Abjurantes han reforzado esta zona con sus mejores guerreros. ¡Acaba con ellos, y que el coraje esté contigo!',55664),
(197697,'esES','','Hoy has demostrado que no nos sucumbiremos a la duda. ¡Bastión nunca se rendirá!',55664),
(197702,'esES','Los traidores de mi antigua casa tienen una fortaleza aquí. Que solo queden las ruinas.','',55664),
(197703,'esES','El olvido no es castigo suficiente por traicionar a Krexus. Gracias por impartir justicia.','',55664),
(200277,'esES','Descuida, solo se lo hago a los nobles. A los que se lo pueden permitir.','',55664),
(208593,'esES','Permite que mi hoja te asista. ¡Atacaremos al enemigo conjuntamente sin que nos vean!','Permite que mi hoja te asista. ¡Atacaremos al enemigo conjuntamente sin que nos vean!',55664),
(208596,'esES','Tu presencia es música para mi alma. Deja que te acompañe con mi hermosa elegía.','',55664),
(210355,'esES','','¡Basta! ¡No toleraré más resistencia!',55664),
