(243861,'esES','','Este disfraz te ayudará a ocultarte mientras te encuentras en el Estrecho de Tiragarde. También te permitirá disipar los hechizos de Jaina.',55664),
(244054,'esES','¡Los druidas de la Llama han incendiado los túmulos! Ayuda a los que están atrapados.','',55664),
