(244064,'esES','Últimamente te muestras de lo más amigable con los kyrianos.\n\nConfío en que mantengas tu lealtad hacia los necroseñores, $n. Aún nos queda mucho por hacer.\n\nSería terrible que nuestra relación se estropeara por una traición.','Últimamente te muestras de lo más amigable con los kyrianos.\n\nConfío en que mantengas tu lealtad hacia los necroseñores, $n. Aún nos queda mucho por hacer.\n\nSería terrible que nuestra relación se estropeara por una traición.',55664),
(244242,'esES','','Percibo a los enemigos demasiado cerca. Los búhos pueden ayudarnos a expulsarlos.',55664),
(244358,'esES','','Ahora el bosque es más seguro. Que no escape nadie.',55664),
(246422,'esES','Sé que no tienes motivos para confiar en mí, dado que me he unido a la Alianza.','Sé que no tienes motivos para confiar en mí, dado que me he unido a la Alianza.',55664),
(246423,'esES','Sé que no tienes motivos para confiar en mí, dado que me he unido a la Horda.','Sé que no tienes motivos para confiar en mí, dado que me he unido a la Horda.',55664),
(246424,'esES','Pero debemos dejar eso de lado para afrontar una amenaza que supera nuestras diferencias.','Pero debemos dejar eso de lado para afrontar una amenaza que supera nuestras diferencias.',55664),
(247542,'esES','','<La sabia búho te mira de arriba a abajo. Te sientes especialmente vulnerable bajo su mirada>.\n\nLos Guardianes del Sueño me han otorgado la capacidad de conversar con los no-búhos como tú.\n\nNuestro Sueño está siendo atacado. Muchas de las criaturas del bosque sufrirán un terrible destino al ingerir polen de ceniza, aunque a simple vista no parezcan verse afectadas.\n\nMi dios salvaje me confirió el poder de detectar a estas criaturas ardientes. Mátalas antes de que se conviertan en una amenaza mayor.\n\nSi necesitas una demostración de este poder de visión verdadera, solo tienes que pedírmelo. Por lo demás, mi poder está en tus manos.',55664),
(247818,'esES','','Este poder resalta a nuestros enemigos en rojo durante un tiempo, aunque se escondan tras árboles y rocas.',55664),
(247819,'esES','','Ahora, ¡mátalos y protege nuestro bosque!',55664),
(248418,'esES','','Debemos luchar por el cambio que queremos, como siempre hemos hecho.\n\n¡Debemos ser el cambio!\n\n¡Por Azeroth!',55664),
(248433,'esES','','Esperaba que fueras tú, $n.\n\nLas fuerzas enemigas amenazan la costa cercana. Puedo ayudarte a volar y repeler el ataque.\n\n¡Si aunamos nuestras fuerzas, podremos con ellos!',55664),
(250729,'esES','','Hay muchas cosas que no sabemos sobre este lugar. ¡Ve y comienza a desenterrar la historia!',55664),
(250730,'esES','','¡Bien! El pasado se aclara un poco más con cada artefacto que sacamos.',55664),
(250764,'esES','','¡El suelo está repleto de hallazgos! ¡Coge el tótem y sácalos a la luz!',55664),
(250774,'esES','','¡Eso de ahí es un tesoro histórico! ¡Le dará un gran impulso a nuestra investigación!',55664),
(251842,'esES','','¿Una pala? ¡Qué pintoresco! ¡Imagínate desenterrar algo en lugar de escanearlo!',55664),
(251843,'esES','','Curioso. ¿Crees que los escamandantes lo consumían para mejorar su rendimiento... o para tener visiones?',55664),
(251844,'esES','','Incluso en el fragor de la batalla, los guerreros arreglaban su equipo.',55664),
(251885,'esES','¡Esta islita está repleta de historia! Escolta a mi familiar por la zona para que pueda extraer cada pedacito de conocimiento enterrado.','',55664),
(251886,'esES','Buen trabajo, ayudante. Te voy a hacer entrega de esta remuneración e incluiré una mención sobre ti en el pie de página de mi próximo artículo.','',55664),
(254308,'esES','Parece que el pasado te resulta familiar.','Parece que el pasado te resulta familiar.',55664),
(254486,'esES','','Aún tenemos mucho que aprender del pasado.',55664),
(254742,'esES','','Cuando Nozdormu me mostró que la muerte de mi hermana fue su elección, su sacrificio, me hizo dudar del resto de la \"línea temporal verdadera\". ¿Qué otros momentos de dolor o ira han tenido consecuencias de vida o muerte?\n\nCuando las nieblas de Pandaria se despejaron, la Horda y la Alianza trajeron el conflicto a estas costas y despertaron un mal en letargo. Pero... quizá fuese necesario para lograr un futuro mejor.\n\nEs hora de reflexionar sobre el pasado con una nueva perspectiva. Por eso estoy aquí con los miembros del Vuelo Infinito a los que he podido convencer.',55664),
(254743,'esES','','No comparto la fe que tiene Nozdormu en ello, pero estoy dispuesta a darle a su sabiduría el beneficio de la duda.\n\nAyúdanos o déjanos trabajar.',55664),
(254744,'esES','','Revive esta línea temporal para que podamos observar sus eventos desde una nueva perspectiva.\n\nTe estaremos observando.',55664),
(255760,'esES','Todo tiene su momento.','',55664),
(255768,'esES','Forjamos nuestro propio futuro.\n\nCon el bronce suficiente, puedo forjar el tuyo. De hecho, podré mejorar tu equipamiento... momentáneamente.','',55664),
(255800,'esES','','Cuando estudiamos las líneas temporales, los dragones infinitos sentimos el impulso de cambiar los acontecimientos por algo mejor. Pero Nozdormu nos ha dicho que no los modifiquemos.\n\n¡Afortunadamente, no dijo nada sobre cambiar tu participación en ellos!\n\n<Moratari te guiña un ojo>.\n\nSiempre encontraremos el modo de realizar una investigación adecuada.',55664),
(255821,'esES','','Gracias a la magia temporal de esta capa, puedes ver y recoger hilos del tiempo dispersos. Estos hilos pueden aparecer en cualquier parte de esta línea temporal, como en los enemigos a los que derrotes y en los tesoros que recojas.\n\nTu capa los absorberá, lo que aumentará su poder de forma permanente.\n\nNo hay límite a los hilos que puedes conseguir: ¡las posibilidades son infinitas!',55664),
(256068,'esES','Lo tendremos todo a su tiempo.','',55664),
(256069,'esES','Sea lo que sea lo que estés haciendo, Inercius puede forjarlo por ti.','Sea lo que sea lo que estés haciendo, Inercius puede forjarlo por ti.',55664),
(256071,'esES','¿Que si puedo? ¡Ja! Me llevará solo un momento.','',55664),
(256073,'esES','Ya está. Ve con tiempo. Que forjes tu propio futuro.','',55664),
(256156,'esES','Podemos desguazar cualquier cosa que no necesites. ¡Ja, ja, ja, ja!','',55664),
(256160,'esES','¡Distorsionas el mismísimo tejido del tiempo!','',55664),
(256161,'esES','Os creéis muy listos negándoos a cambiar la línea temporal original, pero hay vacíos en vuestros campeones mortales.','Os creéis muy listos negándoos a cambiar la línea temporal original, pero hay vacíos en vuestros campeones mortales.',55664),
(256162,'esES','¡No sabéis los ecos que generan vuestras miradas!','¡No sabéis los ecos que generan vuestras miradas!',55664),
(256294,'esES','','¿$gUn polizón:Una polizona;? No importa quien seas, ¡todos a cubierta!',55664),
(256357,'esES','','Un momento polémico en el tiempo. Uno que resuena en el presente.\n\nMoratari y los demás te esperan con suministros en una aldea cercana.\n\nEspero aprender mucho observando tu progreso.',55664),
(256621,'esES','','Cuantos menos conozcan nuestra misión, mejor.',55664),
(256658,'esES','','Te equiparemos con un artefacto del infinito. Se trata de una capa que se adapta y cambia cuando tú lo haces.\n\nNozdormu se opone a alterar el pasado, pero no vamos a hacer eso, ¿verdad? Los acontecimientos que tendrán lugar aquí permanecerán sin cambios.\n\nQuien va a cambiar eres tú.',55664),
(256779,'esES','Un momento, ¡primero necesitas un draco!\n\n¿Qué compañero draco prefieres?\n\n|cnRED_FONT_COLOR:<Esta decisión es permanente, pero los conseguirás todos con el tiempo>.|r','',55664),
(256784,'esES','Una elección excelente.\n\nCuando hayas aprendido a invocar al draco, lo podrás ver con el resto de las monturas de tu colección.','',55664),
(256822,'esES','El vigor se consume con las facultades de jinete de dragones, como cuando usas |TInterface\\ICONS\\Ability_DragonRiding_ForwardFlap01.BLP:20|t |cFFFF0000|Hspell:372608|h[Carga hacia delante]|h|r para obtener impulso hacia delante y |TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[Ascenso hacia el cielo]|h|r para obtener impulso hacia arriba.\n\nRecuperas vigor mientras estás en el suelo o volando a gran velocidad, cosa que se indica con |TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[Emoción de los cielos]|h|r.\n\nDurante las carreras puede que te encuentres orbes de vigor verdes que se pueden recoger volando a su través.','',55664),
(256843,'esES','¿Qué has descubierto esta vez?','¿Qué has descubierto esta vez?',55664),
(256929,'esES','¿Quién eres? ¿Cómo has llegado hasta aquí? Da igual, ¡te necesitamos en los cañones!','',55664),
(257520,'esES','¡Me alegro de verte, adalid! ¿Cómo van tus cacerías?','',55664),
(257556,'esES','','La paciencia gana guerras. Pero si Aeonicus me hace otra pregunta, le haré tragar mi escudo.',55664),
(257557,'esES','¿Qué necesitas, insignificante $r?','¿Qué necesitas, insignificante $r?',55664),
(257558,'esES','','Ay, cielo, necesitas un aspecto nuevo.',55664),
(257617,'esES','Eh, $c, ¿vas a comprar algo o qué?','Eh, $c, ¿vas a comprar algo o qué?',55664),
(257618,'esES','Deja que se lo piense, Lida. Nuestra selección es muy amplia.','Deja que se lo piense, Lida. Nuestra selección es muy amplia.',55664),
(257619,'esES','¿Ofertas? ¡Mis mercancías tienen el precio original!','¿Ofertas? ¡Mis mercancías tienen el precio original!',55664),
(257910,'esES','','A medida que explores Azeroth y otras zonas, encontrarás diferentes objetos que afectarán a la apariencia de tu draco.\n\nCuando hayas usado esos objetos, las opciones en cuestión aparecerán disponibles en el podio de transformación.',55664),
(257911,'esES','','El podio de transformación es donde puedes seleccionar una apariencia diferente para tu draco, en función de lo que hayas visto y descubierto.\n\nLos podios de transformación se encuentran en diversas ubicaciones, por si quieres elegir un aspecto nuevo. Busca el símbolo de la cabeza de dragón en tu mapa.',55664),
(257912,'esES','Ah, ¿te has topado con un destino terrible?\n\n¿Quieres regresar con lord Andestrasz?','Ah, ¿te has topado con un destino terrible?\n\n¿Quieres regresar con lord Andestrasz?',55664),
