(236457,'esMX','<Hay varias monedas y preseas alrededor de la pila de ofrendas. Muchos seguidores han dejado su tributo, pero la ausencia de ciertas preseas te dan el indicio de que el ritual todavía no está completo.>','<Hay varias monedas y preseas alrededor de la pila de ofrendas. Muchos seguidores han dejado su tributo, pero la ausencia de ciertas preseas te da el indicio de que el ritual todavía no está completo.>',55664),
