(241321,'esMX','','Y, como ahora puedo olfatear todos estos pergaminos y tomos, ¡tengo mucho que hacer! Puedes marcharte, ¡y gracias!',55664),
(241322,'esMX','','Ay, no... ¡qué escándalo! ¡No puede haber dicho ESO!',55664),
