(246424,'esMX','Tenemos que dejar eso de lado para enfrentar una amenaza más grande que nuestras diferencias.','Tenemos que dejar eso de lado para enfrentar una amenaza más grande que nuestras diferencias.',55664),
(247542,'esMX','','<La sabia lechuza te mira de pies a cabeza. Bajo su mirada, te sientes totalmente vulnerable.>\n\nLos guardianes del Sueño me otorgan la habilidad de conversar con no-lechuzas como tú.\n\nNuestro Sueño está bajo ataque. Muchas de las criaturas del bosque están condenadas a las llamas debido a la ingesta de polen cinéreo, aunque todavía se vean ilesas.\n\nMi dios salvaje me concede el poder de detectar a estas criaturas asoladas por las llamas. Mátalas antes de que se conviertan en una amenaza mayor.\n\nSi necesitas una demostración del poder de la visión verdadera, dímelo. Si no, mi poder ya está en tus manos.',55664),
(247818,'esMX','','Este poder resalta claramente a los enemigos en color rojo durante un tiempo. No pueden esconderse detrás de los árboles ni de las piedras.',55664),
(247819,'esMX','','¡Ahora mátalos para proteger nuestro bosque!',55664),
(248418,'esMX','','Como siempre ha sido, tenemos que luchar por el cambio que queremos.\n\n¡Tenemos que ser ese cambio!\n\n¡Por la vida, por Azeroth!',55664),
(248433,'esMX','','Esperaba que fueras tú, $n.\n\nLas fuerzas enemigas están amenazando nuestras costas aquí cerca. Puedo ayudarte a volar y repeler el ataque.\n\n¡$uJuntos:Juntas; podemos!',55664),
(250729,'esMX','','Aún hay mucho que no sabemos sobre este sitio. ¡Ve y empieza a excavar un poco de historia!',55664),
(250730,'esMX','','¡Sí! El pasado queda un poco más claro con cada artefacto que excavamos.',55664),
(250764,'esMX','','¡El suelo está repleto de hallazgos! ¡Toma tu tótem y búscalos!',55664),
(250774,'esMX','','¡Eso es un tesoro histórico! ¡Sin dudas le dará un empujón a nuestra investigación!',55664),
(251842,'esMX','','¿Una pala? Qué extraño. ¡Imagina excavar para buscar algo en lugar de usar un escáner!',55664),
(251843,'esMX','','Qué curioso. ¿Crees que los dracomandantes consumieron esto para mejorar su desempeño... o provocar una visión?',55664),
(251844,'esMX','','Incluso en el fragor de la batalla, los guerreros encontraron tiempo para ocuparse de su equipo.',55664),
(251885,'esMX','¡Esta isla diminuta es un cúmulo de historia! Acompaña a mi familiar por el terreno para que pueda extraer hasta el último granito de conocimiento enterrado aquí.','',55664),
(251886,'esMX','Buen trabajo, asistente. Te otorgaré este estipendio monetario así como una mención honorífica en las notas al pie de mi próxima publicación.','',55664),
(254308,'esMX','Parece que conoces el pasado.','Parece que conoces el pasado.',55664),
(254486,'esMX','','Tenemos mucho que aprender del pasado.',55664),
(254742,'esMX','','Cuando Nozdormu me mostró que la muerte de mi hermana fue su elección, su sacrificio, me hizo cuestionar el resto de la \"verdadera línea temporal\". ¿Qué otros momentos de dolor o ira tuvieron consecuencias que salvaron vidas?\n\nCuando las brumas de Pandaria se dispersaron, la Horda y la Alianza trajeron su conflicto a estas costas y despertaron un mal dormido. Pero... quizá todo fue necesario para abrir la puerta a un mejor futuro.\n\nEs hora de reflexionar sobre lo sucedido con una nueva perspectiva. Por eso estoy aquí, junto con los miembros del Vuelo Infinito a los que pude convencer de que me siguieran.',55664),
(254743,'esMX','','Aún no comparto la fe de Nozdormu, pero estoy dispuesta a darle a su sabiduría el beneficio de la duda.\n\nAyúdanos o déjanos trabajar en paz.',55664),
(254744,'esMX','','Revive esta línea temporal para que podamos observar sus acontecimientos desde una nueva perspectiva.\n\nEstaremos observándote.',55664),
(255760,'esMX','Cada cosa a su tiempo.','',55664),
(255768,'esMX','Forjamos nuestro propio futuro.\n\nCon suficiente bronce, puedo forjar el tuyo. Podré mejorar tu equipo... momentáneamente.','',55664),
(255800,'esMX','','Cuando estudiamos las líneas temporales, los dragones infinitos normalmente buscamos hacer cambios positivos. Pero Nozdormu nos ha dicho que debemos dejar estos eventos tal como ocurrieron.\n\n¡Por suerte, no dijo nada de cambiar tu participación en ellos!\n\n<Moratari guiña un ojo.>\n\nSiempre encontraremos una forma de llevar a cabo las investigaciones adecuadas.',55664),
(255821,'esMX','','Con la magia temporal de esta capa, puedes ver y recolectar los hilos dispersos del tiempo. Puedes encontrar esos hilos por todas partes de esta línea temporal, ya sean enemigos que encuentres o tesoros que recojas.\n\nTu capa absorberá los hilos automáticamente, y su poder aumentará permanentemente.\n\nNo hay un límite de hilos que puedas recolectar. ¡Las posibilidades son infinitas!',55664),
(256068,'esMX','Tendremos todo a su debido tiempo.','',55664),
(256069,'esMX','Cualquier cosa que quieras fabricar, Momentus puede forjarla para ti.','Cualquier cosa que quieras fabricar, Momentus puede forjarla para ti.',55664),
(256071,'esMX','¿Si puedo? ¡Ja! Solo tomará un momento.','',55664),
(256073,'esMX','Listo. Vete cuando llegue tu tiempo. Ojalá que puedas forjar tu propio futuro.','',55664),
(256156,'esMX','Cualquier cosa que no necesites, ¡podemos aprovecharla! ¡Buaajajaja!','',55664),
(256160,'esMX','¡Estás alterando la esencia misma del tiempo!','',55664),
(256161,'esMX','Se creen muy listos: se niegan a cambiar la línea temporal original pero buscan excusas para sus campeones mortales.','Se creen muy listos, se niegan a cambiar la línea temporal original pero buscan excusas para sus campeones mortales.',55664),
(256162,'esMX','¡No saben lo que resuena en el eco de sus indiscreciones!','¡No saben lo que resuena en el eco de sus indiscreciones!',55664),
(256294,'esMX','','¿$uUn polizón:Una polizona;? Seas quien seas, ¡necesito a todos a cubierta!',55664),
(256357,'esMX','','Un momento controversial del tiempo. Uno que resuena en el presente.\n\nMoratari y los demás deben estar esperando en una aldea cercana con suministros.\n\nEspero aprender mucho analizando tu progreso.',55664),
(256621,'esMX','','Cuantos menos sepan de nuestra misión, mejor.',55664),
(256658,'esMX','','Te equiparemos con un artefacto del infinito. Una capa que se adapta y cambia contigo.\n\nNozdormu se opone a alterar el pasado. Pero no es lo que estamos haciendo, ¿no? Los eventos que transcurran aquí quedarán aquí.\n\nSolo tú serás diferente.',55664),
(256779,'esMX','Un momento. ¡Primero necesitas un draco!\n\n¿Qué compañero draco te gustaría?\n\n|cnRED_FONT_COLOR:<Esta decisión es permanente, pero con el tiempo podrás conseguirlos a todos.>|r','',55664),
(256784,'esMX','Excelente elección.\n\nUna vez que hayas aprendido a invocar al draco, podrás encontrarlo junto a las demás monturas de tu colección.','',55664),
(256822,'esMX','El vigor se emplea en habilidades de dracoequitación, como el uso de |TInterfaceICONS\\\\Ability_DragonRiding_ForwardFlap01. BLP:20|t |cFFFF0000|Hspell:372608|h[Impulso de avance]|h|r para avanzar y |TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[Ascenso al cielo]|h|r para subir. \n\nRecuperas vigor mientras estás en el suelo o mientras vuelas a gran velocidad, lo que se indica con |TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[Adrenalina aérea]|h|r.\n\nDurante las carreras, también puedes encontrar orbes verdes de vigor que se pueden recoger atravesándolos al volar.','',55664),
(256843,'esMX','¿Qué has aprendido esta vez?','¿Qué has aprendido esta vez?',55664),
(256929,'esMX','¿Quién eres? ¿Cómo has llegado hasta aquí? No importa. ¡Te necesitamos al mando de las armas!','',55664),
(257520,'esMX','¡Qué gusto verte, adalid! ¿Cómo te va en tus cacerías?','',55664),
(257556,'esMX','','La paciencia puede ser suficiente para ganar una guerra. Pero si Aeonicus hace otra pregunta, haré que se coma mi escudo.',55664),
(257557,'esMX','¿Qué necesitas, $upequeño:pequeña; $r?','¿Qué necesitas, $upequeño:pequeña; $r?',55664),
(257558,'esMX','','Cariño, te hace falta una nueva imagen.',55664),
(257617,'esMX','Ey $c, ¿vas a comprar algo o no?','Ey $c, ¿vas a comprar algo o no?',55664),
(257618,'esMX','Deja que lo piense, Lida. Hay una gran oferta de productos.','Deja que lo piense, Lida. Hay una gran oferta de productos.',55664),
(257619,'esMX','¿Ofertas? ¡Mis productos nunca están en oferta!','¿Ofertas? ¡Mis productos nunca están en oferta!',55664),
(257910,'esMX','','A medida que explores Azeroth y más, encontrarás diferentes objetos que cambiarán la apariencia de tu draco.\n\nUna vez que hayas usado esos objetos, te aparecerán las opciones disponibles en el estrado de transformación.',55664),
(257911,'esMX','','El estrado de transformación es donde puedes seleccionar una apariencia diferente para tu draco según lo que has visto y descubierto.\n\nSe pueden encontrar estrados de transformación en varios lugares por si deseas elegir un nuevo aspecto. Busca el símbolo con la cabeza de dragón en tu mapa.',55664),
(257912,'esMX','Ah, ¿has sufrido una desgracia terrible?\n\n¿Quieres volver con Lord Andestrasz?','Ah, ¿has sufrido una desgracia terrible?\n\n¿Quieres volver con Lord Andestrasz?',55664),
(257950,'esMX','','Horos puede conseguirte una cronoinsignia. ¡Siempre tiene algo interesante en su inventario!',55664),
(257951,'esMX','Con suficiente tiempo y bronce, puedo conseguirte lo que necesites.','',55664),
(258178,'esMX','¡Adelante! ¡Nosotros nos encargamos!','¡Adelante! ¡Nosotros nos encargamos!',55664),
(258397,'esMX','','Si tienes prisa, puedo extraer una gema que aún no hayas encontrado de otra línea temporal. Solo se necesita un poco de bronce.',55664),
(258748,'esMX','Hola, débil $r. ¿Sabías que el ámbar y el bronce son diferentes? Yo sí... ahora.','Hola, débil $r. ¿Sabías que el ámbar y el bronce son diferentes? Yo sí... ahora.',55664),
(258749,'esMX','¡Mira por dónde vas!','¡Mira por dónde vas!',55664),
(258844,'esMX','¡Nostwin, ven aquí! ¡Vas a hacer que nos atrapen!','¡Nostwin, ven aquí! ¡Vas a hacer que nos atrapen!',55664),
(259574,'esMX','¡Ah, $ubienvenido:bienvenida; joven $c! Recuerdo mi entrenamiento como $c como si hubiera sido ayer.','',55664),
(259576,'esMX','¡Hola! ¿Te gustaría mirar este papel elegante o el frasco de abejas que encontré?','',55664),
(259701,'esMX','No tengo nada que hablar contigo, $c.','',55664),
(259724,'esMX','','No olvides ponerte la capa. ¡No obtendrás ningún poder si no la usas!',55664),
(260318,'esMX','¿Estás $ulisto:lista; para escuchar la historia del ingrediente secreto de la sopa de fideos de la familia Lin?','',55664),
(260361,'esMX','¡Da la orden y los fideos comenzarán a circular!','',55664),
(264124,'esMX','Un gusto. Mis historias tratan sobre los males que amenazaban Lordaeron y sobre cómo los campeones de Azeroth lograron superarlos.','',55664),
(264159,'esMX','¿Quieres regresar?','',55664),
(264582,'esMX','','$uBienvenido, aventurero:Bienvenida, aventurera;. ¿Tienes alguna pregunta sobre la dracoequitación?',55664),
(197162,'frFR','Misérable vermine !','',55664),
(197696,'frFR','','Les désavoués ont posté leurs plus puissants guerriers pour défendre cette zone. À vous de les abattre, combattez avec courage !',55664),
(197697,'frFR','','En ce jour, vous avez prouvé que le doute n’a pas de prise sur nous. Le Bastion ne capitulera jamais !',55664),
(197702,'frFR','Les traîtres des Élus ont une place forte ici. Brisez ses murs et leurs os par la même occasion !','',55664),
(197703,'frFR','La mort est encore trop douce pour les misérables qui ont osé trahir Krexus. Merci d’avoir rendu justice.','',55664),
(221430,'frFR','','La magie djaradine retourne les éléments contre nous. Aidez l’imploratrice de la terre Yevaa à la combattre.',55664),
(221431,'frFR','','Excellent travail, $n. Les troupes djaradines ne sont pas les seules à savoir manipuler les éléments.',55664),
(221889,'frFR','','Les Roharts d’Uktulut sont redoutables. Nous avons intérêt à gagner leur confiance.',55664),
(221890,'frFR','','Beau travail. J’espère que cela nous aidera à sceller une alliance plus solide.',55664),
(221920,'frFR','','Les jardins des bassins de l’Essence ont attiré des nuisibles qui menacent la sécurité de nos Dragonnets.',55664),
(221921,'frFR','','Beau travail. L’élevage des Dragonnets peut désormais se poursuivre sereinement.',55664),
(224315,'frFR','La terre se prosterne !','',55664),
(224317,'frFR','Le ciel s’incline devant moi !','',55664),
(224320,'frFR','Le givre obéit !','',55664),
(228294,'frFR','C’est fort honorable à vous ! Vos camarades ont de la chance de vous compter parmi leurs artisans et artisanes.','',55664),
(228750,'frFR','','Ces Gnolls nous mènent la vie dure depuis des générations. C’est malheureux, mais il va falloir abattre leur chef.',55664),
(228751,'frFR','','C’est bien triste, mais même notre patience a des limites. Merci d’avoir fait le nécessaire.',55664),
(230669,'frFR','Saviez-vous que les vautours défèquent sur leurs propres pattes pour les garder au frais ? Certains peuvent même vomir de l’acide gastrique sur une grande distance pour se défendre !','',55664),
(231301,'frFR','Cette peluche a été mâchonnée avec le plus grand soin. De toute évidence, c’est le jouet préféré de quelque… créature indéterminée. Mieux vaut éviter d’attirer l’attention sur cet objet tant que les Gnolls sont galvanisés par l’existence d’Arbec.','Cette peluche a été mâchonnée avec le plus grand soin. De toute évidence, c’est le jouet préféré de quelque… créature indéterminée. Mieux vaut éviter d’attirer l’attention sur cet objet tant que les Gnolls sont galvanisés par l’existence d’Arbec.',55664),
(231306,'frFR','Cette boîte est fermée par des verrous à glissière rudimentaires. À en juger par les traces de morsures, les hyènes ont dû l’ouvrir à de multiples reprises. Tir-Tripes s’en est peut-être servie pour les entraîner.','Cette boîte est fermée par des verrous à glissière rudimentaires. À en juger par les traces de morsures, les hyènes ont dû l’ouvrir à de multiples reprises. Tir-Tripes s’en est peut-être servie pour les entraîner.',55664),
(231310,'frFR','Cet os rongé jusqu’à la moelle a été nettoyé et poli par les ans et par des crocs acérés. Quelqu’un doit beaucoup y tenir.','Cet os rongé jusqu’à la moelle a été nettoyé et poli par les ans et par des crocs acérés. Quelqu’un doit beaucoup y tenir.',55664),
(231312,'frFR','Ce carnet volé appartient sans doute à un membre du Kirin Tor. Couverte de marques de morsures, de boue et de ce qui ressemble à du sang, la reliure a tout de même tenu le choc.','Ce carnet volé appartient sans doute à un membre du Kirin Tor. Couverte de marques de morsures, de boue et de ce qui ressemble à du sang, la reliure a tout de même tenu le choc.',55664),
(231315,'frFR','Ce livre sert à présent de journal à quelque Gnoll. Recouvertes de dessins maladroits tracés au charbon et à… l’encre rouge, les notes consignées auparavant par le Kirin Tor sont désormais illisibles, remplacées par des gribouillis qui semblent représenter des hyènes, des ossements et des cœurs en pagaille.\n\nVous avez votre petite idée quant à l’identité de la personne à qui il appartient.','Ce livre sert à présent de journal à quelque Gnoll. Recouvertes de dessins maladroits tracés au charbon et à… l’encre rouge, les notes consignées auparavant par le Kirin Tor sont désormais illisibles, remplacées par des gribouillis qui semblent représenter des hyènes, des ossements et des cœurs en pagaille.\n\nVous avez votre petite idée quant à l’identité de la personne à qui il appartient.',55664),
(236158,'frFR','La vallée d’Alterac n’avait plus connu une telle ébullition depuis des années !\n\nQue nous vaut l’honneur d’une visite aussi prestigieuse ?','',55664),
(241312,'frFR','','On a déterré des tas de ces « textes » de la surface. De l’encre sur du papier.',55664),
(241313,'frFR','','Du papier ! De l’encre ! Bah… Ça ne sert à rien pour nous autres Flairans ! Notre vue est bien trop mauvaise. On a besoin de texture, nous !',55664),
(241314,'frFR','','Je ne sais pas ce qui leur est passé par la tête… mais je ne vais pas rester les bras ballants !',55664),
(241317,'frFR','','Si je combine cette rune renforcée avec ce verre, et que j’ajoute ce pigment magique, j’obtiens…',55664),
(241318,'frFR','','ODORIFICATION !',55664),
(241320,'frFR','','Je baptisé ce processus l’odorama de Scridorsa ! Chaque mot a désormais sa propre odeur !',55664),
(241321,'frFR','','Et comme je peux enfin renifler tous ces parchemins et tous ces livres, j’ai du pain sur la planche ! Allez, filez… et merci !',55664),
(241322,'frFR','','Non, mais c’est scandaleux ! Oh, elle n’a pas pu dire ça !',55664),
(242707,'frFR','Vous voilà. Essayez de vous entendre, vous deux.','',55664),
(242978,'frFR','Qui t’a donné cette baguette ?','',55664),
(242982,'frFR','','Je voulais juste m’amuser…',55664),
(243765,'frFR','Jaina, tu aurais pu blesser quelqu’un. La magie est bien trop dangereuse pour que tu t’en serves !','',55664),
(243766,'frFR','','Oui, père.',55664),
(243861,'frFR','','Ce déguisement vous aidera à vous fondre dans le décor de la rade de Tiragarde. Il vous permettra aussi de dissiper le sort de Jaina.',55664),
(244054,'frFR','Les druides de la Flamme ont enflammé le refuge des saisons ! Aidez ceux qui s’y trouvent.','',55664),
(244055,'frFR','Le refuge des saisons est à nouveau en sécurité grâce à vous, mon $uami:amie;.','',55664),
(244242,'frFR','','Je sens des forces ennemies rôder dans les parages. Nos amis les hiboux pourront nous aider à les chasser.',55664),
(244358,'frFR','','Notre forêt est mieux protégée. Que personne ne s’y cache.',55664),
(246422,'frFR','Je sais que vous n’avez aucune raison de me faire confiance, vu que j’ai rejoint l’Alliance.','Je sais que vous n’avez aucune raison de me faire confiance, vu que j’ai rejoint l’Alliance.',55664),
(246423,'frFR','Je sais que vous n’avez aucune raison de me faire confiance, vu que j’ai rejoint la Horde.','Je sais que vous n’avez aucune raison de me faire confiance, vu que j’ai rejoint la Horde.',55664),
(246424,'frFR','Mais nous devons mettre ça de côté pour affronter une menace bien plus grande que nos différends.','Mais nous devons mettre ça de côté pour affronter une menace bien plus grande que nos différends.',55664),
(247542,'frFR','','<La sage chouette vous dévisage, ce qui vous donne un sentiment de vulnérabilité.>\n\nLes gardiens et gardiennes du Rêve m’ont octroyé la capacité de parler avec des non-chouettes comme vous.\n\nNotre rêve subit une attaque. De nombreuses créatures de la forêt périront dans les flammes après avoir ingéré du pollen des cendres, même si elles ne semblent pas affectées à première vue.\n\nMon dieu sauvage m’a accordé le pouvoir de détecter ces créatures enflammées. Tuez-les avant qu’elles ne deviennent une véritable menace.\n\nSi vous avez besoin que je vous montre le fonctionnement de la vision perçante, demandez-moi. Sinon, je vous remettrai mon pouvoir directement.',55664),
(247818,'frFR','','Ce pouvoir marque nos adversaires en rouge pendant un certain temps, les empêchant de se cacher derrière des arbres ou des rochers.',55664),
(247819,'frFR','','À présent, tuez-les et sauvez notre forêt !',55664),
(248418,'frFR','','Comme nous l’avons toujours fait, nous devons nous battre au nom du changement.\n\nNous devons l’incarner !\n\nPour la vie, pour Azeroth !',55664),
(248433,'frFR','','J’espérais que ce serait vous, $n.\n\nLes forces ennemies menacent nos côtes. Je peux vous aider à prendre de la hauteur pour repousser leur attaque.\n\nEnsemble, nous pouvons les vaincre !',55664),
(250729,'frFR','','Nous savons si peu de choses sur cet endroit. Allez donc déterrer l’histoire !',55664),
(250730,'frFR','','Oui ! Chaque artéfact déterré rend l’histoire un peu plus claire.',55664),
(250764,'frFR','','Le sol est jonché de trouvailles ! Prenez votre totem et dégagez-les !',55664),
(250774,'frFR','','C’est un trésor historique ! Ça va vraiment aider nos recherches !',55664),
(251842,'frFR','','Une pelle ? Quelle simplicité ! Imaginez déterrer quelque chose au lieu de le scanner !',55664),
(251843,'frFR','','Intéressant. Pensez-vous que les squammandants en consomment pour améliorer leurs performances… ou déclencher une vision ?',55664),
(251844,'frFR','','Même au cœur de la bataille, les forces armées trouvaient le temps de réparer leur équipement.',55664),
(251885,'frFR','Cette petite île est un vivier historique ! Escortez mon familier pour que je puisse extraire chaque particule de connaissance enterrée ici.','',55664),
(251886,'frFR','Un travail acceptable. Je vous accorde ces subsides, ainsi qu’une mention honorable dans les notes de mon prochain article.','',55664),
(254308,'frFR','Vous semblez bien connaître le passé.','Vous semblez bien connaître le passé.',55664),
(254486,'frFR','','Nous avons beaucoup à apprendre du passé.',55664),
(254742,'frFR','','Lorsque Nozdormu m’a montré que la mort de ma sœur était voulue, qu’elle s’était sacrifiée, cela m’a amenée à m’interroger sur le reste de la « véritable ligne temporelle ». Quels autres moments de tristesse ou de colère ont eu des conséquences bénéfiques ?\n\nLorsque la brume de Pandarie s’est levée, la Horde et l’Alliance ont déplacé leur guerre sur ces côtes et réveillé un mal assoupi. Mais… peut-être était-ce nécessaire pour aboutir à un avenir radieux.\n\nC’est une toute nouvelle perspective sur le passé. C’est pour cela que je suis ici, en compagnie des membres du Vol draconique infini que j’ai pu convaincre.',55664),
(254743,'frFR','','Je reste sceptique quant à la ferveur de Nozdormu, mais sa sagesse m’incite à lui laisser le bénéfice du doute.\n\nAidez-nous ou laissez-nous travailler.',55664),
(254744,'frFR','','Revivez cette ligne temporelle afin que nous puissions observer ses évènements d’un point de vue renouvelé.\n\nNous vous observerons.',55664),
(255760,'frFR','Il y a un temps pour tout.','',55664),
(255768,'frFR','Nous forgeons notre propre avenir.\n\nAvec assez de bronze, je peux forger le vôtre. Je serai en mesure d’améliorer votre équipement… pour un temps.','',55664),
(255800,'frFR','','Lorsque nous étudions les lignes temporelles, nous autres Dragons de l’Infini cherchons à changer les choses pour le mieux. Mais Nozdormu nous a ordonné de laisser ces évènements tels quels.\n\nPar chance, il ne nous a pas interdit de modifier le rôle que vous aviez dans ceux-ci !\n\n<Moratari vous fait un clin d’œil>\n\nNous trouvons toujours un moyen de mener de véritables recherches.',55664),
(255821,'frFR','','Grâce à la magie temporelle de cette cape, vous pouvez voir et collecter les fils éparpillés du temps. Ces fils peuvent se trouver n’importe où dans la ligne temporelle, des adversaires que vous terrassez aux trésors que vous découvrez.\n\nVotre cape les absorbera automatiquement, ce qui augmentera sa puissance de manière permanente.\n\nIl n’y a pas de limite au nombre de fils que vous pouvez collecter. Les possibilités sont donc infinies !',55664),
(256068,'frFR','Nous aurons tout en temps voulu.','',55664),
(256069,'frFR','Quelle que soit votre demande, Momentus peut vous forger ce qu’il vous faut.','Quelle que soit votre demande, Momentus peut vous forger ce qu’il vous faut.',55664),
(256071,'frFR','Quelle question ! Cela ne prendra qu’un instant.','',55664),
(256073,'frFR','Et voilà. Vous pouvez y aller. Puissiez-vous forger votre propre avenir.','',55664),
(256156,'frFR','Nous pouvons recycler tout ce dont vous n’avez pas besoin ! Hahahaha !','',55664),
(256160,'frFR','Vous êtes en train de déformer la trame du temps !','',55664),
(256161,'frFR','Vous vous croyez malins, en refusant de changer la ligne temporelle d’origine, mais en trouvant des failles dans vos champions mortels.','Vous vous croyez malins, en refusant de changer la ligne temporelle d’origine, mais en trouvant des failles dans vos champions mortels.',55664),
(256162,'frFR','Vous ne savez pas ce qui résonne dans vos oreilles indiscrètes !','Vous ne savez pas ce qui résonne dans vos oreilles indiscrètes !',55664),
(256294,'frFR','','$uUn passager clandestin:Une passagère clandestine; ? Qui que vous soyez, j’ai besoin de tout le monde sur le pont !',55664),
(256357,'frFR','','Un moment discordant dans le temps. Il aura des conséquences sur le présent.\n\nMoratari et les autres attendront dans un village non loin avec des provisions.\n\nJe m’attends à en apprendre beaucoup en observant votre progression.',55664),
(256621,'frFR','','Moins il y a de personnes qui connaissent notre mission, mieux c’est.',55664),
(256658,'frFR','','Nous vous équiperons d’un artéfact de l’Infini, une cape qui s’adapte et change en même temps que vous.\n\nNozdormu se refuse à altérer le passé. Mais ce n’est pas ce que nous faisons, n’est-ce pas ? Les évènements auxquels nous allons nous intéresser resteront les mêmes.\n\nC’est vous qui allez changer.',55664),
(256779,'frFR','Un instant. Vous avez d’abord besoin d’un drake !\n\nQuel drake de compagnie souhaitez-vous ?\n\n|cnRED_FONT_COLOR:<Cette décision est permanente, mais vous aurez la possibilité de tous les collecter.>|r','',55664),
(256784,'frFR','Excellent choix.\n\nUne fois que vous aurez appris à invoquer le drake, vous pourrez le trouver avec les autres montures de votre collection.','',55664),
(256822,'frFR','La Vigueur est dépensée pour les capacités de vol à dos de Dragon, comme |TInterface\\ICONS\\Ability_DragonRiding_ForwardFlap01.BLP:20|t |cFFFF0000|Hspell:372608|h[Accélération]|h|r pour un élan vers l’avant et |TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[Ascension]|h|r pour un élan ascendant.\n\nVous récupérez de la Vigueur lorsque vous êtes au sol ou lorsque vous volez à grande vitesse, comme indiqué par |TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[Exaltation céleste]|h|r.\n\nPendant les courses, vous pouvez également retrouver des orbes de Vigueur verts que vous pouvez collecter en volant au travers.','',55664),
(256843,'frFR','Qu’avez-vous appris, cette fois ?','Qu’avez-vous appris, cette fois ?',55664),
(256929,'frFR','Qui êtes-vous ? Comment êtes-vous $uarrivé:arrivée; ici ? Peu importe, nous avons besoin de vous pour combattre !','',55664),
(257520,'frFR','C’est toujours un plaisir, $uchampion:championne; ! Comment se déroulent vos chasses ?','',55664),
(257556,'frFR','','Il suffit parfois de faire preuve de patience pour gagner une guerre. Mais si Aeonicus pose une autre question, je lui ferai avaler mon bouclier.',55664),
(257557,'frFR','Que vous faut-il, petit $r ?','Que vous faut-il, petite $r ?',55664),
(257558,'frFR','','Oh $uchéri:chérie;, vous avez besoin d’un nouveau style.',55664),
(257617,'frFR','Dites $c, vous allez acheter quelque chose ?','Dites $c, vous allez acheter quelque chose ?',55664),
(257618,'frFR','Laissez-le réfléchir, Lida. Nous proposons un éventail assez large de produits.','Laissez-la réfléchir, Lida. Nous proposons un éventail assez large de produits.',55664),
(257619,'frFR','Une réduction ? Ma marchandise est au prix fort !','Une réduction ? Ma marchandise est au prix fort !',55664),
(257910,'frFR','','À mesure que vous explorez Azeroth et les territoires environnants, vous trouvez des objets qui altéreront l’apparence de votre drake.\n\nUne fois ces objets utilisés, les options de personnalisation correspondantes vous seront accessibles à la tribune de transformation.',55664),
(257911,'frFR','','La tribune de transformation permet de modifier l’apparence de votre drake en fonction de ce que vous avez vu et découvert.\n\nDes tribunes de transformation peuvent être trouvées à plusieurs endroits pour adopter une nouvelle apparence. Cherchez le symbole représentant une tête de dragon sur votre carte.',55664),
(257912,'frFR','Ah, vous avez connu un terrible destin ?\n\nSouhaitez-vous retourner auprès du seigneur Andestrasz ?','Ah, vous avez connu un terrible destin ?\n\nSouhaitez-vous retourner auprès du seigneur Andestrasz ?',55664),
(257950,'frFR','','Horos peut vous dégoter un chronobadge. Il a toujours des choses intéressantes en stock !',55664),
(257951,'frFR','Avec suffisamment de temps et de magie de bronze, je peux vous fournir tout ce dont vous avez besoin.','',55664),
(258178,'frFR','Allez-y ! Nous allons prendre la relève !','Allez-y ! Nous allons prendre la relève !',55664),
(258397,'frFR','','Si vous êtes $upressé:pressée;, je peux extraire une gemme que vous n’avez pas encore trouvée depuis une ligne temporelle. Il me faudra juste un peu de bronze.',55664),
(258748,'frFR','Salutations, frêle $r. Saviez-vous que l’ambre et le bronze étaient des choses bien différentes ? Je… viens d’en faire l’expérience.','Salutations, frêle $r. Saviez-vous que l’ambre et le bronze étaient des choses bien différentes ? Je… viens d’en faire l’expérience.',55664),
(258749,'frFR','Attention où vous mettez les pieds !','Attention où vous mettez les pieds !',55664),
(258844,'frFR','Nostwin, venez par ici ! Vous allez nous trahir !','Nostwin, venez par ici ! Vous allez nous trahir !',55664),
(259574,'frFR','Ah, bienvenue, jeune $c ! Je me souviens de mon entraînement |2$c comme si c’était hier.','',55664),
(259576,'frFR','Bonjour ! Puis-je vous proposer ce joli papier ou ce bocal d’abeilles que j’ai trouvé ?','',55664),
(259701,'frFR','Je n’ai rien à vous dire, $c.','',55664),
(259724,'frFR','','N’oubliez pas de vous équiper de la cape. Elle n’aura pas le moindre effet si vous ne la portez pas !',55664),
(260318,'frFR','Êtes-vous $uprêt:prête; à écouter l’histoire de l’ingrédient secret de la soupe de nouilles de la famille Lin ?','',55664),
(260361,'frFR','Vous n’avez qu’un mot à dire pour que la fête des nouilles commence !','',55664),
(264124,'frFR','Enchanté. Mes histoires racontent les maux qui menaçaient Lordaeron, et la manière dont les championnes et champions d’Azeroth les ont surmontés.','',55664),
(264159,'frFR','Voulez-vous rentrer ?','',55664),
(264582,'frFR','','Bienvenue, $uaventurier:aventurière;. Vous avez une question sur le vol à dos de Dragon ?',55664),
(197696,'itIT','','Gli Indegni hanno fortificato la zona con i loro guerrieri più esperti. Sconfiggili, e che il coraggio non ti abbandoni mai!',55664),
(197697,'itIT','','Oggi, hai dimostrato che non cederemo al dubbio. Il Bastione non si arrenderà mai!',55664),
(208593,'itIT','Lascia che la mia lama ti assista. Insieme colpiremo il nemico quando non se lo aspetta!','Lascia che la mia lama ti assista. Insieme colpiremo il nemico quando non se lo aspetta!',55664),
(208596,'itIT','La tua presenza è musica per la mia anima. Lascia che ti accompagni con la mia deliziosa canzoncina funebre.','',55664),
(220584,'itIT','Ecco la vostra rovina!','',55664),
(221430,'itIT','','La magia dei Djaradin manipola gli elementi contro di noi. Aiuta l\'Invocatrice della Terra Yevva a contrastarli.',55664),
(221431,'itIT','','Ottimo lavoro. I Djaradin non sono gli unici in grado di manipolare gli elementi.',55664),
(221889,'itIT','','I Tuskarr di Uktulut sono una forza militare formidabile. È nel nostro interesse ottenere la loro fiducia.',55664),
(221890,'itIT','','Ottimo lavoro. Speriamo serva a spianare la strada per un\'alleanza ancora più salda.',55664),
(221920,'itIT','','I lussureggianti giardini delle Pozze della Vita hanno attirato dei parassiti. Non possiamo permettere che mettano a rischio la sicurezza dei draghetti.',55664),
(221921,'itIT','','Ben fatto, i nostri guardiani ora possono continuare il loro lavoro in tutta tranquillità.',55664),
(228750,'itIT','','Per generazioni, gli Gnoll sono stati un problema. Mi addolora, ma il loro capo deve essere eliminato.',55664),
(228751,'itIT','','Il mio cuore soffre, ma anche la nostra pazienza ha un limite. Grazie per aver fatto ciò che era necessario.',55664),
(230669,'itIT','Lo sapevi che gli avvoltoi defecano sulle proprie zampe per tenerle al fresco? Alcuni possono persino vomitare acido per difendersi, proiettandolo pure abbastanza lontano!','',55664),
(241312,'itIT','','Abbiamo scoperto più di uno di questi \"testi\" che provengono dalla superficie. Inchiostro su carta.',55664),
(241313,'itIT','','Carta! Inchiostro! Noi Niffen non ce ne facciamo niente! La nostra vista è pessima. Dobbiamo toccare per capire qualcosa!',55664),
(241314,'itIT','','Non so cosa stessero pensando... ma ora ci penso io!',55664),
(241317,'itIT','','Se combino questa runa potenziata con questo vetro, e poi uso questo inchiostro magico qui...',55664),
(241318,'itIT','','PROFUMAZIONE!',55664),
(241320,'itIT','','Lo chiamo il Profum-o-Visione di Scridorsa! Ogni parola ora ha un profumo unico!',55664),
(241321,'itIT','','E ora che finalmente posso fiutare tutti questi tomi e pergamene, ho molto da fare! Puoi andare!',55664),
(241322,'itIT','','... Oh perbacco, scandaloso! Non può averlo detto davvero!',55664),
(197696,'koKR','','이탈자가 능란한 전사들을 모아 일대의 방비를 강화했다. 저들을 꺾어야 한다. 용기가 함께하길!',55664),
(197697,'koKR','','오늘, 그대는 우리가 의심에 굴복하지 않음을 증명하였다. 승천의 보루는 항복하지 않으리!',55664),
(199221,'koKR','누군가가 프림로즈 가문에서 아끼는 돌 마귀를 훔쳐 갔네. 이런 노골적인 도둑질을 단죄하지 않고 넘어갈 순 없지! 마귀와 범인을 찾아주게.','',55664),
(199222,'koKR','프림로즈 가문이 자네에게 신세를 졌구먼.','',55664),
(199875,'koKR','할 말이 있는 거야? 그럼 대장인 에드가와 얘기해봐.','',55664),
(199877,'koKR','그쪽에 대장인가 보지? 그럼 이 열쇠가 필요하겠군.','',55664),
(208607,'koKR','누구신지는 잘 모르겠지만, 그래도 친구는 될 수 있겠죠.','',55664),
(210355,'koKR','','그만! 네놈들 발악도 여기까지다!',55664),
(215609,'koKR','','용들이 불안해 보이는군. 에비시안 님은 평온해 보이시지만. 하지만 다른 분들은 아주 불안해.\n\n내가 이 분들보다 멀리 날 수 있을까?',55664),
(221430,'koKR','','자라딘은 우릴 상대하는 데 정기를 조작하는 마법을 이용하고 있다. 대지술사 예바를 도와 맞서도록 해라.',55664),
(221431,'koKR','','수고 많았다, 용사여. 정기를 조종할 수 있는 건 자라딘뿐만이 아니지.',55664),
(221889,'koKR','','우크툴루크 투스카르는 강력한 전사들입니다. 그러니 신뢰를 얻어 두는 게 상책입니다.',55664),
(221890,'koKR','','잘하셨습니다. 더 공고한 연합을 만들어 나가는 데 보탬이 됐으면 좋겠습니다.',55664),
(222842,'koKR','','루비 생명의 제단 수호병들이 원시술사 공격을 막아내느라 전력이 분산된 상황이오. 부디 힘을 보태주시오.',55664),
(222843,'koKR','','덕분에 숨구멍이 트였소. 붉은용군단이 큰 신세를 졌구려.',55664),
(223640,'koKR','','여기서 지켜야 할 규칙 단 하나뿐이다... 타고난 권리나 혈통 같은 시시콜콜한 얘기는 금지라는 것.',55664),
(228640,'koKR','','채집은 사냥보다 명예의 격이 떨어진다는 의견이 중론이지만, 우리 부족 생각은 다릅니다.\n\n한 번에 꿀자두를 몇 개까지 떨어뜨릴 수 있는지 시험해 보세요. 제가 아이들에게 활을 가르칠 때 쓰는 방법이랍니다.',55664),
(230662,'koKR','아, 올빼미 울음소리를 들으니 고향 발샤라와 아즈스나의 숲이 떠오르는군요.\n\n올빼미는 먹잇감을 통째로 삼키는 습성이 있다는 사실, 알고 계셨나요? 그런 다음 소화시키지 못하는 것들은 딱딱한 덩어리로 변형시켜 게워내죠. 덩어리를 깨보면 뼈나 털가죽, 이빨 등 온갖 물건을 찾아볼 수 있답니다!','',55664),
(232300,'koKR','고맙다. 오늘 이 은혜는 잊지 않겠다.','고맙다. 오늘 이 은혜는 잊지 않겠다.',55664),
(232423,'koKR','안녕하십니까. 즐거운 저녁입니다. 오늘은 수라마르의 고위 양조사 일더스 님이 자리를 빛내주셨습니다. 여행에서 영감을 얻은 대가의 요리 솜씨를 맛보실 수 있을 거예요!','',55664),
(232427,'koKR','안녕하시렵니까! 요리사 콜드게일과 일등항해사 피핀이 오늘은 스톰송 바다의 풍성한 맛을 선사할 예정입니다!','',55664),
(241312,'koKR','','종이에 잉크로 글을 쓴 지상의 \"문헌\"이라면 이미 수없이 파냈어.',55664),
(241313,'koKR','','종이! 잉크! 우리 니펜에게는 아무짝에도 쓸모없단 말이야! 시력이 형편없어서 질감으로 느껴야 하거든!',55664),
(241314,'koKR','','대체 무슨 생각으로 이리 만들었는지 모르겠지만... 뭐, 방법이야 찾으면 그만이지!',55664),
(241317,'koKR','','강화된 룬을 이 유리에 결합하고, 이 마법 안료를 더하면...',55664),
(241318,'koKR','','짜잔!',55664),
(241320,'koKR','','스크리도르사의 냄새의 시야 완성! 단어 하나하나가 내는 고유한 냄새를 맡을 수 있지!',55664),
(241321,'koKR','','드디어 이 많은 두루마리와 고서를 읽을 수 있게 됐겠다, 할 일이 아주 많아! 얼른 가봐! 고마워!',55664),
(241322,'koKR','','...어휴. 충격적이네! 세상에, 진짜 그런 말을 썼단 말이야?',55664),
(244905,'koKR','','든든한 수프가 모두의 기운을 북돋아 줄 겁니다. 맛 좋은 식용 버섯을 발견했는데 좀 모아다 주시겠어요?',55664),
(244906,'koKR','','정말 끝내주네요. 한두 개 슬쩍 빼먹고 넘겨도 아무도 모르지 않을까요?',55664),
(249139,'koKR','','지휘관님! 전투에 다녀오셨다고 들었어요. 적은 얼마나 처단하셨나요? 새로 얻은 흉터는 없나요?\n\n<우뚝 서서 허리춤에 손을 얹는 다이오네사>\n\n전 침략자들에게서 정원을 지키고 있었어요. 지휘관님께서 가르쳐 주신 대로요!',55664),
(249140,'koKR','','수호자님! 전투에 다녀오셨다고 들었어요. 적은 얼마나 처단하셨나요? 새로 얻은 흉터는 없나요?\n\n<우뚝 서서 허리춤에 손을 얹는 다이오네사>\n\n전 침략자들에게서 정원을 지키고 있었어요. 수호자님께서 가르쳐 주신 대로요!',55664),
(249200,'koKR','티트리스는 잠시 자리를 비우게 됐어요. 이유는 잘 모르겠네요. 크리타가 대신 자리 좀 맡아달라고 하더라고요.','',55664),
(250683,'koKR','','훌륭한 발견이에요! 물론 여긴 아직도 연구할 게 산더미지만요.',55664),
(250729,'koKR','','이 장소는 미지로 가득해요. 들어가서 역사를 파헤쳐 보자고요!',55664),
(250730,'koKR','','그거죠! 유물을 발굴할 때마다 과거가 조금씩 더 명료해지는 셈이에요.',55664),
(251882,'koKR','오늘의 발견은 이걸로 충분해요. 가보세요. 워이! 참, 목욕도 하시고요. 진흙이 덕지덕지 묻어서 살벌해 보인다고요.','',55664),
(251885,'koKR','이 작은 섬은 역사로 가득해요! 제 전령의 호위를 부탁드릴게요. 이곳에 파묻힌 탐스러운 지식을 파낼 겁니다.','',55664),
(251886,'koKR','수고했어요, 조수님. 이건 사례금이고요. 나중에 연구를 출판할 때 각주로 이름 써드릴게요.','',55664),
(254308,'koKR','과거가 익숙하신가 봅니다.','과거가 익숙하신가 봅니다.',55664),
(254486,'koKR','','과거는 배울 점이 많아.',55664),
(254742,'koKR','','노즈도르무가 언니의 죽음이 본인의 선택이고, 희생이었단 걸 알려줬을 때부터 다른 \'진정한 시간의 길\'에 의문을 품게 됐다. 또 어떤 슬픔이나 분노의 순간이 끝에 가서는 생명을 구하는 결과를 가져왔을까? 하고 말이다.\n\n판다리아의 안개가 걷힌 후, 호드와 얼라이언스는 그치들의 갈등을 이 해안까지 끌고 왔고, 잠들어 있던 악을 깨워버렸다. 그런데, 모르지... 그 모든 게 더 밝은 미래를 이루는 데 필요한 과정이었을지도.\n\n새로운 관점에서 과거를 돌아보려고 한다. 그게 내가 뜻을 같이하는 무한의 용군단과 함께 이곳에 온 이유이니라.',55664),
(254743,'koKR','','난 지금도 노즈도르무의 믿음에 회의적이다. 하지만 한 번쯤은 속는 셈 치고 믿어보려고.\n\n우릴 도울 게 아니라면 그만 떠나다오.',55664),
(254744,'koKR','','우리가 새로운 관점에서 사건을 관측할 수 있도록, 이 시간의 길을 다시 경험해다오.\n\n지켜보고 있으마.',55664),
(255760,'koKR','뭐든 때가 있는 법이죠.','',55664),
(255768,'koKR','우린 우리의 미래를 스스로 만들어 나갑니다.\n\n청동만 충분하다면 당신의 미래도 만들 수 있지요. 당신의 장비를... 일시적으로 강화해 드릴 수 있습니다.','',55664),
(255800,'koKR','','우리 무한의 용은 시간의 길을 연구할 때 되도록 상황을 좋은 방향으로 바꾸기 위해 노력하는 편이에요. 근데 노즈도르무 님은 사건들을 그대로 두라고 하시더군요. \n\n다행히 당신의 역할을 바꾸는 것에 대해서는 아무 말도 하지 않으셨지만요! \n\n<윙크를 보내는 모라타리>\n\n우린 언제나 제대로 된 연구를 수행할 방법을 찾을 거예요.',55664),
(255821,'koKR','','이 망토의 시간 마법으로 흩어진 시간의 실타래를 눈으로 보고, 수집할 수 있어요. 쓰러뜨린 적부터 보물까지 시간의 길 어디서든 찾을 수 있죠. \n\n망토가 알아서 실타래를 흡수할 거예요. 실타래를 흡수하면 성능이 영구적으로 강화돼요. \n\n수집할 수 있는 실타래의 수에는 제한이 없어요. 가능성은 무궁무진하다고요!',55664),
(256068,'koKR','모든 걸 손에 넣을 시간은 충분합니다.','',55664),
(256069,'koKR','뭘 만들 생각인지 몰라도 모멘투스한테 부탁하면 될 겁니다.','뭘 만들 생각인지 몰라도 모멘투스한테 부탁하면 될 겁니다.',55664),
(256071,'koKR','만들어 줄 수 있냐고요? 하! 눈 깜짝할 사이면 끝납니다.','',55664),
(256073,'koKR','다 됐습니다. 잘 사용하시길. 스스로 미래를 개척할 수 있기를 빕니다.','',55664),
(256156,'koKR','쓸모없는 건 전부 분해해서 쓰면 됩니다! 으하하하하!','',55664),
