(256161,'koKR','너희는 뭐라도 된 줄 알겠지. 근본이 되는 시간의 길을 바꾸길 거부하고 필멸자 용사의 허점을 찾았으니 말이야.','너희는 뭐라도 된 줄 알겠지. 근본이 되는 시간의 길을 바꾸길 거부하고 필멸자 용사의 허점을 찾았으니 말이야.',55664),
(256162,'koKR','네놈들이 멋대로 들쑤시고 다니는 게 어떤 파장을 몰고 올지 알긴 하느냐!','네놈들이 멋대로 들쑤시고 다니는 게 어떤 파장을 몰고 올지 알긴 하느냐!',55664),
(256294,'koKR','','밀항자가 있었어? 누군지 모르겠지만 일손 하나도 아쉬운데 잘됐어!',55664),
(256357,'koKR','','시간의 흐름에 팽팽하게 버티고 있는 한 찰나가 있다. 그 메아리가 현대에까지 울려 퍼질 정도지.\n\n주변 마을로 가라. 모라타리와 다른 이들이 보급품을 갖고 와 있을 거다.\n\n네가 행동을 보면서 많은 걸 배울 수 있기를 기대하지.',55664),
(256621,'koKR','','우리의 임무를 아는 사람이 적을수록 좋습니다.',55664),
(256658,'koKR','','무한의 용군단이 가진 유물을 주겠다. 네 행동에 따라 적응하고, 변화하는 망토지.\n\n노즈도르무는 과거를 바꾸는 것에 반대하지. 우리도 그렇게까지 하진 않을 거다. 여기서 일어나는 사건은 그대로일 거야. \n\n달라지는 건 오직 너 하나뿐이다.',55664),
(256779,'koKR','잠깐! 먼저 비룡이 필요할 거요!\n\n어느 비룡 동료와 함께하겠소?\n\n|cnRED_FONT_COLOR:<본 결정은 영구적입니다. 다만 나중에 모든 비룡을 수집할 수 있습니다.>|r','',55664),
(256784,'koKR','훌륭한 선택이오.\n\n비룡 소환 방법을 익히면 수집품 내의 다른 탈것과 함께 분류되어 찾을 수 있다오.','',55664),
(256822,'koKR','활력은 용 조련술 능력에 필요하다오. 이를테면 전방으로 돌진할 때 사용하는 |TInterface\\ICONS\\Ability_DragonRiding_ForwardFlap01.BLP:20|t |cFFFF0000|Hspell:372608|h[전방 쇄도]|h|r라든가, 상승 능력인 |TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[하늘 상승]|h|r에 필요하지.\n\n활력은 지상에 있거나 고속으로 비행할 때 회복된다오. |TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[하늘의 전율]|h|r 효과를 보면 알 수 있지.\n\n경주 중에는 녹색 활력 구슬이 보일 텐데, 통과하고 지나가면 활력이 회복된다오.','',55664),
(256843,'koKR','이번에는 뭘 알아내셨죠?','이번에는 뭘 알아내셨죠?',55664),
