(257520,'koKR','반갑습니다, 용사님! 사냥은 어땠습니까?','',55664),
(257556,'koKR','','인내심은 전쟁을 이기는 비결이라고 하죠. 그래도 에오니쿠스가 한 번만 더 뭘 물어보면 입에 방패를 꽂아줄 겁니다.',55664),
