(257910,'koKR','','아제로스나 그 너머를 탐험하다 보면 비룡의 형상을 바꿀 수 있는 물품을 입수하게 되실 겁니다.\n\n그런 물품을 사용한 다음 변신 강단을 찾아가면 선택지로 사용이 가능합니다.',55664),
(257911,'koKR','','변신 강단을 통해 용의 섬에서 보았거나 발견한 형상을 기반으로 비룡을 다채롭게 꾸밀 수 있습니다.\n\n변신 강단은 각지에 마련되어 있으니, 마음만 먹으면 방문해 새로운 모습으로 꾸밀 수 있답니다. 지도에서 용의 머리 문양을 찾아보세요.',55664),
(257912,'koKR','아, 무슨 끔찍한 봉변이라도 당하셨나요?\n\n안데스트라즈 군주님께 돌려보내 드릴까요?','아, 무슨 끔찍한 봉변이라도 당하셨나요?\n\n안데스트라즈 군주님께 돌려보내 드릴까요?',55664),
(257950,'koKR','','호로스에게 시간의 휘장을 달라고 하세요. 그 양반 항상 특이한 물건을 쌓아놓고 살거든요!',55664),
