(258397,'koKR','','급하시면 다른 시간의 길에서 아직 찾지 못한 보석을 뽑아드릴 수 있어요. 대신 수고비로 청동을 조금만 주세요.',55664),
(258748,'koKR','반갑다, 약골 $r 친구. 호박석과 청동은 서로 다르다는 걸 알고 있나? 난... 얼마 전에 알았지.','반갑다, 약골 $r 친구. 호박석과 청동은 서로 다르다는 걸 알고 있나? 난... 얼마 전에 알았지.',55664),
