(230669,'ptBR','Você sabia que os abutres defecam nos próprios pés para mantê-los frescos? Alguns podem até vomitar ácido gástrico a uma boa distância para se defender!','',55664),
(231306,'ptBR','Um mecanismo de ferrolhos muito simples mantém a caixa fechada. A julgar pelas marcas de mordidas, as hienas devem tê-la aberto várias vezes. É possível que Tiro-no-bucho a tenha usado como instrumento de treino.','Um mecanismo de ferrolhos muito simples mantém a caixa fechada. A julgar pelas marcas de mordidas, as hienas devem tê-la aberto várias vezes. É possível que Tiro-no-bucho a tenha usado como instrumento de treino.',55664),
(231310,'ptBR','<Um osso totalmente roído. O tempo e as mordidas como que lixaram sua superfície. Deve ser o osso predileto de alguém.>','<Um osso totalmente roído. O tempo e as mordidas como que lixaram sua superfície. Deve ser o osso predileto de alguém.>',55664),
(231312,'ptBR','<Parece tratar-se de um caderno roubado de um mago do Kirin Tor. Apesar das marcas de mordidas, de estar recoberto de lodo e de uma substância que parece sangue, ele ainda está inteiro.>','<Parece tratar-se de um caderno roubado de um mago do Kirin Tor. Apesar das marcas de mordidas, de estar recoberto de lodo e de uma substância que parece sangue, ele ainda está inteiro.>',55664),
(231315,'ptBR','<O caderno foi transformado num diário gnoll. Ainda há anotações do Kirin Tor nele, mas desenhos infantis a carvão e... tinta vermelha, os deixaram ilegíveis. O que se vê são figuras toscas de hienas, ossos e muitos, mas muitos coraçõezinhos.\n\nVocê tem fortes suspeitas de quem deve ser o dono desse diário.>','<O caderno foi transformado num diário gnoll. Ainda há anotações do Kirin Tor nele, mas desenhos infantis a carvão e... tinta vermelha, os deixaram ilegíveis. O que se vê são figuras toscas de hienas, ossos e muitos, mas muitos coraçõezinhos.\n\nVocê tem fortes suspeitas de quem deve ser a dona desse diário.>',55664),
(241312,'ptBR','','Nós desenterramos mais de um desses \"textos\" vindos da superfície, com tinta em papel.',55664),
