(247542,'ptBR','','<A coruja sábia analisa você de cima a baixo. Você se sente particularmente vulnerável sob o olhar dela.>\n\nOs guardiões do Sonho me concedem a habilidade de conversar com não corujas, como você.\n\nNosso Sonho está sob ataque. Muitas das criaturas da floresta terão um fim flamejante pela ingestão do pólen borralheiro, mesmo que a princípio não pareçam ter sido afetadas.\n\nMeu deus selvagem me concede o poder de detectar essas criaturas flamejantes. Mate-as antes que se tornem uma ameaça maior.\n\nSe precisar de uma demonstração do poder da visão real, basta pedir. De qualquer forma, meu poder está em suas mãos.',55664),
(247818,'ptBR','','Este poder destaca nossos inimigos claramente em vermelho por um tempo. Eles não podem se esconder atrás de árvores e rochas.',55664),
(247819,'ptBR','','Agora mate-os para proteger nossa floresta!',55664),
(248418,'ptBR','','Como sempre fizemos, precisamos lutar pela mudança que esperamos.\n\nPrecisamos nos transformar nela!\n\nPela vida, por Azeroth!',55664),
(248433,'ptBR','','Eu esperava que fosse você, $n.\n\nAs forças inimigas ameaçam o litoral próximo. Posso ajudar você a alçar voo e repelir o ataque.\n\nJunt$Uos:as;, nós vamos conseguir!',55664),
(250729,'ptBR','','Ainda temos muito a aprender sobre este lugar. Entre lá e comece a escavar a história!',55664),
(250730,'ptBR','','Isso! O passado fica mais claro com cada artefato que escavamos.',55664),
(250764,'ptBR','','O terreno aqui tá repleto de achados! Pegue o seu totem e mãos à obra!',55664),
(250774,'ptBR','','Um tesouro histórico! Isto vai dar credibilidade à nossa pesquisa!',55664),
(251842,'ptBR','','Uma pá? Que pitoresco. Imagine cavar algo, se podemos fazer uma varredura!',55664),
(251843,'ptBR','','Curioso. Você acha que comandantes-de-escama usavam isto pelo desempenho... ou para ter visões?',55664),
(251844,'ptBR','','Mesmo no calor da batalha, os guerreiros repararam o equipamento.',55664),
(251885,'ptBR','Esta ilhota é berço de história! Acompanhe meu familiar para que eu possa sorver todo o conhecimento enterrado aqui.','',55664),
(251886,'ptBR','Trabalhou a contento, assistente. Concedo a você esta remuneração e uma menção honrosa nas notas de rodapé da minha publicação.','',55664),
(254308,'ptBR','Você parece conhecer o passado.','Você parece conhecer o passado.',55664),
(254486,'ptBR','','Temos muito o que aprender com o passado.',55664),
(254742,'ptBR','','Quando Nozdormu me mostrou que a morte da minha irmã tinha sido escolha dela, um sacrifício dela... isso me fez questionar o resto da \"verdadeira linha temporal\". Que outros momentos de tristeza e raiva salvaram vidas?\n\nQuando as brumas de Pandária se abriram, a Horda e a Aliança trouxeram o conflito delas para esta terra e despertaram um mal adormecido. Todavia... talvez aquilo fosse necessário para trazer um futuro melhor.\n\nÉ hora de refletir sobre o passado de uma nova perspectiva. E é por isso que estou aqui, juntamente com quem consegui convencer da Revoada Dragônica Infinita a se juntar a mim.',55664),
(254743,'ptBR','','Permaneço cética em relação à fé de Nozdormu nessa conduta, mas estou disposta a dar à sabedoria dele o benefício da dúvida.\n\nAjude-nos, ou nos deixe trabalhar.',55664),
(254744,'ptBR','','Reviva essa linha temporal para observarmos os acontecimentos sob uma nova perspectiva.\n\nObservaremos você.',55664),
(255760,'ptBR','Tudo tem seu tempo.','',55664),
(255768,'ptBR','Nós forjamos nossos próprios futuros.\n\nCom bronze suficiente, posso forjar o seu. Eu posso aprimorar seu equipamento... momentaneamente.','',55664),
(255800,'ptBR','','Quando estudamos as linhas temporais, nós, dragões infinitos, geralmente tentamos fazer mudanças positivas. Contudo, Nozdormu nos disse para deixar os eventos como estavam.\n\nPor sorte, ele não disse nada quanto a alterar a sua parte neles!\n\n<Moratari pisca para você.>\n\nSempre encontraremos algum jeito de fazer uma boa pesquisa.',55664),
(255821,'ptBR','','Com a magia temporal desse manto, você pode ver e coletar fios do tempo avulsos. Esses fios estão em tudo que é lugar nesta linha temporal, de inimigos derrotados a tesouros coletados.\n\nSeu manto absorverá os fios por si só, aumentando o poder dele permanentemente.\n\nNão há limite para os fios que você pode coletar. As possibilidades são infinitas!',55664),
(256068,'ptBR','Vamos conseguir tudo a tempo.','',55664),
(256069,'ptBR','O que quer que queira fazer, Momentus pode forjar para você.','O que quer que queira fazer, Momentus pode forjar para você.',55664),
(256071,'ptBR','Se eu consigo? Rá! Posso fazer isso num instante.','',55664),
(256073,'ptBR','Aí está. Vá no momento certo. Que você forje o seu próprio futuro.','',55664),
(256156,'ptBR','Podemos desmanchar qualquer coisa de que você não precise! Muahahaha!','',55664),
(256160,'ptBR','Você perturba a tessitura do tempo!','',55664),
(256161,'ptBR','Vocês se acham espertos, se recusando a mudar a linha temporal original, mas achando brechas em seus campeões mortais.','Vocês se acham espertos, se recusando a mudar a linha temporal original, mas achando brechas em seus campeões mortais.',55664),
(256162,'ptBR','Vocês não sabem o que a sua intromissão causou!','Vocês não sabem o que a sua intromissão causou!',55664),
(256294,'ptBR','','$uUm clandestino:Uma clandestina;? Quem quer que você seja, preciso de todas as mãos no convés!',55664),
(256357,'ptBR','','Um momento contencioso no tempo. Um que ecoa até o presente.\n\nMoratari e os outros estarão à espera com os suprimentos numa vila próxima.\n\nEspero aprender muito ao acompanhar o seu progresso.',55664),
(256621,'ptBR','','Quanto menos gente souber da nossa missão, melhor.',55664),
(256658,'ptBR','','Equiparemos você com um artefato do infinito. Um manto que se adapta e muda com você.\n\nNozdormu se opõe a alterações no passado, mas não é o que estamos fazendo, certo? Os eventos que transcorrerem aqui permanecerão os mesmos.\n\nVocê é que mudará.',55664),
(256779,'ptBR','Só um instante. Primeiro você precisa de um draco!\n\nQual draco você quer como companheiro?\n\n|cnRED_FONT_COLOR:<Essa decisão é permanente, mas depois você poderá obter todos.>|r','',55664),
(256784,'ptBR','Excelente escolha.\n\nDepois que você aprender a evocar o draco, poderá encontrá-lo junto às outras montarias da sua coleção.','',55664),
(256822,'ptBR','O Vigor é gasto em habilidades de dragonaria, como ao usar|TInterface\\ICONS\\Ability_DragonRiding_ForwardFlap01.BLP:20|t |cFFFF0000|Hspell:372608|h[Avante]|h|r para ganhar impulso e|TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[Subir aos Céus]|h|r para se lançar para cima.\n\nVocê recupera vigor no chão ou voando em alta velocidade, com|TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[Emoção dos Céus]|h|r.\n\nEm corridas, você também pode achar orbes verdes de vigor para coletar voando através deles.','',55664),
(256843,'ptBR','O que você descobriu dessa vez?','O que você descobriu dessa vez?',55664),
(256929,'ptBR','Quem é você? Como veio parar aqui? Não importa, precisamos que empunhe armas!','',55664),
(257520,'ptBR','Que bom ver você, $Ucampeão:campeã;! Como vão as caçadas?','',55664),
(257556,'ptBR','','A paciência vence guerras. Mas se Aeonicus fizer mais uma pergunta ela vai engolir o meu escudo.',55664),
(257557,'ptBR','Do que você precisa, $r fracote?','Do que você precisa, $r fracote?',55664),
(257558,'ptBR','','Ah, meu bem, você precisa de um visual novo.',55664),
(257617,'ptBR','Ei, $c. Vai comprar alguma coisa ou não vai?','Ei, $c. Vai comprar alguma coisa ou não vai?',55664),
(257618,'ptBR','Deixe $Gele:ela; pensar, Lida. Oferecemos uma bela seleção.','Deixe $Gele:ela; pensar, Lida. Oferecemos uma bela seleção.',55664),
(257619,'ptBR','Ofertas? Minhas mercadorias estão com o preço normal!','Ofertas? Minhas mercadorias estão com o preço normal!',55664),
(257910,'ptBR','','Ao explorar Azeroth e além, você encontrará itens diferentes que vão afetar a aparência do seu draco.\n\nQuando você usar esses itens, as opções vão aparecer como disponíveis na Tribuna de Transformação.',55664),
(257911,'ptBR','','A Tribuna de Transformação é onde você pode escolher uma aparência diferente para o seu draco, com base no que você viu e descobriu.\n\nVocê pode encontrar Tribunas da Transformação em vários lugares, se quiser mudar o visual. Procure o símbolo da cabeça de dragão no mapa.',55664),
(257912,'ptBR','Ah, você já encontrou um destino terrível?\n\nQuer voltar ao Lorde Andestrasz?','Ah, você já encontrou um destino terrível?\n\nQuer voltar ao Lorde Andestrasz?',55664),
(257950,'ptBR','','Horos pode lhe providenciar uma cronofivela. Ele sempre tem alguma coisa interessante no catálogo!',55664),
(257951,'ptBR','Com tempo e bronze suficientes, posso conseguir tudo de que você precisa.','',55664),
(258178,'ptBR','Vá! Nós assumimos daqui!','Vá! Nós assumimos daqui!',55664),
(258397,'ptBR','','Se estiver com pressa, eu posso conseguir uma gema que você ainda não encontrou em outra linha temporal. Custa só um pouquinho de bronze.',55664),
(258748,'ptBR','Olá, $r fracote. Sabia que âmbar e bronze não são a mesma coisa? Eu sei... agora.','Olá, $r fracote. Sabia que âmbar e bronze não são a mesma coisa? Eu sei... agora.',55664),
(258749,'ptBR','Olhe onde pisa!','Olhe onde pisa!',55664),
(258844,'ptBR','Nostwin, vem cá! Você vai nos revelar!','Nostwin, vem cá! Você vai nos revelar!',55664),
(259574,'ptBR','Ah, boas-vindas, jovem $c! Eu lembro do meu treinamento como se fosse ontem.','',55664),
(259576,'ptBR','Olá! Você não estaria $Uinteressado:interessada; num papel chique ou nesse pote de abelhas que eu achei?','',55664),
(259701,'ptBR','Não tenho nada a tratar com você, $c.','',55664),
(259724,'ptBR','','Não se esqueça de pôr o manto. Ele só fortalece se você se equipar com ele!',55664),
(260318,'ptBR','$uPronto:Pronta; para ouvir a história do ingrediente secreto da sopa de macarrão da família Lin?','',55664),
(260361,'ptBR','É só falar, pro macarrão instantâneo começar!','',55664),
(264124,'ptBR','Saudações. Minhas histórias tratam dos males que ameaçaram Lordaeron e como os campeões de Azeroth os sobrepujaram.','',55664),
(264159,'ptBR','Deseja retornar?','',55664),
(264582,'ptBR','','Boas-vindas, viajante. Você tem dúvidas sobre dragonaria?',55664),
(204189,'ruRU','Пожалуй, это моя лучшая работа.','',55664),
(209020,'ruRU','Ты тоже... падешь...','Ты тоже... падешь...',55664),
(210355,'ruRU','','Хватит! Ваш путь закончится здесь.',55664),
(215047,'ruRU','','Я собрала все, что смогла. Дракониды решили последовать за нами. \n\nМы собрали немного припасов по пути сюда, но на этом острове недостаточно жизни, чтобы прокормить столько драктиров. Так было с самого начала.\n\nОставаться здесь очень опасно.',55664),
(221430,'ruRU','','Магия этого джарадина обращает стихии против нас. Помоги заклинательнице земли Еве с ними бороться.',55664),
(221431,'ruRU','','Отлично, $n. Не одни джарадины могут повелевать силой стихий.',55664),
(221889,'ruRU','','Племя Уктулут – грозные воины. Нам важно заслужить их доверие.',55664),
(221890,'ruRU','','Прекрасно. Надеюсь, это укрепит наш будущий союз.',55664),
(228750,'ruRU','','Эти гноллы веками не дают нам покоя. Мне этого не хочется, но надо избавиться от их вожака.',55664),
(228751,'ruRU','','Жаль, что до этого дошло, но даже нашему терпению приходит конец. Спасибо за помощь.',55664),
(232427,'ruRU','Привет-привет! Сегодня шеф-повар Хладношторм и его старший помощник Пиппин побалуют нас насыщенным вкусом даров моря из прибрежных вод долины Штормов!','',55664),
(232987,'ruRU','Если тебе надо попасть на Берега Пробуждения, выйди из города к докам и поднимись на башню – оттуда ходит дирижабль до островов.','Если тебе надо попасть на Берега Пробуждения, выйди из города к докам и поднимись на башню – оттуда ходит дирижабль до островов.',55664),
(233721,'ruRU','А, $n! Тебе здесь всегда рады. Мы не забыли о твоем вкладе в наше дело. Проси все, что угодно: наш клан рад помочь тебе с Эйтриггом.\n\nНо что привело вас сюда? Не погостить же вы пришли?','',55664),
(241312,'ruRU','','Мы выкопали не один такой \"текст\" – так их называют наземники. Они-то пишут чернилами по бумаге.',55664),
(241313,'ruRU','','Подумать только, бумага с чернилами! Нам, ниффам, такое без пользы. У нас слабые глаза. Нам нужно чувствовать пальцами!',55664),
(241314,'ruRU','','Не знаю, как такое могло в голову прийти... Но я что-нибудь придумаю!',55664),
(241317,'ruRU','','Если взять эту наделенную силой руну и объединить ее вот с этим стеклом, а потом нанести вот сюда магический пигмент...',55664),
(241318,'ruRU','','ЗАПАХОФИКАЦИЯ!',55664),
(241320,'ruRU','','Я зову это запаховидением Скридорсы! Теперь у каждого слова свой особый запах!',55664),
(241321,'ruRU','','И раз уж я теперь могу разнюхать все тайны этих свитков и книг, мне есть чем заняться! Можешь идти. И спасибо тебе!',55664),
(241322,'ruRU','','Охо-хо, вот это номер! Она так и сказала? Серьезно?!',55664),
(242707,'ruRU','А вот и вы. Попытайтесь найти общий язык, что ли.','',55664),
(242753,'ruRU','','<Ванесса смеется.>\n\nЯ? Я же преступница! \n\nМне нельзя не только возглавлять гильдию, но и даже быть ее участницей. Я только испорчу ее репутацию. \n\nЯ не сомневаюсь, что аристократы из Благородных домов постараются задушить гильдию на корню. Граф Клессингтон был явным доказательством того, что многих вельмож до сих пор не волнует ничего, кроме власти. А где есть власть, есть и коррупция.\n\nУ всех на виду они улыбаются и кивают, зато с наступлением ночи подсылают к тебе убийц. \n\nИ когда их агенты выйдут из тени, я буду здесь, чтобы защитить гильдию.',55664),
(242761,'ruRU','<Фермер Сальден улыбается.>\n\nЭто будто какое-то чудо. Наша доченька Хоуп... вернулась. Мы думали, что навсегда ее потеряли. \n\nУ нас был серьезный разговор. Она не всегда поступала правильно. Ванесса ван Клиф – тяжелое имя. Полное боли. Она хочет оставить прошлое и двигаться дальше. \n\nА мы с Сальмой... Мы просто рады снова ее видеть.','',55664),
(242763,'ruRU','Фермеры... бывшие участники братства Справедливости... хорошие люди, потерявшие дом после всех этих войн...\n\nСколько лет мы барахтались, едва держась на плаву. Но это в прошлом! Мы соберемся с силами и возделаем эти поля! Земля нынче плодородная! Так и ждет новых посевов!\n\nШтормграду придется считаться с житницей Восточных королевств. И никакие чванливые аристократы нас не остановят. \n\nВ этот раз мы не подведем своих соседей. Это я обещаю.','',55664),
(242765,'ruRU','Гильдия хлеборобов – начало нашего подъема. \n\nПодъема, понимаешь? Как у теста для хлеба. \n\n<Фермер Сальден добродушно усмехается и подмигивает вам.>\n\nЭто наше движение будет бороться за права Западного края. Не поддаваясь алчности, как братство Справедливости. \n\nДолжен признаться, я не раз подумывал к ним присоединиться. Так тяжело нам жилось. Но я не мог согласиться с воровством – тем более, что воровали они у моих соседей! Это неправильно. \n\nМы с Сальмой мечтали, чтобы для всех все наладилось. И теперь это не простые мечты. \n\nГоспожа Сесилия и Ванесса помогают нам с гильдией. Ванесса решила не вступать, и я ее понимаю. Но как же я горжусь этой девчонкой! Что бы мы делали без ее гениальных идей?','',55664),
(242767,'ruRU','','Гильдия хлеборобов – это союз хороших людей, помогающих ближним. \n\nСтолько трудяг живет и работает в этих землях... Давно надо было взять и объединиться. Снова начать возделывать поля... Построить новые дома... \n\nТеперь подобные разговоры можно услышать на каждом шагу. Будто к нам ворвался ветер перемен. \n\nНадеюсь, эти ветра дойдут до самого Штормграда. \n\nНо что бы ни случилось, я буду здесь, готовая накормить нуждающихся горячей похлебкой и выслушать их проблемы.',55664),
(242817,'ruRU','Не бойся, парень. $n в один миг вернет твою карту. А пока не хочешь сыграть матч-другой?','',55664),
(242818,'ruRU','Ладно. Но без счастливой карты я все равно не выиграю...','',55664),
(242978,'ruRU','Откуда у тебя этот жезл?','',55664),
(242982,'ruRU','','Я просто играла...',55664),
(243765,'ruRU','Ты могла кого-то поранить, Джайна. Магия очень опасна!','',55664),
(243766,'ruRU','','Да, папа.',55664),
(243861,'ruRU','','Эта маскировка поможет тебе затеряться среди жителей Тирагардского поморья и рассеет заклинания Джайны.',55664),
(244054,'ruRU','Друиды пламени подожгли курганы! Помоги тем, кто в беде.','',55664),
(244055,'ruRU','Курганы снова в безопасности. Спасибо тебе.','',55664),
(244062,'ruRU','Что это вы обсуждали с Дрейвеном?\n\nНе знала, что сейчас мы сотрудничаем с вентирами. Я им не доверяю.','Что это вы обсуждали с Дрейвеном?\n\nНе знала, что сейчас мы сотрудничаем с вентирами. Я им не доверяю.',55664),
(244064,'ruRU','Кажется, в последнее время ты крепко дружишь с кириями.\n\nНадеюсь, твоя верность некролордам не ослабла, $n? Нам еще многое нужно сделать. \n\nМне бы не хотелось, чтобы наши отношения испортило предательство.','Кажется, в последнее время ты крепко дружишь с кириями.\n\nНадеюсь, твоя верность некролордам не ослабла, $n? Нам еще многое нужно сделать. \n\nМне бы не хотелось, чтобы наши отношения испортило предательство.',55664),
(244905,'ruRU','','Сытная похлебка всем поднимет боевой дух. Мы нашли съедобные вкусные грибы. Соберешь их?',55664),
(244906,'ruRU','','О, отлично, те самые грибы. Никто не заметит, если мы съедим сейчас парочку.',55664),
(246422,'ruRU','Знаю, у тебя нет причин мне доверять. Учитывая, что я вступил в Альянс.','Знаю, у тебя нет причин мне доверять. Учитывая, что я вступила в Альянс.',55664),
(246423,'ruRU','Знаю, у тебя нет причин мне доверять. Учитывая, что я вступил в Орду.','Знаю, у тебя нет причин мне доверять. Учитывая, что я вступила в Орду.',55664),
(246424,'ruRU','Но мы должны позабыть обо всем и сплотиться против общей угрозы. Она куда страшнее разногласий.','Но мы должны позабыть обо всем и сплотиться против общей угрозы. Она куда страшнее разногласий.',55664),
(247753,'ruRU','Лава найдет вас.','',55664),
(247796,'ruRU','Горсть пепла!','',55664),
(248366,'ruRU','Бегите, малютки, бегите!','',55664),
(248418,'ruRU','','Если мы хотим, чтобы мир изменился в лучшую сторону, надо сражаться.\n\nНадо меняться самим!\n\nРади жизни! Ради Азерота!',55664),
(248433,'ruRU','','Я надеялась увидеть тебя, $n.\n\nВраги напали на наши берега. Я помогу тебе взлететь и прогнать захватчиков.\n\nВместе у нас все получится!',55664),
(248776,'ruRU','Твой посох... Он говорит со мной!','',55664),
(248780,'ruRU','Смотри, не накликай беду, принеся сюда такое оружие, |3-6($c).\n\nТитаны заботятся лишь о своем дражайшем Порядке. Они готовы пожертвовать всем, чтобы его добиться, – и своими последователями тоже.\n\nДаже Темный титан действовал, следуя порядку. Он строил свой идеальный мир, мысля холодно и расчетливо, а в случае неудачи был готов уничтожить все сущее.\n\nДумаешь, его собратья не такие? Да, у них иные методы, но цели те же.\n\nЕсли будешь слепо идти у них на поводу, станешь частью этого замысла.','',55664),
(249137,'ruRU','','Мама! Я слышала, тебе пришлось сражаться! Как много врагов там было? У тебя теперь новые шрамы?\n\n<Дионесса гордо распрямляет спину и упирает руки в бока.>\n\nА я защищала сад! Все по твоей науке, мама!',55664),
(249138,'ruRU','','Папа! Я слышала, тебе пришлось сражаться! Как много врагов там было? У тебя теперь новые шрамы?\n\n<Дионесса гордо распрямляет спину и упирает руки в бока.>\n\nА я защищала сад! Все по твоей науке, папа!',55664),
(250683,'ruRU','','Отличная работа! Но нужно еще больше изысканий.',55664),
(250729,'ruRU','','Мы еще многого не знаем об этом месте. Так что пора раскопать пару тайн!',55664),
(250730,'ruRU','','Отлично! С каждой новой находкой прошлое все больше проясняется!',55664),
(251882,'ruRU','Все, находок достаточно. Иди. Кыш-кыш! И грязь смыть не забудь. Выглядишь ужасно.','',55664),
(251885,'ruRU','У этого крошечного островка богатое прошлое! Следи за моим фамилиаром, чтобы я сумел отыскать все-все артефакты!','',55664),
(251886,'ruRU','Относительно неплохая работа. Держи, вот твоя стипендия. А еще я упомяну тебя в сносках к моей следующей работе.','',55664),
(254308,'ruRU','Кажется, ты разбираешься в прошлом.','Кажется, ты разбираешься в прошлом.',55664),
(254486,'ruRU','','Мы можем многое почерпнуть из прошлого.',55664),
(254742,'ruRU','','Когда Ноздорму показал, что моя сестра сама решила отдать свою жизнь... что она принесла жертву... я задумалась над остальными событиями \"истинной\" временной линии. Что если другие несправедливости и трагедии тоже имели последствия, которые спасли кому-то жизнь?\n\nКогда туманы Пандарии развеялись, туда хлынули Орда и Альянс. Они принесли дрязги и распри, пробудившие древнее зло. Но, может, даже это было необходимо, чтобы наступило светлое будущее?\n\nПришло время взглянуть на прошлое по-новому. Поэтому я и прибыла сюда вместе с драконами Бесконечности, которых сумела уговорить.',55664),
(254743,'ruRU','','Я все еще сомневаюсь в мировоззрении Ноздорму, но готова дать ему шанс.\n\nИли помоги нам, или хотя бы не мешай работать.',55664),
(254744,'ruRU','','Проживи события этого времени, чтобы мы могли взглянуть на них под другим углом.\n\nМы будем за тобой следить.',55664),
(255760,'ruRU','Всему свое время.','',55664),
(255768,'ruRU','Всякий сам кует свое будущее.\n\nНо если принесешь достаточно бронзы, я выкую твое. Смогу улучшить твое снаряжение... в одно мгновение.','',55664),
(255800,'ruRU','','Изучая временные линии, драконы Бесконечности обычно пытаются изменить их в лучшую сторону. Однако Ноздорму велел не трогать прошлое. Оставить его таким, каким оно было.\n\nК счастью, он ничего не сказал о твоей роли в этом прошлом!\n\n<Моратари подмигивает вам.>\n\nДа-да, мы всегда найдем способ изучить все как следует.',55664),
(255821,'ruRU','','Бронзовая магия этого плаща позволит тебе видеть и собирать затерявшиеся нити времени. В этой временной линии они повсюду, на поверженных созданиях и среди сокровищ.\n\nТвой плащ сам поглотит найденные нити, и его сила навсегда возрастет.\n\nСобирай нити сколько угодно – тебя ждут бесконечные возможности!',55664),
(256068,'ruRU','Со временем мы получим все, что нужно.','',55664),
(256069,'ruRU','Моментий выкует все, что тебе нужно.','Моментий выкует все, что тебе нужно.',55664),
(256071,'ruRU','Могу ли я? Ха! Да за секунду сделаю.','',55664),
(256073,'ruRU','Готово. Пусть твое время всегда будет подходящим. Твори свое будущее.','',55664),
(256156,'ruRU','Что-то не нужно? Мы заберем! И разберем! Ах-ха-ха!','',55664),
(256160,'ruRU','Вы искажаете саму материю времени!','',55664),
(256161,'ruRU','Думаете, вы самые умные, раз не хотите менять изначальную временную линию? Думаете, смертные герои помогут вам выкрутиться?','Думаете, вы самые умные, раз не хотите менять изначальную временную линию? Думаете, смертные герои помогут вам выкрутиться?',55664),
(256162,'ruRU','Вы и знать не знаете, с чем пытаетесь играть!','Вы и знать не знаете, с чем пытаетесь играть!',55664),
(256294,'ruRU','','У нас тут зайцы? Ладно, нам любые воины сгодятся.',55664),
(256357,'ruRU','','Это очень спорный момент в истории. Его отпечаток до сих пор ощущается в настоящем.\n\nМоратари и остальные подготовят припасы и будут ждать тебя в ближайшей деревне.\n\nНадеюсь, ты многое нам продемонстрируешь.',55664),
(256621,'ruRU','','Чем меньше любопытных знает, чем мы здесь заняты, тем лучше.',55664),
(256658,'ruRU','','Мы дадим тебе артефакт Бесконечности. Плащ, который будет меняться и адаптироваться вместе с тобой.\n\nНоздорму считает, что прошлое должно оставаться неизменным. Но мы и не собираемся ничего менять. Все события останутся те же.\n\nЕдинственный новый элемент – это ты.',55664),
(256779,'ruRU','Прежде всего тебе нужен дракон!\n\nКакого дракона ты хочешь себе в спутники?\n\n|cnRED_FONT_COLOR:<Изменить решение будет нельзя, но со временем вы сможете собрать их всех.>|r','',55664),
(256784,'ruRU','Великолепный выбор.\n\nКак только научишься призывать дракона, он появится у тебя в коллекции рядом с остальными средствами передвижения.','',55664),
(256822,'ruRU','Бодрость нужна, чтобы использовать способности драконов. Например, |TInterface\\ICONS\\Ability_DragonRiding_ForwardFlap01.BLP:20|t |cFFFF0000|Hspell:372608|h[\"Рывок вперед\"]|h|r позволит лететь быстрее, а |TInterface\\ICONS\\Ability_DragonRiding_UpwardFlap01.BLP:20|t |cFFFF0000|Hspell:372610|h[\"Взлет вверх\"]|h|r поможет набрать высоту.\n\nБодрость восстанавливается, пока ты сидишь на земле или мчишься на высокой скорости – последнее называется |TInterface\\ICONS\\Ability_DragonRiding_ThrilloftheSkies01.BLP:20|t |cFFFF0000|Hspell:383366|h[\"Азарт небес\"].|h|r.\n\nКроме того, во время гонки тебе могут встретиться сферы бодрости. Чтобы собрать такую сферу, пролети через нее.','',55664),
(256843,'ruRU','Что тебе удалось узнать на этот раз?','Что тебе удалось узнать на этот раз?',55664),
(256929,'ruRU','Ты кто? Как тебе удалось сюда попасть? А, неважно. Беги к пушкам!','',55664),
(257520,'ruRU','Рад видеть тебя, герой! Как дела на охоте?','',55664),
(257556,'ruRU','','Терпение – залог победы. Но если Эоник задаст хоть еще один вопрос, я скормлю ей мой щит.',55664),
(257557,'ruRU','Чего надо такой мелочи, как ты, |3-6($r)?','Чего надо такой мелочи, как ты, |3-6($r)?',55664),
(257558,'ruRU','','Ох, дорогуша, тебе надо сменить стиль.',55664),
(257617,'ruRU','Эй, |3-6($c), будешь брать что-нибудь или как?','Эй, |3-6($c), будешь брать что-нибудь или как?',55664),
(257618,'ruRU','Дай |3-2($r) подумать, Лида. У нас ведь очень большой выбор.','Дай |3-2($r) подумать, Лида. У нас ведь очень большой выбор.',55664),
(257619,'ruRU','Ну так пусть уже выберет что-нибудь и даст другим выбирать!','Ну так пусть уже выберет что-нибудь и даст другим выбирать!',55664),
(257910,'ruRU','','Путешествуя по Азероту и за его пределами, ты будешь время от времени натыкаться на различные предметы, которые изменят внешность твоего дракона.\n\nКак только используешь их, на постаменте трансформации появится новый вариант облика.',55664),
(257911,'ruRU','','С помощью постамента трансформации можно менять внешний вид своего дракона. Ну а варианты зависят от того, что тебе довелось повидать и обнаружить.\n\nТакие постаменты есть во многих местах. Если захочешь выбрать ящеру новый облик, найди на карте символ в виде драконьей головы.',55664),
(257912,'ruRU','Ох, неужели случилось страшное?\n\nХочешь вернуться к лорду Андестразу?','Ох, неужели случилось страшное?\n\nХочешь вернуться к лорду Андестразу?',55664),
(257950,'ruRU','','Спроси Гороса, не найдется ли у него для тебя хроножетона. У него всегда припасена куча интересного!',55664),
(257951,'ruRU','Если принесешь достаточно бронзы, то со временем я достану тебе что угодно.','',55664),
(258178,'ruRU','Иди! Дальше мы сами справимся!','Иди! Дальше мы сами справимся!',55664),
(258397,'ruRU','','Если тебе срочно нужен самоцвет, которого у тебя еще нет, я могу одолжить его в другой временной линии. Мне нужно только немного бронзы.',55664),
(258748,'ruRU','Привет, крошка-|3-6($r). А ты знаешь, что янтарь и бронза – совсем разные вещи? Вот я теперь знаю...','Привет, крошка-|3-6($r). А ты знаешь, что янтарь и бронза – совсем разные вещи? Вот я теперь знаю...',55664),
(258749,'ruRU','Смотри под ноги!','Смотри под ноги!',55664),
(258844,'ruRU','Сюда, Ноствин! Из-за тебя нас поймают!','Сюда, Ноствин! Из-за тебя нас поймают!',55664),
(259574,'ruRU','А, приветствую тебя, |3-6($c)! Я помню, как учился этому мастерству, словно это было вчера.','',55664),
(259576,'ruRU','Привет! Посмотришь на мои товары? У меня тут есть интересная бумажка и банка с пчелами!','',55664),
(259701,'ruRU','Нам с тобой говорить не о чем, |3-6($c).','',55664),
(259724,'ruRU','','Не забудь надеть плащ. Он не усилит тебя, если будет лежать в сумке!',55664),
(260318,'ruRU','Послушаешь историю о секретном ингредиенте для супа Линь?','',55664),
(260361,'ruRU','Одно твое слово – и лапша польется рекой!','',55664),
(264124,'ruRU','Здравствуй. В моих историях повествуется о злых силах, которые угрожали Лордерону, и о победе над ними героев Азерота.','',55664),
(264159,'ruRU','Хочешь вернуться?','',55664),
(264582,'ruRU','','Добро пожаловать. Хочешь что-то узнать о полетах на драконе?',55664);
