(2707,'esES','Blasón de ensueño de draco','Se obtiene en algunas actividades de exteriores, en Amirdrassil en dificultad normal y en mazmorras de piedra angular mítica de +6 a +10 durante la temporada 3 de Dragonflight.',54673),
(2708,'esES','Blasón de ensueño de vermis','Se obtiene en Amirdrassil en dificultad heroica y en mazmorras de piedra angular mítica de +11 a +15 durante la temporada 3 de Dragonflight.',54673),
(2709,'esES','Blasón de ensueño de Aspecto','Se obtiene en Amirdrassil en dificultad mítica y en mazmorras de piedra angular mítica a partir de +16 durante la temporada 3 de Dragonflight.',54673),
(2778,'esES','Bronce','Los aliados del Infinito de Eternus comercian usando hilos sueltos de tiempo comprimidos en monedas de bronce.',54673),
(2807,'esES','Blasón despierto de draco','Se obtiene en algunas actividades de exteriores, en bandas en dificultad normal y en mazmorras de dificultad mítica 0 durante la temporada 4 de Dragonflight.',54673),
(2809,'esES','Blasón despierto de vermis','Se obtiene en bandas en dificultad heroica y en mazmorras de piedra angular mítica de hasta +5 durante la temporada 4 de Dragonflight.',54673),
(2812,'esES','Blasón despierto de Aspecto','Se obtiene en bandas en dificultad mítica y en mazmorras de piedra angular mítica a partir de +6 durante la temporada 4 de Dragonflight.',54673),
(2706,'esMX','Emblema de ensueño de vástago','Se obtiene de muchas actividades en exteriores, Amirdrassil en dificultad buscador de bandas y calabozos de piedra angular mítica de hasta +5 durante la temporada 3 de Dragonflight.',54673),
(2707,'esMX','Emblema de ensueño de draco','Se obtiene de algunas actividades en exteriores, Amirdrassil en dificultad normal y calabozos de piedra angular mítica de +6 a +10 durante la temporada 3 de Dragonflight.',54673),
(2708,'esMX','Emblema de ensueño de vermis','Se obtiene de Amirdrassil en dificultad heroica y calabozos de piedra angular mítica de +11 a +15 durante la temporada 3 de Dragonflight.',54673),
(2709,'esMX','Emblema de ensueño de Aspecto','Se obtiene de Amirdrassil en dificultad mítica y calabozos de piedra angular mítica de +16 y superior durante la temporada 3 de Dragonflight.',54673),
(2778,'esMX','Bronce','Los aliados infinitos de Eternus comercian con hilos de tiempo sueltos comprimidos en monedas de bronce.',54673),
(2807,'esMX','Emblema del despertar de draco','Se obtiene de algunas actividades en exteriores, bandas en dificultad normal y calabozos míticos 0 durante la temporada 4 de Dragonflight.',54673),
(2809,'esMX','Emblema del despertar de vermis','Se obtiene de bandas en dificultad heroica y calabozos de piedra angular mítica hasta +5 durante la temporada 4 de Dragonflight.',54673),
(2812,'esMX','Emblema del despertar de Aspecto','Se obtiene de bandas en dificultad mítica y calabozos de piedra angular mítica a partir de +6 durante la temporada 4 de Dragonflight.',54673),
(2706,'frFR','Écu onirique de Dragonnet','Obtenu grâce à de nombreuses activités en extérieur, en mode outil Raids Amirdrassil et aux donjons clé mythique jusqu’à +5 au cours de la saison 3 de Dragonflight.',54673),
(2707,'frFR','Écu onirique de drake','Obtenu grâce à quelques activités en extérieur, en mode normal du raid Amirdrassil et aux donjons clé mythique de +6 à +10 au cours de la saison 3 de Dragonflight.',54673),
(2708,'frFR','Écu onirique de wyrm','Obtenu dans le mode héroïque du raid Amirdrassil et aux donjons clé mythique de +11 à +15 au cours de la saison 3 de Dragonflight.',54673),
(2709,'frFR','Écu onirique d’Aspect','Obtenu dans le mode mythique du raid Amirdrassil et aux donjons clé mythique de +16 et plus au cours de la saison 3 de Dragonflight.',54673),
(2778,'frFR','Bronze','Les alliés d’Éternia font commerce en utilisant des fils temporels détachés comprimés en pièces de bronze.',54673),
(2807,'frFR','Écu éveillé de drake','Obtenu grâce à quelques activités en extérieur, dans les raids en mode normal et dans les donjons mythiques 0 au cours de la saison 4 de Dragonflight.',54673),
(2809,'frFR','Écu éveillé de wyrm','Obtenu dans les raids en mode héroïque et dans les donjons de clé mythique jusqu’à +5 au cours de la saison 4 de Dragonflight.',54673),
(2812,'frFR','Écu éveillé d’Aspect','Obtenu dans les raids en mode mythique et dans les donjons de clé mythique de +6 et plus au cours de la saison 4 de Dragonflight.',54673),
(2706,'itIT','Emblema Onirico del Draghetto','Ottenuto da molte attività esterne, da Amirdrassil in modalità Ricerca delle Incursioni e dalle spedizioni Mitiche+ fino a +5 durante la Stagione 3 di Dragonflight.',54673),
(2707,'itIT','Emblema Onirico del Draco','Ottenuto da alcune attività esterne, da Amirdrassil in modalità Normale e dalle spedizioni Mitiche+ da +6 a +10 durante la Stagione 3 di Dragonflight.',54673),
(2708,'itIT','Emblema Onirico del Dragone','Ottenuto da Amirdrassil in modalità Eroica e dalle spedizioni Mitiche+ da +11 a +15 durante la Stagione 3 di Dragonflight.',54673),
(2709,'itIT','Emblema Onirico dell\'Aspetto','Ottenuto da Amirdrassil in modalità Mitica e dalle spedizioni Mitiche+ da +16 in poi durante la Stagione 3 di Dragonflight.',54673),
(2778,'itIT','Bronzo','Gli alleati dell\'Infinito di Eternus commerciano tramite filamenti del tempo compressi in monete di bronzo.',54673),
(2807,'itIT','Emblema Risvegliato del Draco','Ottenuto da alcune attività esterne, dalle incursioni in modalità Normale e dalle spedizioni Mitiche 0 durante la Stagione 4 di Dragonflight.',54673),
(2809,'itIT','Emblema Risvegliato del Dragone','Ottenuto dalle incursioni in modalità Eroica e dalle spedizioni Mitiche+ fino a +5 durante la Stagione 4 di Dragonflight.',54673),
(2812,'itIT','Emblema Risvegliato dell\'Aspetto','Ottenuto dalle incursioni in modalità Mitica e dalle spedizioni Mitiche+ da +6 in poi durante la Stagione 4 di Dragonflight.',54673),
(2706,'koKR','새끼용의 꿈꾸는 문장','각종 야외 활동, 공격대 찾기 아미드랏실, 용군단 3 시즌 최대 5 레벨 신화 쐐기돌 던전 완료를 통해 획득할 수 있습니다.',54673),
(2707,'koKR','비룡의 꿈꾸는 문장','야외 활동, 일반 난이도 아미드랏실, 용군단 3 시즌 6~10 레벨 신화 쐐기돌 던전 완료를 통해 획득할 수 있습니다.',54673),
(2708,'koKR','고룡의 꿈꾸는 문장','영웅 난이도 아미드랏실과 용군단 3 시즌 11~15 레벨 신화 쐐기돌 던전 완료를 통해 획득할 수 있습니다.',54673),
(2709,'koKR','위상의 꿈꾸는 문장','신화 난이도 아미드랏실과 용군단 3 시즌 16 레벨 이상 신화 쐐기돌 던전 완료를 통해 획득할 수 있습니다.',54673),
(2778,'koKR','청동','이터누스와 뜻을 함께하는 무한의 용군단 동료들은 시간의 실타래를 응축해 청동 동전을 만들어 거래에 사용하곤 합니다.',54673),
(2807,'koKR','비룡의 각성 문장','야외 활동, 일반 난이도 공격대, 용군단 4 시즌 0 레벨 신화 던전 완료를 통해 획득할 수 있습니다.',54673),
(2809,'koKR','고룡의 각성 문장','영웅 난이도 공격대와 용군단 4 시즌 최대 5 레벨 신화 쐐기돌 던전 완료를 통해 획득할 수 있습니다.',54673),
(2812,'koKR','위상의 각성 문장','신화 난이도 공격대와 용군단 4 시즌 +6 레벨 이상 신화 쐐기돌 던전 완료를 통해 획득할 수 있습니다.',54673),
(2706,'ptBR','Brasão Onírico do Dragonetinho','Obtido por meio de diversas atividades ao ar livre, do Localizador de Raides de Amirdrassil e de masmorras de Pedra-chave Mítica até +5 durante a Série 3 de Dragonflight.',54673),
(2707,'ptBR','Brasão Onírico de Draco','Obtido por meio de algumas atividades ao ar livre, do modo Normal de Amirdrassil e de masmorras de Pedra-chave Mítica, de +6 a +10 durante a Série 3 de Dragonflight.',54673),
(2708,'ptBR','Brasão Onírico da Serpe','Obtido por meio do modo Heroico de Amirdrassil e de masmorras de Pedra-chave Mítica, de +11 a +15 durante a Série 3 de Dragonflight.',54673),
(2709,'ptBR','Brasão Onírico do Aspecto','Obtido por meio do modo Mítico de Amirdrassil e de masmorras de Pedra-chave Mítica, a partir de +16 durante a Série 3 de Dragonflight.',54673),
(2778,'ptBR','Bronze','Os aliados infinitos de Eternus negociam usando fios do tempo soltos, comprimidos em moedas de bronze.',54673),
(2807,'ptBR','Brasão Desperto de Draco','Obtido por meio de algumas atividades ao ar livre, raides no modo Normal e masmorras Míticas 0 durante a Série 4 de Dragonflight.',54673),
(2809,'ptBR','Brasão Desperto da Serpe','Obtido por meio de raides no modo Heroico e masmorras de Pedra-chave Mítica até +5 durante a Série 4 de Dragonflight.',54673),
(2812,'ptBR','Brasão Desperto do Aspecto','Obtido por meio de raides no modo Mítico e de masmorras de Pedra-chave Mítica, a partir de +6 durante a Série 4 de Dragonflight.',54673),
(2706,'ruRU','Гребень дракончика из Сна','Можно получить за выполнение разных задач в открытом мире, а также прохождение Амирдрассила в режиме поиска рейда и подземелий с эпохальным ключом 5-го или менее высокого уровня во время 3-го сезона Dragonflight.',54673),
(2707,'ruRU','Гребень дракона из Сна','Можно получить за выполнение некоторых задач в открытом мире, а также прохождение Амирдрассила в обычном режиме и подземелий с эпохальным ключом от 6-го до 10-го уровня во время 3-го сезона Dragonflight.',54673),
(2708,'ruRU','Гребень змея из Сна','Можно получить за прохождение Амирдрассила в героическом режиме и подземелий с эпохальным ключом от 11-го до 15-го уровня во время 3-го сезона Dragonflight.',54673),
(2709,'ruRU','Гребень Аспекта из Сна','Можно получить за прохождение Амирдрассила в эпохальном режиме и подземелий с эпохальным ключом 16-го или более высокого уровня во время 3-го сезона Dragonflight.',54673),
(2778,'ruRU','Бронза','Союзники Вечнос из рода Бесконечности обменивают товары на нити времени, спрессованные в бронзовые монеты.',54673),
(2807,'ruRU','Пробужденный гребень дракона','Можно получить за выполнение некоторых задач в открытом мире, а также прохождение рейдов в обычном режиме и подземелий в эпохальном режиме без ключа во время 4-го сезона Dragonflight.',54673),
(2809,'ruRU','Пробужденный гребень змея','Можно получить за прохождение рейдов в героическом режиме и подземелий с эпохальным ключом до 5-го уровня во время 4-го сезона Dragonflight.',54673),
(2812,'ruRU','Пробужденный гребень Аспекта','Можно получить за прохождение рейдов в эпохальном режиме и подземелий с эпохальным ключом 6-го или более высокого уровня во время 4-го сезона Dragonflight.',54673),
(2706,'zhCN','雏龙的酣梦纹章','从巨龙时代第3赛季的许多户外活动、随机难度的阿梅达希尔以及不高于5级的史诗钥石地下城获得。',54673),
(2707,'zhCN','幼龙的酣梦纹章','从巨龙时代第3赛季的某些户外活动、普通难度的阿梅达希尔以及6到10级的史诗钥石地下城获得。',54673),
(2708,'zhCN','魔龙的酣梦纹章','从巨龙时代第3赛季的英雄难度的阿梅达希尔以及11到15级的史诗钥石地下城获得。',54673),
(2709,'zhCN','守护巨龙的酣梦纹章','从巨龙时代第3赛季的史诗难度的阿梅达希尔以及不低于16级的史诗钥石地下城获得。',54673),
(2778,'zhCN','青铜','伊特努丝的永恒龙盟友用松散的时间帛线压缩成青铜铸币进行交易。',54673),
(2807,'zhCN','幼龙的觉醒纹章','从巨龙时代第4赛季的某些户外活动、普通难度的团队副本以及+0级的史诗地下城获得。',54673),
(2809,'zhCN','魔龙的觉醒纹章','从巨龙时代第4赛季的英雄难度的团队副本以及不超过+5级的史诗钥石地下城获得。',54673),
(2812,'zhCN','守护巨龙的觉醒纹章','从巨龙时代第4赛季的史诗难度的团队副本以及不低于+6级的史诗钥石地下城获得。',54673),
(2706,'zhTW','幼龍夢境紋章','在巨龍崛起第3季中，透過許多戶外活動、隨機團隊副本埃達希爾和難度+5以下的傳奇鑰石地城獲得。',54673),
(2707,'zhTW','飛龍夢境紋章','在巨龍崛起第3季中，透過一些戶外活動、普通難度埃達希爾和難度+6至+10的傳奇鑰石地城獲得。',54673),
(2708,'zhTW','巨龍夢境紋章','在巨龍崛起第3季中，透過英雄難度埃達希爾和難度+11至+15的傳奇鑰石地城獲得。',54673),
(2709,'zhTW','守護巨龍夢境紋章','在巨龍崛起第3季中，透過傳奇難度埃達希爾和難度+16以上的傳奇鑰石地城獲得。',54673),
(2778,'zhTW','青銅幣','伊特努斯的恆龍盟友將鬆散的時間之絲壓縮成青銅幣，作為交易貨幣。',54673),
(2807,'zhTW','飛龍覺醒紋章','在巨龍崛起第4季中，透過一些戶外活動、普通難度團隊副本和難度0的傳奇地城獲得。',54673),
(2809,'zhTW','巨龍覺醒紋章','在巨龍崛起第4季中，透過英雄難度團隊副本和難度+5以下的傳奇鑰石地城獲得。',54673),
(2812,'zhTW','守護巨龍覺醒紋章','在巨龍崛起第4季中，透過傳奇難度團隊副本和難度+6以上的傳奇鑰石地城獲得。',54673);
