INSERT INTO `journal_encounter` VALUES
('Moorabi','The Drakkari sought to sacrifice Mam\'toth for his powers, but instead the loa destroyed himself. Despite this act, Moorabi would not be denied his god-like powers. The high prophet drank of the loa\'s blood and will now stop at nothing to keep Zul\'Drak firmly in troll hands.',0.393442,0.489754,594,274,1980,3,6980,154,0,0,-1,54673),
('Gal\'darah','The Drakkari turned to their loa as the Scourge invaded the nation of Zul\'Drak. The frost trolls did not come to the loa with implorations; they came with blades. As blood flowed from their murdered god, Akali, the high prophet Gal\'darah and his betrayers claimed the loa\'s strength as their own.',0.465847,0.270492,596,274,1981,5,6989,154,0,0,-1,54673),
('Tred\'ova','The gorm have been chewing at the edges of Ardenweald, devouring desiccated husks of the dead. The beast called Tred\'ova has gorged herself on something far more precious, the wildseed of Lakali, loa of knowledge. Now that Tred\'ova has tasted the loa\'s power and wisdom, she hungers for more than survival.',0.154066,0.745705,2405,1184,2393,3,21746,1669,0,0,-1,54673);
INSERT INTO `journal_encounter_locale` VALUES
(594,'deDE','Moorabi','Die Drakkari wollten Mam\'toth wegen seiner Kräfte opfern, doch vernichtete der Loa sich stattdessen selbst. Trotzdem entgingen Moorabi seine gottgleichen Kräfte nicht. Der Hochprophet trank vom Blut des Loas und nichts wird ihn mehr davon abhalten, dafür zu sorgen, dass Zul\'Drak fest in Trollhänden verbleibt.',54673),
(596,'deDE','Gal\'darah','Als die Geißel in die Nation von Zul\'Drak einfiel, wandten sich die Drakkari an ihre Loa. Die Frosttrolle kamen nicht mit Flehen zu ihnen, sie kamen mit Klingen. Als das Blut aus ihrem ermordeten Gott Akali strömte, beanspruchten der Hochprophet Gal\'darah und seine Verräter die Stärke des Loas für sich selbst.',54673),
(2405,'deDE','Tred\'ova','In den Randbereichen des Ardenwalds zerfressen die Gorm die verdorrten Hüllen der Toten. Doch eine Bestie namens Tred\'ova labt sich an etwas viel Wertvollerem, dem Wildsamen von Lakali, dem Loa des Wissens. Nun, wo Tred\'ova die Macht und das Wissen des Loas gekostet hat, begehrt sie mehr als reines Überleben.',54673),
(594,'esES','Moorabi','Los Drakkari pretendían sacrificar a Mam\'toth para conseguir sus poderes, pero el loa se sacrificó a sí mismo. A pesar de ello, Moorabi no renunció a sus poderes cuasidivinos. El sumo profeta bebió la sangre del loa y ahora está decidido a preservar el dominio trol de Zul\'Drak.',54673),
(596,'esES','Gal\'darah','Los Drakkari acudieron a sus loa cuando la Plaga invadió la nación de Zul\'Drak. Los trols de escarcha no ofrecieron plegarias: ofrecieron espadas. Tras derramar la sangre de su dios asesinado, Akali, el sumo profeta Gal\'darah y sus traidores se adueñaron de la fuerza del loa.',54673),
(2405,'esES','Tred\'ova','Los gorms han estado causando estragos en Ardenweald, devorando los cuerpos vacíos de los muertos. La bestia que recibe el nombre de Tred\'ova se ha atiborrado con algo mucho más valioso: la semilla silvestre de Lakali, loa del conocimiento. Ahora que Tred\'ova ha saboreado el poder y el conocimiento del loa, ya no se contentará con la mera supervivencia.',54673),
(594,'esMX','Moorabi','Los Drakkari pretendían sacrificar a Mam\'toth para conseguir sus poderes, pero el loa se sacrificó a sí mismo. A pesar de ello, Moorabi no renunció a sus poderes cuasidivinos. El sumo profeta bebió la sangre del loa y ahora está decidido a preservar el dominio trol de Zul\'Drak.',54673),
(596,'esMX','Gal\'darah','Los Drakkari acudieron a sus loa cuando la Plaga invadió la nación de Zul\'Drak. Los trols de escarcha no ofrecieron plegarias: ofrecieron espadas. Tras derramar la sangre de su dios asesinado, Akali, el sumo profeta Gal\'darah y sus traidores se adueñaron de la fuerza del loa.',54673),
(2405,'esMX','Tred\'ova','Los gorms han estado masticando en los confines de Ardenweald, devorando cadáveres de difuntos desecados. La bestia llamada Tred\'ova ha devorado algo mucho más valioso: la semilla silvestre de Lakali, loa del conocimiento. Ahora que Tred\'ova probó su poder y sabiduría, ansía algo más que supervivencia.',54673),
(594,'frFR','Moorabi','Lorsque les Drakkari cherchèrent à sacrifier Mam’toth pour obtenir ses pouvoirs, le Loa préféra se détruire lui-même. Mais Moorabi n’allait pas laisser cet acte le priver de ses pouvoirs quasi divins. Le grand prophète a bu le sang du Loa et ne reculera plus devant rien pour garder Zul’Drak sous le contrôle des Trolls.',54673),
(596,'frFR','Gal\'darah','Lorsque le Fléau envahit la nation de Zul’Drak, les Drakkari se tournèrent vers leur loa. Mais ils apportèrent des armes, plutôt que des supplications. Alors que le sang coulait des veines d’Akali, leur dieu assassiné, le grand prophète Gal’darah et les traîtres qui le suivaient s’attribuèrent la puissance du Loa.',54673),
(2405,'frFR','Tred’ova','Alors que les gorms grignotaient les frontières de Sylvarden et les bogues desséchées des trépassés, la créature nommée Tred’ova goûta à un mets des plus extraordinaires : la graine sauvage de Lakali, Loa du savoir. Enivrée par son pouvoir et sa sagesse, Tred’ova ne cherche plus uniquement à survivre…',54673),
(594,'itIT','Moorabi','I Drakkari volevano sacrificare Mam\'toth per i suoi poteri, ma il Loa si distrusse per evitare questo fato. Nonostante ciò, Moorabi non perse l\'occasione per ottenere i poteri di questa divinità. Il Gran Profeta ha bevuto il sangue del Loa e ora è pronto a fare di tutto pur di mantenere Zul\'drak sotto il controllo dei Troll.',54673),
(596,'itIT','Gal\'darah','Quando il Flagello invase Zul\'drak, i Troll dei Ghiacci non si rivolsero ai Loa in preghiera, ma decisero di rivoltarsi contro di loro. Quando il sangue fuoriuscì dal corpo straziato della loro divinità Akali, il Gran Profeta Gal\'darah e gli altri traditori si impossessarono della forza del Loa per i propri scopi.',54673),
(2405,'itIT','Tred\'ova','I gorm sono giunti fino al limitare di Selvarden, divorando i gusci appassiti dei morti... Ma la belva chiamata Tred\'ova si è rimpinzata di qualcosa di molto più prezioso: il Semebrado di Lakali, Loa della conoscenza. Ora che Tred\'ova ha assaporato il potere e la saggezza del Loa, brama più della semplice sopravvivenza.',54673),
(594,'koKR','무라비','드라카리는 맘토스를 희생하여 그 힘을 손에 넣으려 했지만, 로아는 스스로를 파괴해 버리고 말았습니다. 하지만 그 행위도 로아의 힘을 갈망했던 무라비를 막지는 못했습니다. 이 고위 사제는 로아의 피를 마시고 그 힘을 흡수했고, 이제 수단과 방법을 가리지 않고 트롤의 땅인 줄드락을 지켜낼 것입니다.',54673),
(596,'koKR','갈다라','스컬지가 줄드락을 침공했을 때, 드라카리는 로아의 힘을 구했습니다. 하지만 로아에게 애원한 것은 아니었습니다. 그들은 칼을 들이댔습니다. 살해당한 신의 피가 흐르고, 갈다라의 고위 사제 아칼리와 배신자들은 로아의 힘을 직접 차지했습니다.',54673),
(2405,'koKR','트레도바','게걸충은 절박하리만치 령을 찾아 헤매며 몽환숲의 변방을 갉아먹습니다. 그러나 트레도바라 불리는 야수는 다른 무언가를 찾아냈습니다. 바로 티르너 사이드의 고치에 들어있던 지식의 로아, 라칼리였습니다. 로아의 힘과 지식을 맛본 지금, 트레도바는 생존 그 이상을 추구합니다.',54673),
(594,'ptBR','Murabi','Os Drakkari tentaram sacrificar Mam\'toth por seus poderes, mas o loa acabou se destruindo sozinho. Apesar disso, Murabi não abriria mão de seus poderes divinos. O sumo profeta bebeu o sangue do loa e agora nada irá impedi-lo de manter Zul\'Drak firmemente em mãos trólicas.',54673),
(596,'ptBR','Gal\'darah','Quando o Flagelo invadiu a nação de Zul\'Drak, os Drakkari recorreram aos seus loa. Os trolls do gelo não imploraram aos loa; eles usaram armas. Quando o sangue correu de Akali, o deus assassinado, o sumo profeta Gal\'darah e seus traidores reclamaram a força dos loa para si.',54673),
(2405,'ptBR','Tred\'ova','Os gorms vêm comendo Ardena pelas beiradas, devorando a carcaça seca dos mortos. A fera chamada Tred\'ova encontrou algo precioso para fazer de banquete: a semente selvagem de Lakali, loa do conhecimento. Agora que Tred\'ova sentiu o gosto do poder e conhecimento do loa, ela anseia por algo além da sobrevivência.',54673),
(594,'ruRU','Мураби','Драккари хотели принести в жертву Мам\'тота, чтобы получить его силу, но лоа уничтожил себя сам. Несмотря на это, Мураби, несомненно, обладает силой богов; верховный пророк выпил крови лоа, и теперь он готов пойти на все, чтобы Зул\'Драк оставался в руках троллей.',54673),
(596,'ruRU','Гал\'дара','Драккари обратились к лоа, когда силы Плети напали на Зул\'Драк. Ледяные тролли пришли к ним не с мольбами, а с мечами. Когда кровь убитого бога, Акали, обагрила землю, верховный пророк Гал\'дара и его сподвижники-предатели впитали силу лоа.',54673),
(2405,'ruRU','Тред\'ова','Гормы гложут окраины Арденвельда, пожирая иссушенные останки мертвых существ, но тварь по имени Тред\'ова обнаружила нечто куда более ценное: дикое семя Лакали, лоа знаний. Попробовав на вкус силу и мудрость лоа, Тред\'ова возжелала большего, чем просто выживание.',54673),
(594,'zhCN','莫拉比','达卡莱巨魔想要牺牲犸托斯来获得力量，结果这位神灵却选择了自我毁灭。尽管如此，人们却不能否定莫拉比身上堪比神灵的力量。这位高阶先知饮下了神灵的鲜血，现在会不惜一切代价确保祖达克牢牢掌握在巨魔手中。',54673),
(596,'zhCN','迦尔达拉','当天灾军团侵入祖达克时，达卡莱巨魔只得求助自己的神灵。冰巨魔并没有选择对神灵俯首乞怜，而是拿起了利刃。眼看遇害的神灵阿卡里血流成河，高阶先知迦尔达拉和他那些背弃信仰的追随者们将神灵的力量据为己有。',54673),
(2405,'zhCN','特雷德奥瓦','戈姆们一直在炽蓝仙野的边缘地带咀嚼着、吞噬着逝去者的干瘪躯壳。但这只名为特雷德奥瓦的野兽却吞下了其他更为宝贵的东西——雷卡利，学识神灵的灵种。特雷德奥瓦已经品尝到了神灵力量与学识的滋味，所以她现在渴望着更多的知识，而不光只是生存。',54673),
(594,'zhTW','慕拉比','德拉克瑞試圖犧牲瑪姆托司以取得他的力量，但這個羅亞卻自滅了。然而，慕拉比仍不願對擁有神祇般的力量死心。這名高階預言者飲下了羅亞的血液，為了讓食人妖保有祖爾德拉克，他將不惜一切代價。',54673),
(596,'zhTW','蓋爾達拉','天譴軍團入侵祖爾德拉克時，德拉克瑞找上了羅亞。這些寒冰食人妖並不是向羅亞求助，而是以武力相逼。當鮮血從阿卡利被弒的神體流湧而出，高階預言者蓋爾達拉和他的同謀將羅亞的力量收歸己有。',54673),
(2405,'zhTW','崔朵瓦','果姆一直在亞登曠野四下覓食，吞噬著死者乾枯的軀殼。其中一隻名為崔朵瓦的巨蟲吞下了一樣非常珍貴的東西，也就是知識的羅亞「拉克利」的野性種子。在崔朵瓦品嚐過了羅亞的力量和智慧之後，她所渴求的再也不僅止於生存。',54673);
