(2370,'The Primal Bulwark','The Primal Council bolsters their defenses within the mountain. Their ranks must be broken to stop the Incarnates\' release.',1,2,-1,4746643,4880698,4880622,9,2522,17,359,0,1,124009,0,0,2502,2,5,18,1,4,13,0,0,0,2161,16411,16384,54673),
(2371,'Caverns of Infusion','Kurog Grimtotem prepares to unleash monstrous elementals to bring about the destruction of any who oppose him.',1,2,-1,4746643,4880697,4880622,9,2522,17,359,0,2,124019,0,0,2491,2,5,18,1,4,13,0,0,0,2161,16411,16384,54673),
(2372,'Fury of the Storm','Raszageth\'s fury threatens to destroy her siblings\' prison. If she succeeds, the Incarnates will wreak havoc across Azeroth.',1,2,-1,4746643,4880696,4880622,9,2522,17,359,0,3,124021,0,0,2499,2,5,18,1,4,13,0,0,0,2161,16411,16384,54673),
(2399,'Discarded Works','Neglected for millenia, Neltharion\'s creations have twisted into something monstrous.',1,2,-1,5149415,5150065,5149425,9,2569,17,386,0,4,124012,0,0,2530,2,5,18,1,4,13,0,0,0,2648,16411,16384,54673),
(2400,'Fury of Giants','The Zaqali warband has launched a devastating assault on the crucible in order to destroy anything in their path.',1,2,-1,5149415,5150066,5149425,9,2569,17,386,0,5,124023,0,0,2532,2,5,18,1,4,13,0,0,0,2648,16411,16384,54673),
(2401,'Neltharion\'s Shadow','Something stirs in the dark... it once corrupted the Earth-Warder, and now it is eager to claim new victims.',1,2,-1,5149415,5150067,5149425,9,2569,17,386,0,6,124026,0,0,2532,2,5,18,1,4,13,0,0,0,2648,16411,16384,54673),
(2402,'Edge of the Void','Sarkareth stands at the edge of the abyss, seeking to harness Neltharion\'s power and claim the former Earth-Warder\'s legacy.',1,2,-1,5149415,5150068,5149425,9,2569,17,386,0,7,124029,0,0,2520,2,5,18,1,4,13,0,0,0,2648,16411,16384,54673),
(2466,'Incarnate\'s Wake','Smolderon has forced his way into the Emerald Dream. If left unchecked, his forces will burn everything in their path.',1,2,-1,5409263,5409264,5409265,9,2549,17,424,0,8,124032,0,0,2563,2,5,18,1,4,13,0,0,0,2608,16411,16384,54673),
(2467,'The Viridian Weave','Nymue weaves the mesmerizing patterns of the Emerald Dream. Our intrusion has distrupted the weave, and we will be dealt with.',1,2,-1,5409263,5409267,5409265,9,2549,17,424,0,10,124042,0,0,2556,2,5,18,1,4,13,0,0,0,2608,16411,16384,54673),
(2468,'Molten Incursion','Larodar, twisted by flame, seeks to bathe the Emerald Dream in fire. If successful, everything will be reduced to ash.',1,2,-1,5409263,5409268,5409265,9,2549,17,424,0,9,124038,0,0,2553,2,5,18,1,4,13,0,0,0,2608,16411,16384,54673),
(2469,'Fate of Amirdrassil','Fyrakk has reached the heart of Amirdrassil and threatens to consume its power for his own.',1,2,-1,5409263,5409269,5409265,9,2549,17,424,0,11,124044,0,0,2519,2,5,18,1,4,13,0,0,0,2608,16411,16384,54673),
(2703,'The Primal Bulwark','The Primal Council bolsters their defenses within the mountain. Their ranks must be broken to stop the Incarnates\' release.',1,2,-1,4746643,4880698,4880622,9,2522,17,463,0,1,124010,0,0,2502,2,5,18,1,4,13,0,0,0,2161,16411,16384,54673),
(2704,'Discarded Works','Neglected for millenia, Neltharion\'s creations have twisted into something monstrous.',1,2,-1,5149415,5150065,5149425,9,2569,17,463,0,4,124011,0,0,2530,2,5,18,1,4,13,0,0,0,2648,16411,16384,54673),
(2705,'Caverns of Infusion','Kurog Grimtotem prepares to unleash monstrous elementals to bring about the destruction of any who oppose him.',1,2,-1,4746643,4880697,4880622,9,2522,17,463,0,2,124020,0,0,2491,2,5,18,1,4,13,0,0,0,2161,16411,16384,54673),
(2706,'Fury of the Storm','Raszageth\'s fury threatens to destroy her siblings\' prison. If she succeeds, the Incarnates will wreak havoc across Azeroth.',1,2,-1,4746643,4880696,4880622,9,2522,17,463,0,3,124022,0,0,2499,2,5,18,1,4,13,0,0,0,2161,16411,16384,54673),
(2707,'Fury of Giants','The Zaqali warband has launched a devastating assault on the crucible in order to destroy anything in their path.',1,2,-1,5149415,5150066,5149425,9,2569,17,463,0,5,124025,0,0,2532,2,5,18,1,4,13,0,0,0,2648,16411,16384,54673),
(2708,'Neltharion\'s Shadow','Something stirs in the dark... it once corrupted the Earth-Warder, and now it is eager to claim new victims.',1,2,-1,5149415,5150067,5149425,9,2569,17,463,0,6,124027,0,0,2532,2,5,18,1,4,13,0,0,0,2648,16411,16384,54673),
