(2710,'Incarnate\'s Wake','Smolderon has forced his way into the Emerald Dream. If left unchecked, his forces will burn everything in their path.',1,2,-1,5409263,5409264,5409265,9,2549,17,463,0,8,124031,0,0,2563,2,5,18,1,4,13,0,0,0,2608,16411,16384,54673),
(2711,'Molten Incursion','Larodar, twisted by flame, seeks to bathe the Emerald Dream in fire. If successful, everything will be reduced to ash.',1,2,-1,5409263,5409268,5409265,9,2549,17,463,0,9,124033,0,0,2553,2,5,18,1,4,13,0,0,0,2608,16411,16384,54673),
(2712,'The Viridian Weave','Nymue weaves the mesmerizing patterns of the Emerald Dream. Our intrusion has distrupted the weave, and we will be dealt with.',1,2,-1,5409263,5409267,5409265,9,2549,17,463,0,10,124041,0,0,2556,2,5,18,1,4,13,0,0,0,2608,16411,16384,54673),
