(2370,'deDE','Das Primalistenbollwerk','Der Primalistenrat verstärkt seine Verteidigung im Inneren des Berges. Seine Reihen müssen durchbrochen werden, um die Befreiung der Inkarnationen zu verhindern.',54673),
(2371,'deDE','Höhlen der Infusion','Kurog Grimmtotem bereitet die Entfesselung monströser Elementare vor, um die Vernichtung aller herbeizuführen, die sich ihm widersetzen.',54673),
(2372,'deDE','Zorn des Sturms','Raszageth ist erzürnt und droht, das Gefängnis ihrer Geschwister zu zerstören. Sollte ihr das gelingen, werden die Inkarnationen ganz Azeroth verwüsten.',54673),
(2399,'deDE','Verworfene Arbeiten','Jahrtausende der Vernachlässigung haben Neltharions Schöpfungen in etwas Monströses verwandelt.',54673),
