(2401,'deDE','Neltharions Schatten','Etwas regt sich in der Dunkelheit... Es hat einst den Erdwächter korrumpiert und dürstet jetzt nach neuen Opfern.',54673),
(2402,'deDE','Grenze der Leere','Sarkareth steht am Rand des Abgrunds und versucht, sich Neltharions Macht zunutze zu machen und das Vermächtnis des ehemaligen Erdwächters an sich zu reißen.',54673),
(2466,'deDE','Schneise der Inkarnation','Glimmeron hat sich einen Weg in den Smaragdgrünen Traum gebahnt. Wenn er nicht aufgehalten wird, werden seine Streitkräfte alles niederbrennen, was ihnen im Weg steht.',54673),
(2467,'deDE','Das Viridiangewebe','Nymue webt die hypnotischen Muster des Smaragdgrünen Traums. Unser Eindringen hat das Geflecht gestört, und das wird Konsequenzen haben.',54673),
(2468,'deDE','Geschmolzene Invasion','Larodar, verderbt durch die Flamme, will den Traum mit Feuer überziehen. Wenn er Erfolg hat, wird alles zu Asche verbrennen.',54673),
(2469,'deDE','Schicksal von Amirdrassil','Fyrakk hat das Herz von Amirdrassil erreicht und droht, sich seine Macht anzueignen.',54673),
