(2709,'itIT','Orlo del Vuoto','Sarkareth è sull\'orlo dell\'abisso, bramoso di imbrigliare il potere di Neltharion e rivendicare ciò che resta del retaggio del Custode della Terra.',54673),
(2710,'itIT','Scia dell\'Incarnazione','Ardiron si è fatto strada nel Sogno di Smeraldo. Se lasciate agire, le sue forze bruceranno qualunque cosa sulla loro strada.',54673),
(2711,'itIT','Scorreria Fusa','Larodar, corrotto dalla fiamma, brama di avvolgere il Sogno di Smeraldo nel fuoco. Se avrà successo, tutto sarà ridotto in cenere.',54673),
(2712,'itIT','Trama Verdastra','Nymue tesse gli schemi ipnotici del Sogno di Smeraldo. La nostra intrusione ha distorto la sua tessitura e dovremo occuparcene.',54673),
(2713,'itIT','Destino di Amirdrassil','Fyrakk ha raggiunto il Cuore di Amirdrassil e minaccia di impadronirsi del suo potere.',54673),
