(2711,'zhCN','熔火侵攻','拉罗达尔已经被烈焰扭曲，他企图让翡翠梦境化为火海。如果他得以成功，一切都将灰飞烟灭。',54673),
(2712,'zhCN','茏葱织纹','尼穆威纺织着翡翠梦境的迷人图案。我们的入侵扰乱了这个进程，所以被视作威胁。',54673),
(2713,'zhCN','阿梅达希尔的命运','菲莱克已经到达了阿梅达希尔之心的位置，企图夺取它的力量。',54673),
(1670,'zhTW','隨機地城(決戰艾澤拉斯)','',54673),
(1671,'zhTW','隨機英雄地城(決戰艾澤拉斯)','',54673),
(2350,'zhTW','隨機地城(巨龍崛起)','',54673),
(2351,'zhTW','隨機英雄(巨龍崛起)','',54673),
(2370,'zhTW','洪荒壁壘','洪荒議會在山中強化了他們的防禦。為了阻止洪荒化身重獲自由，必須擊潰他們的部隊。',54673),
(2371,'zhTW','灌注洞穴','庫洛格‧恐怖圖騰準備要釋放兇惡的元素生物，摧毀那些膽敢抵抗他的人。',54673),
(2372,'zhTW','風暴之怒','菈薩葛絲的怒火會摧毀她手足的監獄。如果她成功的話，洪荒化身將會為艾澤拉斯帶來浩劫。',54673),
(2399,'zhTW','廢棄作品區','奈薩里奧的創造物已棄置數千年，扭曲成可怕的物品。',54673),
(2400,'zhTW','巨人的狂怒','薩克利軍隊對實驗場發動毀滅性的攻擊，摧毀阻擋他們的一切事物。',54673),
(2401,'zhTW','奈薩里奧的幻影','黑暗中有什麼正蠢蠢欲動…那股力量曾經腐蝕大地守護者，如今正渴望抓到新的受害者。',54673),
(2402,'zhTW','虛無邊際','沙卡瑞斯站在深淵的邊緣，渴望取得奈薩里奧力量，以及大地守護者所留下的一切。',54673),
(2466,'zhTW','洪荒化身甦醒','斯莫德隆強行進入翡翠夢境。如果袖手旁觀，他的部隊將會燒光沿途上的一切事物。',54673),
(2467,'zhTW','翠綠之織','奈木在編織翡翠夢境的迷人圖案。結果被我們的入侵打斷，我們必須處理這件事。',54673),
(2468,'zhTW','熔火入侵','拉羅達被烈焰扭曲，企圖讓翡翠夢境陷入火海。一旦被他得逞，一切事物都會化成灰燼。',54673),
(2469,'zhTW','埃達希爾的命運','菲拉卡已經抵達埃達希爾之心，威脅要吞噬掉這股力量納為己用。',54673),
(2703,'zhTW','洪荒壁壘','洪荒議會在山中強化了他們的防禦。為了阻止洪荒化身重獲自由，必須擊潰他們的部隊。',54673),
