INSERT INTO `mail_template` VALUES
(625,'We recovered a lost item in the twisting nether and noted that it was yours.$B$BPlease find said object enclosed.',54673);
INSERT INTO `mail_template_locale` VALUES
(625,'deDE','Wir konnten einen Gegenstand aus dem Wirbelnden Nether bergen und haben bemerkt, dass er Euch gehört.$B$BDas Objekt befindet sich im Anhang.',54673),
(625,'esES','Recuperamos un objeto perdido en El Vacío Abisal y nos dimos cuenta de que era tuyo.$B$BTe lo adjuntamos.',54673),
(625,'esMX','Recuperamos un objeto perdido en El Vacío Abisal y nos dimos cuenta de que era tuyo.$b$bAquí tienes dicho objeto.',54673),
(625,'frFR','Nous avons trouvé un objet perdu en fouillant le Néant distordu, et nous avons constaté qu’il vous appartenait.$B$BVous le trouverez attaché au présent courrier.',54673),
(625,'itIT','Abbiamo ritrovato un oggetto smarrito nella Distorsione Fatua. Pare sia tuo.$BÈ allegato alla lettera.',54673),
(625,'koKR','뒤틀린 황천에서 분실된 아이템을 하나 찾았는데, 당신 것이더군요.$B$B아이템을 동봉하니 찾아가세요.',54673),
(625,'ptBR','Nós recuperamos um item perdido na Espiral Etérea, e vimos que ele é seu.$B$BO item segue em anexo.',54673),
(625,'ruRU','Мы нашли это в Круговерти Пустоты. Кажется, вещичка ваша.$B$BПрилагаем к письму посылку.',54673),
(625,'zhCN','我们在扭曲虚空中找到了一件物品，应该是你丢掉的吧？$B$B随信附上，请查收。',54673),
(625,'zhTW','我們在搜索扭曲虛空的時候發現了一個標示是屬於你的失落的物品。$B$B請打開包裹吧。',54673);
