('Savage Green Battle Turtle','|cFFFFD200Trading Post|r','Turtle too slow to chase down your foes? Just add cannons. Nothing can outrun a cannon.',1582,231,240,11,367826,0,0,4,0,0,54673),
('Felcrystal Scorpion','|cFFFFD200Trading Post|r','The results of a fel infusion experiment with one of Skorpyron\'s offspring.',1742,230,64,11,411565,0,0,4,0,0,54673),
('Ancestral Clefthoof','|cFFFFD200Trading Post|r|n','This clefthoof has seen ages pass, witnessing everything and patiently teaching many to ride.',1785,230,64,11,417245,0,0,44,0,0,54673),
('Crimson Glimmerfur','|cFFFFD200Trading Post|r','Gilnean legend states this red-and-white fox only crosses the Winter Veil during one season.',1841,230,64,11,427435,0,0,4,0,0,54673),
('Savage Blue Battle Turtle','|cFFFFD200Trading Post|r','Don\'t feel blue chasing your foes, you\'ve got cannons. Nothing can outrun a cannon.',2039,231,240,11,433281,0,0,4,0,0,54673),
('Snowy Riding Goat','|cFFFFD200World Event:|r WoW Remix: Mists of Pandaria','The Kun-Lai Summit mountain goats are known for climbing even the highest peaks in search of kafa beans and salt licks.',2078,230,1152,2,435131,0,0,44,0,0,54673),
('Little Red Riding Goat','|cFFFFD200World Event:|r Mists of Pandaria: Remix','What this goat lacks in size, it makes up for in stubbornness.',2080,230,1152,2,435133,0,0,44,0,0,54673),
('[PH] Goblin Surfboard - Blue','Trading Post','',2145,247,1088,11,446352,0,0,4,0,0,54673),
('Sentinel War Wolf','Trading Post','Captured in a Sentinel raid, the loyalty of the wolf favors the strongest.',2201,230,1088,11,449140,0,0,4,0,0,54673);
INSERT INTO `mount_locale` VALUES
(1468,'deDE','Bernsteingelbe Flatterlibelle','|cFFFFD200Handelsposten|r|n','Ein Geschenk von Opa Schnurrbart an den Handelsposten. Bernsteingelbe Flatterlibellen sind erstaunlich zahm.',54673),
(1582,'deDE','Wilde grüne Kampfschildkröte','|cFFFFD200Handelsposten|r','Eure Schildkröte ist zu langsam, um Eure Feinde einzuholen? Fügt Kanonen hinzu. Niemand kann einer Kanonenkugel entkommen.',54673),
(1742,'deDE','Teufelskristallskorpion','|cFFFFD200Handelsposten|r','Das Ergebnis eines Teufelsinfusionsexperiments an einem Nachkommen von Skorpyron.',54673),
(1785,'deDE','Grollhufvorfahr','|cFFFFD200Handelsposten|r|n','Dieser Grollhuf hat miterlebt, wie die Zeitalter verstreichen, und dabei geduldig viele das Reiten gelehrt.',54673),
(1841,'deDE','Blutroter Glimmerpelz','|cFFFFD200Handelsposten|r','Gilnearischen Legenden zufolge durchquert dieser rotweiße Fuchs nur zu einer Jahreszeit den Winterhauch.',54673),
(2039,'deDE','Wilde blaue Kampfschildkröte','|cFFFFD200Handelsposten|r','Quält Euch nicht mit der Verfolgung Eurer Gegner, Ihr habt Kanonen. Niemand kann einer Kanone davonlaufen.',54673),
(2078,'deDE','Verschneite Reitziege','|cFFFFD200Weltereignis:|r WoW Remix: Mists of Pandaria','Die Bergziegen des Kun-Lai-Gipfels sind bekannt dafür, auf der Suche nach Kafabohnen und Salzlecksteinen selbst die höchsten Wipfel zu erklimmen.',54673),
(2080,'deDE','Kleine rote Reitziege','|cFFFFD200Weltereignis:|r Mists of Pandaria: Remix','Was dieser Ziege an Größe fehlt, macht sie mit Sturheit wett.',54673),
(2145,'deDE','[PH] Goblin Surfboard - Blue','Handelsposten','',54673),
(2201,'deDE','Schildwachenkriegswolf','Handelsposten','Der Wolf wurde bei einem Schildwachenschlachtzug gefangen. Seine Loyalität gehört dem Stärksten.',54673),
(1468,'esES','Escurriposa de ámbar','|cFFFFD200Puesto comercial|r|n','Un regalo del abuelete Bigotes para el puesto comercial. Las escurriposas de ámbar son extraordinariamente dóciles.',54673),
(1582,'esES','Tortuga de batalla verde salvaje','|cFFFFD200Puesto Comercial|r','¿Tu tortuga es demasiado lenta a la hora de perseguir a tus enemigos? Añádele unos cañones. De un cañón no hay quien escape.',54673),
(1742,'esES','Escorpión de cristal vil','|cFFFFD200Puesto comercial|r','El resultado de un experimento de infusión vil con una de las crías de Skorpyron.',54673),
(1785,'esES','Uñagrieta ancestral','|cFFFFD200Puesto comercial|r|n','Este uñagrieta ha visto pasar los siglos frente a sus ojos y ha enseñado a innumerables viajeros a montar.',54673),
(1841,'esES','Pieltitilo carmesí','|cFFFFD200Puesto comercial|r','Las leyendas gilneanas dicen que este zorro rojo y blanco solo aparece durante el Festival de Invierno.',54673),
(2039,'esES','Tortuga de batalla azul salvaje','|cFFFFD200Puesto comercial|r','No te frustres persiguiendo a tus enemigos: tienes cañones. Nada escapa de un cañón.',54673),
(2078,'esES','Cabra de montar de las nieves','|cFFFFD200Evento del mundo:|r WoW Remix: Mists of Pandaria','Las cabras montesas de la Cima Kun-Lai son famosas por subir hasta los cumbres más altas en busca de semillas de kafa y piedras de sal.',54673),
(2080,'esES','Cabrita de montar roja','|cFFFFD200Evento del mundo:|r Mists of Pandaria: Remix','Lo que a esta cabra le falta en tamaño, lo compensa con terquedad.',54673),
(2145,'esES','[PH] Goblin Surfboard - Blue','Puesto comercial','',54673),
(2201,'esES','Lobo de guerra de centinela','Puesto comercial','Capturado en un asalto de centinelas, la lealtad del lobo pertenece a los más fuertes.',54673),
(1468,'esMX','Libélula escurridiza ámbar','|cFFFFD200Puesto de venta|r|n','Un regalo del abuelo Bigotes para el puesto de venta. Las libélulas escurridizas ámbar son sorprendentemente dóciles.',54673),
(1582,'esMX','Tortuga de batalla verde salvaje','|cFFFFD200Puesto de venta|r','¿No puedes alcanzar a tus enemigos con la tortuga? Colócale algunos cañones. Nada puede huir del fuego de un cañón.',54673),
(1742,'esMX','Escorpión de cristal vil','|cFFFFD200Puesto de venta|r','Los resultados de un experimento de infusión vil con uno de los descendientes de Skorpyron.',54673),
(1785,'esMX','Uñagrieta ancestral','|cFFFFD200Puesto de venta|r|n','Este uñagrieta ha presenciado el paso del tiempo. Observó todo y, con paciencia, les enseñó a muchos a montar.',54673),
(1841,'esMX','Lumipelaje carmesí','|cFFFFD200Puesto de venta|r','Según la leyenda gilneana, el Festival de Invierno no se celebra sin la mágica presencia de este zorro de color rojo y blanco.',54673),
(2039,'esMX','Tortuga de batalla azul salvaje','|cFFFFD200Puesto de venta|r','No te deprimas cuando persigas a tus enemigos. Tienes cañones. Nada es más rápido que un cañón.',54673),
(2078,'esMX','Cabra de montar nevada','|cFFFFD200Evento de mundo:|r WoW Remix: Mists of Pandaria','Las cabras montesas de la Cima Kun-Lai son famosas por escalar las cumbres más altas en busca de frijoles de kafa y sal para lamer.',54673),
(2080,'esMX','Cabrita de montar roja','|cFFFFD200Evento de mundo:|r Mists of Pandaria: Remix','Lo que a esta cabra la falta en tamaño, le sobra en tenacidad.',54673),
(2145,'esMX','[PH] Goblin Surfboard - Blue','Puesto de venta','',54673),
(2201,'esMX','Lobo de guerra centinela','Puesto de venta','Este lobo, capturado en una incursión de los centinelas, es leal a los fuertes.',54673),
(1468,'frFR','Libellonne ambrée','|cFFFFD200Comptoir|r|n','Ces libellonnes ambrées dociles sont un cadeau de papi Bourbon destiné au comptoir.',54673),
(1582,'frFR','Tortue verte de bataille sauvage','|cFFFFD200Comptoir|r','Votre tortue est trop lente pour rattraper vos adversaires ? Rajoutez-lui quelques canons. Rien n’échappe à un canon.',54673),
(1742,'frFR','Scorpion gangrecristal','|cFFFFD200Comptoir|r','Ce rejeton de Skorpyron a subi une imprégnation expérimentale de gangrène.',54673),
(1785,'frFR','Sabot-fourchu ancestral','|cFFFFD200Comptoir|r|n','Ce sabot-fourchu a vu les âges passer, supportant patiemment le temps pour former de nombreux cavaliers.',54673),
(1841,'frFR','Mantelume écarlate','|cFFFFD200Comptoir|r','Les légendes gilnéennes disent que ce renard rouge et blanc ne franchit le Voile d’hiver que pendant une seule saison.',54673),
(2039,'frFR','Tortue bleue de bataille sauvage','|cFFFFD200Comptoir|r','Ne courez pas après vos adversaires comme un bleu. Vous avez des canons. Personne ne distance un canon.',54673),
(2078,'frFR','Chèvre de monte des neiges','|cFFFFD200Évènement mondial :|r WoW Remix: Mists of Pandaria','Les chèvres des montagnes du sommet de Kun-Lai peuvent grimper sur les plus hauts pics à la recherche de grains de kafa et de morceaux de sel.',54673),
(2080,'frFR','Petite chèvre de monte rousse','|cFFFFD200Évènement mondial :|r Mists of Pandaria: Remix','Cette chèvre compense sa petite taille par un entêtement hors du commun.',54673),
(2145,'frFR','[PH] Goblin Surfboard - Blue','Comptoir','',54673),
(2201,'frFR','Loup de guerre sentinelle','Comptoir','Capturé lors d’un raid de sentinelle, la loyauté de ce loup va aux individus les plus forts.',54673),
(1468,'itIT','Svolazzina d\'Ambra','|cFFFFD200Emporio|r|n','Un dono da parte di Nonno Baffetto per l\'Emporio, le svolazzine d\'ambra sono estremamente docili.',54673),
(1582,'itIT','Tartaruga da Battaglia Verde Selvaggia','|cFFFFD200Emporio|r','La tartaruga è troppo lenta per inseguire i nemici? Aggiungi dei cannoni. Nessuno batte in velocità un cannone.',54673),
(1742,'itIT','Scorpide di Vilcristallo','|cFFFFD200Emporio|r','I risultati di un esperimento di vilinfusione con un esemplare della progenie di Skorpiron.',54673),
(1785,'itIT','Mammuceronte Ancestrale','|cFFFFD200Emporio|r|n','Questo mammuceronte ha visto passare molte ere, osservando tutto con grande pazienza.',54673),
(1841,'itIT','Mantolume Cremisi','|cFFFFD200Emporio|r','Una leggenda di Gilneas racconta che questa volpe rossa e bianca compare a Grande Inverno solo in una stagione.',54673),
(2039,'itIT','Tartaruga da Battaglia Blu Selvaggia','|cFFFFD200Emporio|r','Ora ho capito come ha fatto a battere la lepre! Con i cannoni!',54673),
(2078,'itIT','Caprone Cavalcabile Nevoso','|cFFFFD200Evento mondiale:|r WoW Remix: Mists of Pandaria','Le capre delle nevi del Massiccio del Kun-Lai sono note per scalare persino le vette più alte alla ricerca di semi di kafa e depositi di sale.',54673),
(2080,'itIT','Mini Caprone Cavalcabile Rosso','|cFFFFD200Evento mondiale:|r Mists of Pandaria: Remix','Questa capra compensa la modesta dimensione con la testardaggine.',54673),
(2145,'itIT','[PH] Goblin Surfboard - Blue','Emporio','',54673),
(2201,'itIT','Lupo da Guerra Sentinella','Emporio','La lealtà di un lupo catturato durante un\'incursione di Sentinelle va a chi è più forte.',54673),
(1468,'koKR','호박석 쏜살파리','|cFFFFD200교역소|r |n','그랜팝 위스커스가 교역소에 보낸 선물입니다. 호박석 쏜살파리는 놀라울 정도로 온순합니다.',54673),
(1582,'koKR','포악한 녹색 전투거북','|cFFFFD200교역소|r','거북이가 너무 느려 적을 못 쫓아가겠다고요? 대포를 탑재하면 만사형통이죠. 대포는 아무도 못 따돌리니까.',54673),
(1742,'koKR','지옥수정 전갈','|cFFFFD200교역소|r','스코르파이론의 자손에게 지옥을 주입하는 실험 끝에 탄생한 결과물입니다.',54673),
(1785,'koKR','선조의 갈래발굽','|cFFFFD200교역소|r |n','이 갈래발굽은 흘러가는 세월을 지켜보며 모든 것을 목도하였고, 침착하게 수많은 이들에게 탈것 타는 법을 가르치고 있습니다.',54673),
(1841,'koKR','진홍빛 옅은빛털','|cFFFFD200교역소|r','길니아스 전설에 따르면 붉은색과 흰색이 어우러진 여우는 겨울맞이 축제의 한 시즌에서만 모습을 드러낸다고 합니다.',54673),
(2039,'koKR','포악한 푸른색 전투거북','|cFFFFD200교역소|r','적을 추적할 걱정에 우울해하지 마세요. 대포가 있잖아요. 그 무엇도 대포를 피해 도망칠 순 없답니다.',54673),
(2078,'koKR','길들인 흰색 염소','|cFFFFD200이벤트:|r WoW 리믹스: 판다리아의 안개','쿤라이 봉우리 산양은 카파 콩과 소금을 찾아 드높은 봉우리까지 오르는 것으로 유명합니다.',54673),
(2080,'koKR','길들인 붉은색 꼬마 염소','|cFFFFD200이벤트:|r WoW 리믹스: 판다리아의 안개','크기는 작지만 엄청난 고집으로 보완하는 염소입니다.',54673),
(2145,'koKR','[PH] Goblin Surfboard - Blue','교역소','',54673),
(2201,'koKR','파수꾼 전쟁 늑대','교역소','파수꾼 습격 당시 사로잡힌 이 충직한 늑대는 강자를 선호합니다.',54673),
(1468,'ptBR','Zigue-zigue Âmbar','|cFFFFD200Posto Comercial|r|n','Um presente do Vovô Bigode para o Posto Comercial, zigue-zigues âmbar são extremamente dóceis.',54673),
(1582,'ptBR','Tartaruga de Batalha Verde Selvagem','|cFFFFD200Posto Comercial|r','A tartaruga está lenta demais para perseguir os inimigos? Seus problemas acabaram! É só acoplar uns canhões. Nada escapa de canhões.',54673),
(1742,'ptBR','Escorpião de Cristal Vil','|cFFFFD200Posto Comercial|r','Resultado de uma infusão vil experimental com um dos filhotes de Skorpyron.',54673),
(1785,'ptBR','Fenoceronte Ancestral','|cFFFFD200Posto Comercial|r|n','Este fenoceronte já viu a passagem de eras, testemunhando tudo e, pacientemente, ensinando montaria a muitos.',54673),
(1841,'ptBR','Pelo-rútilo Carmesim','|cFFFFD200Posto Comercial|r','A lenda guilneana diz que esta raposa vermelha e branca só cruza o Véu de Inverno durante uma estação.',54673),
(2039,'ptBR','Tartaruga de Batalha Azul Selvagem','|cFFFFD200Posto Comercial|r','Não se canse perseguindo seus inimigos. Você tem canhões. Ninguém pode com canhões.',54673),
(2078,'ptBR','Bode de Montaria Nevado','|cFFFFD200Evento Mundial:|r WoW Remix: Mists of Pandaria','Os cabritos monteses do Monte Kun-Lai são conhecidos por escalar até os picos mais altos em busca de grãos de kafa e pedras de sal.',54673),
(2080,'ptBR','Bode de Montaria Capuzinho Vermelho','|cFFFFD200Evento Mundial:|r Mists of Pandaria: Remix','O que esse cabrito não tem de grande, tem de teimoso.',54673),
(2145,'ptBR','[PH] Goblin Surfboard - Blue','Posto Comercial','',54673),
(2201,'ptBR','Lobo de Guerra Sentinela','Posto Comercial','Conquistada em um raide de sentinela, a lealdade do lobo prefere os mais fortes.',54673),
(1468,'ruRU','Янтарная стрекотуха','|cFFFFD200Торговая лавка|r|n','Этот вид стрекотух, подаренный торговой лавке дедушкой Баки, отличается невероятной покладистостью.',54673),
(1582,'ruRU','Свирепая зеленая боевая черепаха','|cFFFFD200Торговая лавка|r','Черепаха слишком медленная, чтобы догнать вашего врага? Поставьте на нее пушку. От ядра еще никто не убегал!',54673),
(1742,'ruRU','Кристаллический скорпион Скверны','|cFFFFD200Торговая лавка|r','Один из детенышей Скорпирона, над которым проводили эксперименты по скрещиванию со Скверной.',54673),
(1785,'ruRU','Древний копытень','|cFFFFD200Торговая лавка|r|n','Этот копытень повидал все за свою долгую жизнь. Век за веком он терпеливо обучал своих всадников верховой езде.',54673),
(1841,'ruRU','Багровый мерцающий лисохвост','|cFFFFD200Торговая лавка|r','Согласно гилнеасской легенде, эта красно-белая лиса проходит через Зимний Покров только в определенное время года.',54673),
(2039,'ruRU','Свирепая синяя боевая черепаха','|cFFFFD200Торговая лавка|r','Не нужно гоняться за противниками до посинения, когда есть пушки. От ядер еще никто не убегал.',54673),
(2078,'ruRU','Снежный ездовой козел','|cFFFFD200Событие:|r WoW Remix: Mists of Pandaria','Горные козы с вершины Кунь-Лай славятся тем, что поднимаются даже на самые высокие скалы в поисках бобов кафа и отложений соли.',54673),
(2080,'ruRU','Красный ездовой козленок','|cFFFFD200Событие:|r Mists of Pandaria: Remix','Этот козленок компенсирует свой небольшой размер на редкость упрямым нравом.',54673),
(2145,'ruRU','[PH] Goblin Surfboard - Blue','Торговая лавка','',54673),
(2201,'ruRU','Боевой волк часового','Торговая лавка','Трофей, добытый в ходе налета часовых. Волки покоряются лишь сильнейшим.',54673),
(1468,'zhCN','琥珀掠蜓','|cFFFFD200商栈|r|n','晶须爷爷送给商栈的礼物，琥珀掠蜓的性情十分温驯。',54673),
(1582,'zhCN','野绿战龟','|cFFFFD200商栈|r','觉得乌龟跑得太慢，追不上敌人？那就装备上火炮吧。没有猎物能逃出火炮的射程。',54673),
(1742,'zhCN','邪晶战蝎','|cFFFFD200商栈|r','在实验中用邪能灌注进斯考匹隆的一个子嗣后产生的结果。',54673),
(1785,'zhCN','先祖裂蹄牛','|cFFFFD200商栈|r|n','这头裂蹄牛目睹了沧海桑田，见证了许多历史，但它还依然那么耐心，总在教导人们如何骑乘。',54673),
(1841,'zhCN','猩红烁裘狐','|cFFFFD200商栈|r','有个吉尔尼斯传说里提到，这只红白色的狐狸只在某个时节才会穿越冬幕来到艾泽拉斯。',54673),
(2039,'zhCN','野蓝战龟','|cFFFFD200商栈|r','不用为追不上敌人而忧伤，你可是有火炮的。什么都没有火炮快。',54673),
(2078,'zhCN','雪色骑乘山羊','|cFFFFD200世界事件：|r《魔兽世界》幻境新生：熊猫人之谜','昆莱山的山羊能够攀上高耸的绝壁，寻找咔啡豆和盐块。',54673),
(2080,'zhCN','幼年赤红骑乘山羊','|cFFFFD200世界事件：|r熊猫人之谜：幻境新生','虽然这种山羊体型小巧，但它的顽固有增无减。',54673),
(2145,'zhCN','[PH] Goblin Surfboard - Blue','商栈','',54673),
(2201,'zhCN','哨兵战狼','商栈','哨兵部队在一次突袭中捕获了它。狼虽然忠诚，但它们也会偏爱最强者。',54673),
(1468,'zhTW','琥珀掠蜻蜓','|cFFFFD200貿易站|r|n','鬍鬚爺爺的禮物送到貿易站了，琥珀掠蜻蜓真是出奇的溫馴。',54673),
(1582,'zhTW','野蠻綠色戰龜','|cFFFFD200貿易站|r','覺得烏龜速度太慢、追不上對手？那就加幾根砲管吧，再快也沒砲彈快。',54673),
(1742,'zhTW','魔晶巨蝎','|cFFFFD200貿易站|r','對斯寇派隆的其中一個後代進行魔性注入實驗的成果。',54673),
(1785,'zhTW','先祖裂蹄','|cFFFFD200貿易站|r|n','這隻裂蹄經歷無數歲月，見證世事變遷，並耐心地教會許多人騎術。',54673),
(1841,'zhTW','赤紅爍毛','|cFFFFD200貿易站|r','在吉爾尼斯傳說中，這種紅白相間的狐狸只會在一個季節中跨越冬幕出現。 ',54673),
(2039,'zhTW','野蠻藍色戰龜','|cFFFFD200貿易站|r','追著敵人跑的時候不要覺得堵「藍」，你有火砲啊。沒有東西逃得過火砲。',54673),
(2078,'zhTW','冰雪騎乘山羊','|cFFFFD200世界事件：|r《魔獸世界》混搭再造：潘達利亞之謎','據說崑萊峰的山羊為了尋找卡法豆和舔鹽巴，就連最陡峭的山峰都能爬得上去。',54673),
(2080,'zhTW','小紅騎乘山羊','|cFFFFD200世界事件：|r潘達利亞之謎：混搭再造','這隻山羊體型上的不足，就由牠的頑強來補足。',54673),
(2145,'zhTW','[PH] Goblin Surfboard - Blue','貿易站','',54673),
(2201,'zhTW','哨兵戰狼','貿易站','在哨兵進攻中被捕獲的戰狼，只會效忠最強之人。',54673);
